    locations_country_11.article =  importer.locate_object(Article, "id", Article, "id", 6327, {'id': 6327, 'excerpt': 'バヌアツ', 'kicker': 'バヌアツ', 'content': '<p>バヌアツ（旧称：ニューヘブリディーズ諸島）は、南太平洋、オーストラリアの東、ソロモン諸島の南に位置する群島である。83の島々からなり、そのうち人が住んでいるのは数少ない。環太平洋火山帯に位置し、火山性である。</p>\r\n\r\n<p>バヌアツには最初、東ポリネシア人が定住し、その後、ソロモン諸島やニューギニアから移住してきたメラネシア人が定住するようになった。1568年にスペインの探検家アルバロ・デ・メンダーニャ・デ・ネイラがこの島々を初めて訪れました。その後、イギリスが領有権を主張したが、19世紀初頭にフランスが上陸するまで、ほとんど人が住まないままだった。1887年、イギリスが北の島々を、フランスが南の島々を支配することになり、両国の間で分割された。</p>\r\n\r\n<p>1906年、フランスの植民地となったが、それも束の間。1908年、英国に引き渡され、1980年の独立まで英国が支配した。国名は、土地や家を意味するvanuaに由来するVanuatuとなった。</p>\r\n\r\n<p>独立後、バヌアツは民主主義国家となり、何度もクーデターやクーデター未遂が起きている。最も新しいクーデターは2008年に発生し、セルジュ・ヴォホル首相が反乱軍の兵士によって倒された。</p>\r\n\r\n<p>現在、バヌアツは英連邦と国際連合に加盟している。経済は自給自足農業、漁業、観光業を基盤としている。また、太平洋諸島フォーラムのメンバーでもある。</p>\r\n\r\n<p>バヌアツの島々は、世界で最も美しい島のひとつに数えられています。ビーチは素晴らしく、景色は息をのむほど美しいです。人々はフレンドリーで歓迎され、その文化は豊かで多様性に富んでいます。バヌアツには誰もが楽しめる何かがあり、休暇を過ごすのに最適な目的地です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
