    locations_country_15.article =  importer.locate_object(Article, "id", Article, "id", 6331, {'id': 6331, 'excerpt': 'ウルグアイ', 'kicker': 'ウルグアイ', 'content': '<p>ウルグアイは、南アメリカ大陸の南東部に位置する国である。北と東にブラジル、南と西にアルゼンチン、南東に大西洋に面している。ウルグアイの面積は176,220平方キロメートル（68,037平方マイル）で、スリナムに次いで南米で2番目に小さい国である。首都であり最大の都市であるモンテビデオは、人口130万人である。</p>\r\n\r\n<p>ウルグアイに最初に住んだのはチャルーア族で、18世紀にスペイン人によって殺されるか、追い出された。ウルグアイは16世紀にスペインの植民地となり、1825年に独立共和国となった。その後、文民・軍民の独裁政権が続いている。</p>\r\n\r\n<p>ウルグアイは、大統領と二院制の立法府からなる立憲共和制をとっている。大統領は5年の任期で選出され、最長で2期まで務めることができます。二院制の議会には上院と下院があります。上院は30名の議員からなり、任期は5年、下院は99名の議員からなり、任期は4年です。</p>\r\n\r\n<p>ウルグアイの主要政党は、広範な戦線（Frente Amplio）、国民党、コロラド党の3党である。中道左派のフレンテ・アンプリオは2004年以来、支配的な政党である。</p>\r\n\r\n<p>ウルグアイは社会民主主義国家であり、混合経済である。政府は多くの企業を所有していますが、民間企業も多く存在します。主な産業は農業、牧畜業、鉱業、漁業、製造業である。主な輸出品は、牛肉、皮革、穀物、乳製品です。主な輸入品は機械、化学薬品、燃料などです。</p>\r\n\r\n<p>ウルグアイの生活水準は高い。成人の識字率は98.8％、出生時の平均寿命は77歳である。教育と医療は無料で提供されています。失業率は6.5%です。</p>\r\n\r\n<p>ウルグアイは国連、メルコスール貿易圏、米州機構に加盟している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
