    locations_country_16.article =  importer.locate_object(Article, "id", Article, "id", 6332, {'id': 6332, 'excerpt': 'Uruguay', 'kicker': 'Uruguay', 'content': '<p>Uruguay is a country located in the southeastern region of South America. It is bordered by Brazil to the north and east, Argentina to the south and west, and the Atlantic Ocean to the southeast. Uruguay is the second-smallest country in South America (after Suriname) with an area of 176,220 square kilometers (68,037 square miles). Montevideo, the capital and largest city, has a population of 1.3 million.</p>\r\n\r\n<p>The first people to inhabit Uruguay were the Charrúa Indians, who were killed or driven out by the Spanish in the 18th century. Uruguay was colonized by the Spanish in the 16th century and became an independent republic in 1825. It has been governed by a series of civilian and military dictatorships since then.</p>\r\n\r\n<p>Uruguay is a constitutional republic with a president and a bicameral legislature. The president is elected for a five-year term and can serve up to two terms. The bicameral legislature has a Senate and a Chamber of Deputies. The Senate has 30 members, who are elected for five-year terms, and the Chamber of Deputies has 99 members, who are elected for four-year terms.</p>\r\n\r\n<p>The main political parties in Uruguay are the Frente Amplio (Broad Front), the National Party, and the Colorado Party. The Frente Amplio, which is a left-of-center party, has been the dominant party since 2004.</p>\r\n\r\n<p>Uruguay is a social democratic country with a mixed economy. The government owns a number of businesses, but there is also a large private sector. The main industries are agriculture, cattle farming, mining, fishing, and manufacturing. The main exports are beef, leather, grains, and dairy products. The main imports are machinery, chemicals, and fuels.</p>\r\n\r\n<p>Uruguay has a high standard of living. The adult literacy rate is 98.8 percent, and the life expectancy at birth is 77 years. There is free education and health care. The unemployment rate is 6.5 percent.</p>\r\n\r\n<p>Uruguay is a member of the United Nations, the Mercosur trade bloc, and the Organization of American States.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
