    locations_country_17.article =  importer.locate_object(Article, "id", Article, "id", 6333, {'id': 6333, 'excerpt': '米国', 'kicker': '米国', 'content': '<p>情報機関</p>\r\n\r\n<p>米国の情報コミュニティは、情報収集のために協力する政府機関の集合体である。このコミュニティは、国家情報長官（Director of National Intelligence）が率いている。コミュニティを構成する機関は以下の通りです。</p>\r\n\r\n<p>中央情報局(CIA)</p>\r\n\r\n<p>国家安全保障局(NSA)</p>\r\n\r\n<p>連邦捜査局(FBI)</p>\r\n\r\n<p>国防総省(DoD)</p>\r\n\r\n<p>国土安全保障省 (DHS)</p>\r\n\r\n<p>国務省 (DOS)</p>\r\n\r\n<p>財務省（Treasury）</p>\r\n\r\n<p>国家情報長官室 (ODNI)</p>\r\n\r\n<p>各機関はそれぞれ異なる使命を持ち、独立して活動しているが、情報収集のために協力し合っている。</p>\r\n\r\n<p>中央情報局（Central Intelligence Agency）は、米国の主要な情報機関である。対外情報収集と防諜を担当する。また、CIAは情報コミュニティに対して指導的・戦略的なガイダンスを提供する。</p>\r\n\r\n<p>国家安全保障局（National Security Agency）は、シグナル・インテリジェンスを担当する主要な機関である。電子的な通信や技術から情報を収集する。</p>\r\n\r\n<p>連邦捜査局は法執行と国内諜報を担当する主要機関である。犯罪や国家安全保障上の脅威に関する情報を収集する。</p>\r\n\r\n<p>国防総省は軍事情報の収集に責任を負う主要機関である。外国の軍隊の意図と能力に関する情報を収集する。</p>\r\n\r\n<p>国土安全保障省は、国内の脅威に関する情報を収集する主要な機関である。テロリストやその他の国土への脅威に関する情報を収集する。</p>\r\n\r\n<p>国務省は、外交情報を収集する主要機関である。他国の意図とそれが米国の利益に与える影響についての情報を収集する。</p>\r\n\r\n<p>財務省は経済情報の収集に責任を負う主要機関である。外国の国や組織の金融活動に関する情報を収集する。</p>\r\n\r\n<p>国家情報長官室（Office of the Director of National Intelligence）は情報機関のトップである。情報機関の調整と統合を担当する。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
