    locations_country_18.article =  importer.locate_object(Article, "id", Article, "id", 6334, {'id': 6334, 'excerpt': 'United States', 'kicker': 'United States', 'content': '<p>IIntelligence Agencies</p>\r\n\r\n<p>The United States intelligence community is a collection of government organizations that work together to gather intelligence. The community is led by the Director of National Intelligence. The agencies that make up the community are:</p>\r\n\r\n<p>The Central Intelligence Agency (CIA)</p>\r\n\r\n<p>The National Security Agency (NSA)</p>\r\n\r\n<p>The Federal Bureau of Investigation (FBI)</p>\r\n\r\n<p>The Department of Defense (DoD)</p>\r\n\r\n<p>The Department of Homeland Security (DHS)</p>\r\n\r\n<p>The Department of State (DOS)</p>\r\n\r\n<p>The Department of the Treasury (Treasury)</p>\r\n\r\n<p>The Office of the Director of National Intelligence (ODNI)</p>\r\n\r\n<p>The agencies have different missions and operate independently, but they all work together to gather intelligence.</p>\r\n\r\n<p>The Central Intelligence Agency is the primary intelligence agency of the United States. It is responsible for gathering foreign intelligence and counter-intelligence. The CIA also provides leadership and strategic guidance to the intelligence community.</p>\r\n\r\n<p>The National Security Agency is the primary agency responsible for signals intelligence. It gathers information from electronic communications and technologies.</p>\r\n\r\n<p>The Federal Bureau of Investigation is the primary agency responsible for law enforcement and domestic intelligence. It gathers information about criminal and national security threats.</p>\r\n\r\n<p>The Department of Defense is the primary agency responsible for gathering military intelligence. It gathers information about the intentions and capabilities of foreign militaries.</p>\r\n\r\n<p>The Department of Homeland Security is the primary agency responsible for gathering intelligence about domestic threats. It gathers information about terrorists and other threats to the homeland.</p>\r\n\r\n<p>The Department of State is the primary agency responsible for gathering diplomatic intelligence. It gathers information about the intentions of other countries and their impact on US interests.</p>\r\n\r\n<p>The Department of the Treasury is the primary agency responsible for gathering economic intelligence. It gathers information about the financial activities of foreign countries and organizations.</p>\r\n\r\n<p>The Office of the Director of National Intelligence is the head of the intelligence community. It is responsible for co-ordination and integration of the intelligence community.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
