    locations_country_21.article =  importer.locate_object(Article, "id", Article, "id", 6337, {'id': 6337, 'excerpt': 'イギリス', 'kicker': 'イギリス', 'content': '<p>グレートブリテン及び北アイルランド連合王国（英: United Kingdom of Great Britain and Northern Ireland）は、ヨーロッパ大陸北西部の海岸に位置する主権国家である。グレートブリテン島、アイルランド島北東部、および多くの小島から成る。東は北海、南はイギリス海峡、南西はケルト海に面し、北大西洋に面した海岸線は約3,000kmに及ぶ。イギリスとアイルランドの間にはアイリッシュ海がある。</p>\r\n\r\n<p>イギリスは4つの国からなる単一国家である。イギリスは、イングランド、スコットランド、ウェールズ、北アイルランドの4つの国からなる単一国家です。イギリス国内では、ユニタリーステートは単一の政府システムを持つ国であり、個別の州や地方自治体が存在しないことを意味する。対応する形容詞は「ユニタリー（unitary）」。英国の人口は6,600万人と推定されている。</p>\r\n\r\n<p>英国は、君主を国家元首とする議院内閣制をとっている。君主は現在エリザベス2世で、共通の言語、歴史、文化、制度を持つ53カ国からなる英連邦の元首である。英国は欧州連合（EU）に加盟しているが、2016年6月に実施された国民投票によりEUから離脱する予定である。</p>\r\n\r\n<p>イギリスは、社会主義の要素を一部含む市場経済を行っています。経済的自由度が高く、人間開発指数も高く、2016年には世界第10位にランクインしています。英国は、名目GDPで世界第5位、PPPで世界第6位の経済大国です。購買力平価（PPP）ベースでは米国に次ぐ世界第2位の経済大国です。英国は金融と銀行の主要な中心地である。</p>\r\n\r\n<p>イギリスは1707年にイングランドとスコットランドの議会が合併して成立した。1800年の連合法によりアイルランド王国が加わり、グレートブリテン及びアイルランド連合王国となった。1922年、アイルランド自由国が連合から離脱し、アイルランド島の分割と独立したアイルランド共和国の誕生につながった。イギリスは核兵器プログラムを最初に開発した国であり、公認された5つの核兵器国のうちの1つである。</p>\r\n\r\n<p>英国は1000年以上にわたる長く複雑な歴史を持っている。英語、議会制度、近代的な企業概念、産業革命など、英国は世界の文化に多大な貢献をしてきた。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
