    locations_country_35.article =  importer.locate_object(Article, "id", Article, "id", 6351, {'id': 6351, 'excerpt': 'トルコ', 'kicker': 'トルコ', 'content': '<p>トルコ共和国（トルコきょうわこく）、通称トルコは、ユーラシア大陸の西アジアのアナトリアを中心とする大陸横断的な国家で、東南アジアのバルカン半島にもその一部が存在する。ヨーロッパに位置する東トラキアも、物理的・文化的にアナトリアと類似しているため、トルコの一部と見なされている。北西にブルガリア、西にギリシャ、北東にグルジア、東にアルメニア、イラン、アゼルバイジャンのナヒチバン島、南にシリアとイラクの8カ国と国境を接している。西は地中海とエーゲ海、北はトルコ海峡に面している。アナトリアとトラキアを隔てるマルマラ海は世界最大の内海であり、ヨーロッパでは唯一の内海である。トルコの領土は77,695平方キロメートル（30,084平方マイル）である。トルコの人口は2017年時点で7870万人と推定され、1平方キロメートルあたり約101人（260/平方マイル）の密度で、人口の大半はイスラム教徒である。トルコ語が公用語であり、クルド語やザザキ語も広く話されています。トルコの文化遺産は、アナトリア、ヘレニズム、ローマ、ビザンチン、セルジューク、オスマン、現代美術など多岐にわたる。OECD、欧州評議会、G20のメンバーである。</p>\r\n\r\n<p>トルコ共和国は、西アジアのアナトリア地方を中心に、ヨーロッパ南東部、バルカン半島にも一部存在するユーラシア大陸の国です。西はエーゲ海と地中海に面し、北はトルコ海峡に面している。ヨーロッパにある東トラキアもトルコの一部とみなされている。トルコは8カ国と国境を接している。北西にブルガリア、西にギリシャ、北東にグルジア、東にアルメニア、イラン、アゼルバイジャンのナヒチバン島、南にシリアとイラクの8カ国と国境を接している。イスタンブールはトルコ最大の都市である。人口の大半はイスラム教徒である。トルコ語が公用語であるが、クルド語やザザキ語も広く使われている。トルコにはアナトリア、ヘレニズム、ローマ、ビザンティン、セルジューク、オスマン、現代美術など多様な文化遺産がある。OECD、欧州評議会、G20のメンバーである。</p>\r\n\r\n<p>トルコは単一民族、世俗的、民主的な共和制国家で、多様な文化遺産を有しています。過去数十年の間に発展した市場経済を持つ国である。トルコは1949年から欧州評議会に、1952年からNATOに、1961年からOECDに加盟している。トルコ共和国は1923年10月29日、トルコ独立戦争の結果、建国された。初代大統領ムスタファ・ケマル・アタテュルクは、絶対王政から世俗的な民主主義へと政権を転換させた。1934年に女性の投票権、1935年に政治的地位の獲得が実現した。1946年、第1回総選挙が行われた。1946年に初の総選挙が行われ、民主党が過半数の議席を獲得し、政権を発足させた。1945年、トルコは国際連合に加盟した。</p>\r\n\r\n<p>トルコは単一民族、世俗的、民主的な共和制国家で、多様な文化遺産を有している。トルコは過去数十年の間に市場経済が発展した国である。トルコは1949年から欧州評議会に、1952年からNATOに、1961年からOECDに加盟している。トルコ共和国は1923年10月29日、トルコ独立戦争の結果、建国された。初代大統領ムスタファ・ケマル・アタテュルクは、絶対王政から世俗的な民主主義へと政権を転換させた。1934年に女性の投票権、1935年に政治的地位の獲得が実現した。1946年、第1回総選挙が行われた。1946年に初の総選挙が行われ、民主党が過半数の議席を獲得し、政権を発足させた。1945年、トルコ共和国は国際連合に加盟した。</p>\r\n\r\n<p>トルコは、西アジアのアナトリア地方を中心に、ヨーロッパ南東部、バルカン半島の一部に位置するユーラシア大陸の国である。西はエーゲ海と地中海に面し、北はトルコ海峡に面している。ヨーロッパにある東トラキアもトルコの一部とみなされている。トルコは8カ国と国境を接している。北西にブルガリア、西にギリシャ、北東にグルジア、東にアルメニア、イラン、アゼルバイジャンのナヒチバン島、南にシリアとイラクの8カ国と国境を接している。イスタンブールはトルコ最大の都市である。人口の大半はイスラム教徒である。トルコ語が公用語であるが、クルド語やザザキ語も広く使われている。トルコにはアナトリア、ヘレニズム、ローマ、ビザンティン、セルジューク、オスマン、現代美術など多様な文化遺産がある。OECD、欧州評議会、G20のメンバーである。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
