    locations_country_37.article =  importer.locate_object(Article, "id", Article, "id", 6353, {'id': 6353, 'excerpt': 'チュニジア', 'kicker': 'チュニジア', 'content': '<p>チュニジアは、地中海とアルジェリアに面する北アフリカの国である。正式名称は、チュニジア共和国。首都はチュニスで、最大の都市である。国土は24の県に分かれている。</p>\r\n\r\n<p>チュニジアに最初に住み着いたのはベルベル人である。紀元前814年、地中海東部の民族フェニキア人がチュニジアの主要都市カルタゴを建設した。紀元前146年にローマ帝国が支配下においた。紀元4世紀には、チュニジア全土にキリスト教が広まりました。紀元7世紀、アラブ人の侵略によりイスラム教が広まりました。</p>\r\n\r\n<p>16世紀から19世紀にかけては、オスマン帝国がチュニジアを支配した。この間、チュニジアはパシャによって統治された。19世紀になると、フランスやイタリアなどのヨーロッパ列強がチュニジアに関心を持ち始める。1881年、チュニジアはフランスの保護領となった。1956年、チュニジアはフランスから独立した。</p>\r\n\r\n<p>独立後、チュニジアは共和制をとっている。国家元首は大統領である。首相は政府の長である。議会は一院制で、共和国議会と呼ばれる。チュニジアの主要政党は、共和国会議、労働と自由のための民主フォーラム、イスラム教のエンナハダ運動、ニダアトウンズ党である。</p>\r\n\r\n<p>チュニジアは中所得国である。経済は、農業、漁業、鉱業、製造業、観光業を基盤としています。主な農産物はオリーブ、ナツメヤシ、柑橘類、小麦です。主な漁獲物はマグロ、イワシ、タコです。主な鉱物はリン酸塩と鉄鉱石。主な製造業は繊維、衣類、靴。観光業が主な収入源となっています。</p>\r\n\r\n<p>チュニジアの人口は1,100万人以上。国民の大多数はイスラム教スンニ派です。公用語はフランス語とアラビア語です。通貨はチュニジア・ディナールです。</p>\r\n\r\n<p>チュニジアは国連、アフリカ連合、アラブ連盟、イスラム会議機構、地中海連合に加盟している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
