    locations_country_38.article =  importer.locate_object(Article, "id", Article, "id", 6354, {'id': 6354, 'excerpt': 'Tunisia', 'kicker': 'Tunisia', 'content': "<p>Tunisia is a North African country bordering the Mediterranean Sea and Algeria. The official name of the country is the Tunisian Republic. The capital and largest city is Tunis. The country is divided into 24 governorates.</p>\r\n\r\n<p>The first people to inhabit Tunisia were the Berbers. The Phoenicians, a people from the eastern Mediterranean, founded Carthage, Tunisia's major city, in 814 BC. The Romans took control of the country in 146 BC. Christianity spread throughout Tunisia in the 4th century AD. Arab invasions in the 7th century AD brought Islam to the country.</p>\r\n\r\n<p>The Ottoman Empire controlled Tunisia from the 16th to the 19th centuries. During this time, Tunisia was ruled by a pasha. European powers, including France and Italy, began to take an interest in Tunisia in the 19th century. In 1881, Tunisia became a protectorate of France. In 1956, Tunisia gained its independence from France.</p>\r\n\r\n<p>Since gaining its independence, Tunisia has been a republic. The president is the head of state. The prime minister is the head of government. The unicameral legislature is the Assembly of the Republic. The major political parties in Tunisia are the Congress for the Republic, the Democratic Forum for Labor and Liberties, the Islamist Ennahda Movement, and the Nidaa Tounes party.</p>\r\n\r\n<p>Tunisia is a middle-income country. The economy is based on agriculture, fishing, mining, manufacturing, and tourism. The main agricultural products are olives, dates, citrus fruits, and wheat. The main fishing catches are tuna, sardines, and octopus. The main minerals mined are phosphates and iron ore. The main manufactures are textiles, clothing, and shoes. Tourism is a major source of revenue.</p>\r\n\r\n<p>Tunisia has a population of over 11 million people. The majority of the population is Sunni Muslim. French and Arabic are the official languages. The currency is the Tunisian dinar.</p>\r\n\r\n<p>Tunisia is a member of the United Nations, the African Union, the Arab League, the Organization of the Islamic Conference, and the Mediterranean Union.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
