    locations_country_42.article =  importer.locate_object(Article, "id", Article, "id", 6358, {'id': 6358, 'excerpt': 'Tonga', 'kicker': 'Tonga', 'content': '<p>The Kingdom of Tonga is an archipelago in the south Pacific Ocean, comprising 169 islands, of which 36 are inhabited. It is located about two-thirds of the way from Hawaii to New Zealand. Tonga is one of the last absolute monarchies in the world. The king, currently Tupou VI, has broad executive and legislative powers, subject to review by the nobility and the people.</p>\r\n\r\n<p>Tonga has a population of about 105,000 people, of which almost two-thirds live on the main island of Tongatapu. Tongans are Polynesian and the official language is Tongan.</p>\r\n\r\n<p>The islands of Tonga were formed by volcanic activity about 110 million years ago. The first inhabitants are thought to have arrived from Samoa in about the 10th century AD.</p>\r\n\r\n<p>The islands were divided into warring chiefdoms until the 19th century when the British and Americans began to exert influence. In 1900, Tonga became a protectorate of Britain and in 1970, gained its independence.</p>\r\n\r\n<p>Tonga is a constitutional monarchy with a parliamentary democracy. The king is the head of state and the prime minister is the head of government. The king appoints the prime minister who is approved by the nobles and the people.</p>\r\n\r\n<p>The Legislative Assembly has 26 members, 17 of whom are elected by popular vote, while the other nine are appointed by the king.</p>\r\n\r\n<p>Tonga has a mixed economy with a large public sector. The main exports are fish, vanilla, root crops and citrus fruit. Tonga has a high level of human development, with a life expectancy of 73 years and a literacy rate of 98%.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
