    locations_country_53.article =  importer.locate_object(Article, "id", Article, "id", 6369, {'id': 6369, 'excerpt': '台湾', 'kicker': '台湾', 'content': '<p>台湾は、東アジアに位置する島国である。中国本土の沖合約100マイルに位置し、ロードアイランド州よりわずかに小さい島です。台湾の人口は約2,300万人です。台湾の公用語は北京語ですが、他にもいくつかの言語が話されています。台湾の通貨は新台湾ドルです。</p>\r\n\r\n<p>台湾は豊かで多様な歴史を持っています。最初にこの島に住んだのは、東南アジアから来たとされるオーストロネシア人です。台湾に最初に移住したのは中国人で、17世紀頃から大量に移住してきた。1895年、台湾は日本に併合され、第二次世界大戦終了まで日本の統治下にあった。戦後、台湾は中華民国に引き渡された。1949年、中華民国は大陸を共産主義の中華人民共和国に奪われ、台湾に移転した。</p>\r\n\r\n<p>台湾は建国以来、民主主義国家である。1996年に初の総統選挙が行われた。現在の総統は民進党の蔡英文である。1971年以来、国連に加盟している。また、世界貿易機関（WTO）とアジア太平洋経済協力会議（AEC）のメンバーでもある。</p>\r\n\r\n<p>台湾は、サービス業と技術に大きく依存した近代的な経済を持っている。台湾はエレクトロニクスの主要輸出国であり、FoxconnやTSMCなどの大手エレクトロニクス企業の本拠地でもあります。また、観光も台湾の主要な産業です。台湾には多くの美しい寺院や国立公園があります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
