    locations_country_55.article =  importer.locate_object(Article, "id", Article, "id", 6371, {'id': 6371, 'excerpt': 'シリア', 'kicker': 'シリア', 'content': '<p>シリアは中東の国で、面積は71,500平方マイルです。西はレバノンと地中海に面し、北はトルコ、東はイラク、南はヨルダンとイスラエルと国境を接している。首都はダマスカス。スンニ派、シーア派、キリスト教、ドルーズ派、アラウィ派など多様な民族・宗教が存在する。公用語はアラビア語。</p>\r\n\r\n<p>シリアの歴史は古代にさかのぼる。第一次世界大戦後、フランスに統治され、1946年に独立。1970年からはアサド家が統治しています。</p>\r\n\r\n<p>シリア政府は独裁政権である。大統領であるバッシャール・アル・アサドは2000年から政権を握っている。政府は、拷問、投獄、政敵の処刑など、人権侵害で非難されている。</p>\r\n\r\n<p>2011年3月、シリア南部のデラア市で抗議デモが発生しました。デモ隊は政治改革と独裁政権の終焉を訴えていました。政府は暴力で応戦し、抗議デモは他の地域にも広がりました。2012年、反政府勢力が政府と戦い始め、本格的な戦争が始まった。</p>\r\n\r\n<p>反政府勢力、ISISなどのテロ組織、クルド人戦闘員など、さまざまなグループが政府と戦い、複雑な紛争が続いています。25万人以上が死亡し、数百万人が避難している。</p>\r\n\r\n<p>2015年9月、ロシアはアサド政権を支援するため、シリアでの空爆を開始。2016年12月、政府と一部の反政府武装勢力との間で停戦合意が成立しました。しかし、国内の一部地域では戦闘が続いています。</p>\r\n\r\n<p>シリアの将来は不透明です。アサド政権は戦争に勝っているように見えますが、国は荒廃し、経済は破綻しています。平和と安定への明確な道筋はない。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
