    locations_country_69.article =  importer.locate_object(Article, "id", Article, "id", 6385, {'id': 6385, 'excerpt': 'スリランカ', 'kicker': 'スリランカ', 'content': '<p>スリランカは、アジア南部に位置する国である。正式名称はスリランカ民主社会主義共和国である。共和制をとっており、国家元首は大統領である。政府首脳は首相である。人口は約2140万人。国民の大多数は仏教徒である。仏教、ヒンドゥー教、イスラム教、キリスト教など多くの宗教が存在する。議会制民主主義で、使用言語はシンハラ語とタミール語です。通貨はスリランカ・ルピーです。国連、英連邦、南アジア地域協力連合に加盟している。</p>\r\n\r\n<p>スリランカはインド洋に浮かぶ島です。国土はウェストバージニア州とほぼ同じ大きさである。海岸線は1,340キロメートル。最高峰は標高2,524mのピドゥルタラガラ山。国土は熱帯性気候に属している。気温は平均して25〜30度である。モンスーンの季節は2回ある。北東モンスーンのシーズンは11月から2月まで、南西モンスーンのシーズンは5月から7月までである。スリランカは発展途上国であり、一人当たりの所得は4,600ドルである。人間開発指数は0.736である。</p>\r\n\r\n<p>スリランカの公用語はシンハラ語です。シンハラ語はインド・アーリア系の言語です。この言語は約1,860万人に話されています。シンハラ語のアルファベットはブラーフミー文字が基になっています。シンハラ語はシンハラ人の母国語です。また、シンハラ語はスリランカの教育や行政の言語でもあります。</p>\r\n\r\n<p>スリランカの第二公用語はタミール語です。タミール語はドラヴィダ語族の言語です。この言語は約7480万人に話されています。タミール語のアルファベットはグランサ文字に基づいています。タミール語はタミール人の母国語です。また、スリランカの教育や行政の言語もタミル語です。</p>\r\n\r\n<p>英語はスリランカの第3の公用語です。英語はインド・ヨーロッパ語族に属する言語です。この言語は約3億7700万人に話されています。英語のアルファベットはラテン文字に基づいています。英語は多くのスリランカ人にとっての第一言語です。また、英語はスリランカの教育や行政の言語でもあります。</p>\r\n\r\n<p>スリランカの公式宗教は仏教である。仏教はダルマ教に属する宗教です。この宗教は人口の約70.2%が信仰しています。仏教は釈迦の教えに基づいています。釈迦は紀元前6世紀にインドに住んでいた霊的な教師です。仏教では、人生は苦しみであり、苦しみを解決するのは欲望をなくすことであると説いています。仏教の目標は涅槃に到達することです。</p>\r\n\r\n<p>ヒンドゥー教は、スリランカで2番目に人気のある宗教です。ヒンドゥー教はダルマ教の一派の宗教です。この宗教は人口の約13.6％が実践しています。ヒンドゥー教は、ヴェーダの教えに基づいています。ヴェーダはヒンドゥー教の主要な経典である聖典の集合体です。ヒンドゥー教の目的は、モクシャを達成することです。</p>\r\n\r\n<p>イスラム教はスリランカで3番目に人気のある宗教です。イスラム教はアブラハムの一派の宗教です。この宗教は人口の約9.7%が信仰しています。イスラム教はコーランの教えに基づいています。コーランはイスラム教の聖典です。イスラム教の目的はパラダイスを達成することです。</p>\r\n\r\n<p>キリスト教はスリランカで4番目に人気のある宗教です。キリスト教はアブラハムの一派の宗教です。この宗教は人口の約7.4%が実践しています。キリスト教は、聖書の教えに基づいています。聖書はキリスト教の聖典です。キリスト教の目的は、救いを得ることです。</p>\r\n\r\n<p>スリランカは議会制民主主義国家です。国家元首は大統領です。政府のトップは首相です。大統領は国民によって選ばれ、首相は大統領によって任命されます。首相は内閣のリーダーであり、国防相は内閣の中で2番目に重要な役職です。スリランカの国会は二院制である。下院は国民議会、上院は国民議会である。下院は国民によって選出され、上院は大統領によって任命される。スリランカの議会は国の最高立法機関である。</p>\r\n\r\n<p>スリランカの司法は行政や立法府から独立しています。国の最高裁判所は最高裁判所です。最高裁はスリランカにおける最終的な控訴裁判所です。最高裁判所はまた、憲法に関する問題の最終審の裁判所でもあります。最高裁判所はスリランカの首都コロンボにある。</p>\r\n\r\n<p>スリランカは、国連、国際連合、南アジア地域協力連合に加盟している。国際連合は1945年に設立された国際機関である。国際連合の主な目的は、国際的な平和と安全を維持することです。国際連合は、1931年に設立された国際機関です。国際連合は、民主主義と人権を促進することを主な目的としています。南アジア地域協力連合は、1985年に設立された国際機関です。南アジア地域協力連合の主な目的は、経済と社会の発展を促進することです。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
