    locations_country_71.article =  importer.locate_object(Article, "id", Article, "id", 6387, {'id': 6387, 'excerpt': 'スペイン', 'kicker': 'スペイン', 'content': '<p>スペインは、ヨーロッパ南西部のイベリア半島に位置する国です。欧州連合（EU）ではフランスに次いで2番目に大きな国です。面積は505,990km²、人口は2016年現在46,754,784人で、ヨーロッパで8番目に人口の多い国である。</p>\r\n\r\n<p>首都であり最大の都市はマドリードで、その他の主要都市はバルセロナ、バレンシア、セビリア、ビルバオ、マラガなどです。</p>\r\n\r\n<p>スペインは、立憲君主制のもとで議会政治を行う民主主義国家です。名目GDPで世界第14位、購買力平価で世界第16位の経済規模を持つ先進国である。欧州連合、国連、欧州評議会、経済協力開発機構、世界貿易機関、大西洋横断経済協議会に加盟している。</p>\r\n\r\n<p>国土は17の自治州と2つの自治都市に分かれ、合計50の州がある。</p>\r\n\r\n<p>1975年以来、スペインはEUに加盟しており、世界で唯一、EECとNATOの両方に加盟している国である。</p>\r\n\r\n<p>スペイン経済は、名目GDPで世界第12位、購買力平価で世界第5位です。経済協力開発機構（OECD）のメンバーでもあります。</p>\r\n\r\n<p>スペインは高所得国であり、名目GDPで世界第14位、購買力平価で世界第6位の経済規模を持つ。また、輸出国として5位、輸入国として5位となっています。</p>\r\n\r\n<p>スペインの企業は多国籍企業の中で突出した地位を占めている。銀行部門、特にバンキア、サンタンデール銀行、BBVA、カイシャバンク、バンコ・ポピュラーは世界最大級の規模を誇っています。</p>\r\n\r\n<p>2010年、世界保健機関（WHO）は、スペインがスイス、フランスに次いで世界で3番目に優れた医療制度を持っていると報告した。</p>\r\n\r\n<p>スペインは平均寿命が長く、乳幼児死亡率も非常に低い国です。人間開発指数も高く、世界第17位と非常に先進的な国です。また、世界で2番目に平和な国としてランクされています。</p>\r\n\r\n<p>スペインは移民の国である。2010年、スペインには5,004,371人の外国人が住んでおり、人口の10.7％を占めています。</p>\r\n\r\n<p>これらの外国人の多くは、他のヨーロッパ諸国、主にルーマニア、モロッコ、イタリア、ブルガリアから来た人々である。また、スペインにはコロンビア、ベネズエラ、エクアドル出身のラテンアメリカ人が多く住んでいる。</p>\r\n\r\n<p>スペインの文化は、イベリア半島、イタリア、アラブ世界、北アフリカの文化が混ざり合ったものである。</p>\r\n\r\n<p>スペインの芸術はこれらの異なる文化の影響を受けてきた。スペインの有名な画家には、ディエゴ・ベラスケス、フランシスコ・ゴヤ、パブロ・ピカソなどがいます。</p>\r\n\r\n<p>スペインは観光地として人気があり、バルセロナ、マドリッド、グラナダなどが代表的な都市です。</p>\r\n\r\n<p>スペインは、山、川、ビーチ、森林など、多様な景観を持っています。また、温暖な地中海性気候で、観光地として人気があります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
