    locations_country_72.article =  importer.locate_object(Article, "id", Article, "id", 6388, {'id': 6388, 'excerpt': 'Spain', 'kicker': 'Spain', 'content': "<p>Spain is a country located on the Iberian Peninsula in southwestern Europe. It is the second largest country in the European Union after France. With an area of 505,990 km², it has a population of 46,754,784 as of 2016, making it the eighth most populous country in Europe.</p>\r\n\r\n<p>The capital and largest city is Madrid, other major urban areas include Barcelona, Valencia, Seville, Bilbao and Málaga.</p>\r\n\r\n<p>Spain is a democracy organised in the form of a parliamentary government under a constitutional monarchy. It is a developed country with the world's fourteenth largest economy by nominal GDP and sixteenth largest by purchasing power parity. It is a member of the European Union, the United Nations, the Council of Europe, the Organization for Economic Co-operation and Development, the World Trade Organization and the Transatlantic Economic Council.</p>\r\n\r\n<p>The country is divided into 17 autonomous communities and 2 autonomous cities, with a total of 50 provinces.</p>\r\n\r\n<p>Since 1975, Spain has been a member of the European Union, the only country in the world to be a member of both the EEC and NATO.</p>\r\n\r\n<p>The Spanish economy is the twelfth largest in the world by nominal GDP and the fifth largest by purchasing power parity. It is a member of the Organisation for Economic Co-operation and Development (OECD).</p>\r\n\r\n<p>Spain is a high-income country and has the world's fourteenth largest economy by nominal GDP and the sixth largest by purchasing power parity. It is the fifth largest exporter and the fifth largest importer of goods.</p>\r\n\r\n<p>Spanish companies have a prominent position in multinational corporations. The banking sector, particularly Bankia, Banco Santander, BBVA, Caixabank and Banco Popular, are among the largest in the world.</p>\r\n\r\n<p>In 2010, the World Health Organization (WHO) reported that Spain had the world's third best healthcare system, after Switzerland and France.</p>\r\n\r\n<p>Spain has a high life expectancy and a very low infant mortality rate. It is a very developed country, with a high Human Development Index, ranking seventeenth in the world. It has also been ranked as the second most peaceful country in the world.</p>\r\n\r\n<p>Spain is a country of immigrants. In 2010, there were 5,004,371 foreign nationals living in Spain, making up 10.7% of the population.</p>\r\n\r\n<p>Most of these foreign nationals came from other European countries, primarily Romania, Morocco, Italy, and Bulgaria. There is also a large population of Latin Americans living in Spain, primarily from Colombia, Venezuela, and Ecuador.</p>\r\n\r\n<p>The culture of Spain is a mix of the cultures of the Iberian Peninsula, Italy, the Arab world, and North Africa.</p>\r\n\r\n<p>Spanish art has been influenced by these different cultures. Some of the most famous Spanish painters include Diego Velázquez, Francisco Goya, and Pablo Picasso.</p>\r\n\r\n<p>Spain is a popular tourist destination, with Barcelona, Madrid, and Granada being the most popular cities.</p>\r\n\r\n<p>Spain has a diverse landscape, with mountains, rivers, beaches, and forests. It also has a warm Mediterranean climate, making it a popular tourist destination.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
