    locations_country_81.article =  importer.locate_object(Article, "id", Article, "id", 6397, {'id': 6397, 'excerpt': 'スロベニア', 'kicker': 'スロベニア', 'content': '<p>スロベニアでの見どころ</p>\r\n\r\n<p>中央ヨーロッパの小国スロベニアには、観光客を魅了するものがたくさんあります。アルプスと地中海の交差点に位置するため、雪を頂いたアルプスの山々からターコイズブルーのアドリア海まで、変化に富んだ風景が広がっています。また、古代ローマ時代の遺跡やバロック様式の教会など、歴史的・文化的な見どころも豊富です。</p>\r\n\r\n<p>リュブリャナ</p>\r\n\r\n<p>スロベニアの首都リュブリャナは、活気ある文化シーンが魅力の都市です。中心街には細い路地やバロック様式の建物が多く、カフェやバー、レストランも充実しています。リュブリャナの見どころは、街を一望できる丘の上の城と、街の中心を流れるリュブリャナ川です。</p>\r\n\r\n<p>ブレッド湖</p>\r\n\r\n<p>スロベニアを代表する観光地のひとつが、ユリアンアルプスに位置する美しい湖、ブレッド湖です。森に囲まれた丘陵地帯にあるこの湖は、おとぎ話に出てくるような風景で知られ、ハイキング、水泳、スキーなどが楽しめる人気のスポットです。ブレッド湖で最も象徴的な光景は、ブレッド島にある聖母被昇天教会で、手漕ぎボートで行くことができます。</p>\r\n\r\n<p>ピラン</p>\r\n\r\n<p>アドリア海に面した中世の町ピランは、ベネチア様式の建築と美しい海辺のプロムナードで知られています。ピランは海水浴、日光浴、ウィンドサーフィンに人気のスポットで、レストランやカフェも多数あります。また、18世紀の作曲家ジュゼッペ・タルティーニの像があるタルティーニ広場もピランで必見の観光スポットです。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
