    locations_country_83.article =  importer.locate_object(Article, "id", Article, "id", 6399, {'id': 6399, 'excerpt': 'スロバキア', 'kicker': 'スロバキア', 'content': '<p>スロバキアは、中欧に位置する内陸国。西はチェコとオーストリア、北はポーランド、東はウクライナ、南はハンガリーと国境を接しています。人口は540万人以上、総面積は約49,000平方キロメートル（19,000平方マイル）です。スロバキアは、大統領を国家元首とし、首相を政府首脳とする議会制共和制国家である。</p>\r\n\r\n<p>現在のスロバキアには、少なくとも紀元前5世紀頃から人が住んでいたと言われています。紀元2世紀、ローマ帝国はドナウ川に到達し、パンノニア州の北部国境に多くの砦を建設した。紀元1世紀末から、スラブ人が移住し、この地に住むようになった。</p>\r\n\r\n<p>10世紀には、現在のスロバキアの領土はいくつかの公国に分割された。12世紀には、ニトラ公国が最も重要な公国となり、その後1198年に王国に昇格した。10世紀半ばにハンガリー王国が台頭し、12世紀にはスロヴァキア全土を征服した。1526年のモハーチの戦いの後、スロバキアはオスマン帝国の一部となった。</p>\r\n\r\n<p>1683年、ハプスブルク家がオスマン帝国領の征服を開始し、スロヴァキアはハプスブルク帝国に統合された。1785年、スロバキア公国が帝国内の自治体として誕生した。1918年にオーストリア・ハンガリー帝国が崩壊すると、チェコスロバキアが誕生し、スロバキアは新国の自治領となった。</p>\r\n\r\n<p>第二次世界大戦中、スロバキアはナチスの傀儡国家となり、ホロコーストに巻き込まれた。戦後、チェコスロバキアは再統一され、スロバキアはその中の共和国となった。1992年、チェコ・スロバキア連邦共和国が誕生し、スロバキアは独立国家となった。</p>\r\n\r\n<p>スロバキアの経済はサービス業が中心で、GDPの70%以上を占めています。サービス業の主な部門は、貿易、ホテル・レストラン、運輸、情報通信、不動産です。工業はGDPの約25%を占め、エンジニアリング、冶金、化学、食品加工、繊維が主な部門です。農業はGDPの約5％を占め、主な作物は小麦、トウモロコシ、ジャガイモ、テンサイ、ヒマワリなどである。</p>\r\n\r\n<p>スロバキアの主な観光地は、首都ブラチスラバ、歴史都市スピシュ、ユネスコ世界遺産に登録されているコシツェ市の中世の旧市街、低タトラス国立公園、スロバキア楽園国立公園などです。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
