    locations_country_84.article =  importer.locate_object(Article, "id", Article, "id", 6400, {'id': 6400, 'excerpt': 'Slovakia', 'kicker': 'Slovakia', 'content': '<p>Slovakia is a landlocked country in Central Europe. It is bordered by the Czech Republic and Austria to the west, Poland to the north, Ukraine to the east and Hungary to the south. The country has a population of over 5.4 million people and a total area of about 49,000 square kilometers (19,000 sq mi). Slovakia is a parliamentary republic with a president as head of state and a prime minister as head of government.</p>\r\n\r\n<p>The territory of present-day Slovakia has been inhabited since at least the 5th century BC. In the 2nd century AD, the Roman Empire reached the Danube River and built a number of forts on the northern border of the province of Pannonia. From the end of the 1st century AD, the Slavs migrated into the area and started to populate it.</p>\r\n\r\n<p>In the 10th century, the territory of present-day Slovakia was divided into several principalities. In the 12th century, the principality of Nitra became the most important one and it was subsequently elevated to a kingdom in 1198. The Kingdom of Hungary emerged as a powerful state in the middle of the 10th century and conquered all of Slovakia in the 12th century. After the Battle of Mohács in 1526, Slovakia became part of the Ottoman Empire.</p>\r\n\r\n<p>In 1683, the Habsburg Monarchy started to conquer the Ottoman territories and Slovakia was integrated into the Habsburg Empire. The Principality of Slovakia emerged as an autonomous entity within the empire in 1785. After the dissolution of the Austro-Hungarian Empire in 1918, Czechoslovakia was created and Slovakia became an autonomous part of the new country.</p>\r\n\r\n<p>During World War II, Slovakia was a Nazi puppet state and was involved in the Holocaust. After the war, Czechoslovakia was re-created and Slovakia became a republic within it. In 1992, the Czech and Slovak Federative Republic was created and Slovakia became an independent state.</p>\r\n\r\n<p>The economy of Slovakia is based on the service sector, which accounts for over 70% of GDP. The main branches of the service sector are trade, hotels and restaurants, transportation, information and communication, and real estate. Industry accounts for around 25% of GDP and the main branches are engineering, metallurgy, chemicals, food processing, and textiles. The agricultural sector accounts for around 5% of GDP and the main crops are wheat, maize, potatoes, sugar beets, and sunflowers.</p>\r\n\r\n<p>The main tourist destinations in Slovakia are the capital city of Bratislava, the historical city of Spiš, the UNESCO World Heritage Site of medieval Old Town in the city of Košice, the Low Tatras National Park, and the Slovak Paradise National Park.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
