    locations_country_87.article =  importer.locate_object(Article, "id", Article, "id", 6403, {'id': 6403, 'excerpt': 'シエラレオネ', 'kicker': 'シエラレオネ', 'content': '<p>シエラレオネは西アフリカに位置し、北はギニア、南と東はリベリア、西は大西洋に面しています。人口は750万人、面積は71,740平方キロメートルです。シエラレオネの公用語は英語です。</p>\r\n\r\n<p>シエラレオネは大統領制をとる立憲共和制国家である。大統領は国家元首であり、政府の長でもあります。大統領は国民投票により選出され、任期は5年で、2期までと定められています。国会は一院制で、総議員数155名、任期は5年、一般投票により選出されます。司法は行政府および立法府から独立しています。</p>\r\n\r\n<p>シエラレオネは混合経済で、大規模なインフォーマル・セクターがあります。主な経済活動は、農業、鉱業、漁業、林業です。主な輸出品はダイヤモンド、チタン鉱石、鉄鉱石、ボーキサイトです。主な輸入品は機械、輸送機器、食料、石油製品です。多額の対外債務を負っている。</p>\r\n\r\n<p>シエラレオネは人間開発指数が低く、貧しい国である。高いレベルの貧困、不平等、失業に苦しんでいます。人口の大半は農村部に住み、自給自足の農業に頼っています。政府は経済を改善するために努力していますが、依然として非常に貧しい国です。</p>\r\n\r\n<p>シエラレオネは、1991年から2002年まで続いた内戦から回復しつつあります。この戦争は、政府と革命的統一戦線との間で戦われました。この戦争により、5万人以上が死亡し、200万人以上が避難しました。戦争はロメ平和協定の調印で終結しました。</p>\r\n\r\n<p>シエラレオネは国連、アフリカ連合、西アフリカ諸国経済共同体、英連邦に加盟しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
