    locations_country_88.article =  importer.locate_object(Article, "id", Article, "id", 6404, {'id': 6404, 'excerpt': 'Sierra Leone', 'kicker': 'Sierra Leone', 'content': '<p>Sierra Leone is located in West Africa and is bordered by Guinea to the north, Liberia to the south and east, and the Atlantic Ocean to the west. The country has a population of 7.5 million and an area of 71,740 square kilometers. The official language of Sierra Leone is English.</p>\r\n\r\n<p>Sierra Leone is a constitutional republic with a presidential system of government. The president is the head of state and the head of government. The president is elected by popular vote for a five-year term and is limited to two terms. The parliament is unicameral and has a total of 155 members who are elected by popular vote to serve five-year terms. The judiciary is independent of the executive and the legislature.</p>\r\n\r\n<p>Sierra Leone has a mixed economy with a large informal sector. The main economic activities are agriculture, mining, fishing, and forestry. The main exports are diamonds, titanium ore, iron ore, and bauxite. The main imports are machinery, transportation equipment, food, and petroleum products. The country has a large external debt burden.</p>\r\n\r\n<p>Sierra Leone is a poor country with a low Human Development Index. The country suffers from high levels of poverty, inequality, and unemployment. The majority of the population lives in rural areas and relies on subsistence agriculture. The government has made efforts to improve the economy, but the country remains very poor.</p>\r\n\r\n<p>Sierra Leone is recovering from a civil war that lasted from 1991 to 2002. The war was fought between the government and the Revolutionary United Front. The war resulted in the death of over 50,000 people and the displacement of over two million people. The war ended with the signing of the Lomé Peace Agreement.</p>\r\n\r\n<p>Sierra Leone is a member of the United Nations, the African Union, the Economic Community of West African States, and the Commonwealth of Nations.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
