    locations_country_95.article =  importer.locate_object(Article, "id", Article, "id", 6411, {'id': 6411, 'excerpt': 'サウジアラビア', 'kicker': 'サウジアラビア', 'content': '<p>対米関係</p>\r\n\r\n<p>米国とサウジアラビアの関係は、世界で最も重要かつ長年の関係の一つである。両国は相互防衛協定を結んでおり、テロ対策や地域安全保障などの問題で緊密に連携している。また、米国はサウジアラビアの石油に依存し、逆にサウジアラビアは米国の軍事・経済に依存している。</p>\r\n\r\n<p>米国とサウジアラビアの関係のルーツは、1933年に米国のビジネスマンが石油開発の可能性を探るために初めてサウジアラビアを訪れたときにさかのぼる。1945年、米国とサウジアラビアは国交を樹立した。翌年、フランクリン・D・ルーズベルト大統領は、スエズ運河でアメリカ海軍の船に乗り、サウジアラビアの近代国家を築いたアブドゥル・アジーズ・イブン・サウド国王と会談した。両者は親密な関係を築き、米国はサウジアラビアの緊密な同盟国となった。</p>\r\n\r\n<p>1953年、両国の間で相互防衛協定が結ばれた。この協定は、サウジアラビアが攻撃された場合、米国はサウジアラビアを防衛し、サウジアラビアは米国に同じことをするというものである。この協定は現在も有効であり、特に1991年の湾岸戦争では何度も発動されている。</p>\r\n\r\n<p>米国とサウジアラビアの関係は時に緊張を伴う。特に湾岸戦争では、米国はサウジアラビア上空に飛行禁止区域を設定し、イラクを空爆した。また、1992年にはファハド国王の辞任を強行した。しかし、その後、関係は改善され、両国はテロ対策やシリア戦争などの問題で緊密に協力している。</p>\r\n\r\n<p>米国はサウジの石油に依存し、逆にサウジアラビアは米国の軍事・経済に依存している。</p>\r\n\r\n<p>米国はサウジアラビアの石油の最大の購入者であり、2016年には米国はサウジアラビアから1日当たり100万バレル以上の石油を輸入している。米国とサウジアラビアは、石油市場の安定維持に相互に関心を持ち、生産枠や石油価格などの問題で協力してきた。</p>\r\n\r\n<p>また、米軍もサウジアラビアに依存している。両国は軍事的に密接な関係にあり、サウジアラビア軍は米軍から訓練を受けている。また、米軍はサウジアラビアをこの地域での作戦の中継地として利用している。</p>\r\n\r\n<p>米国経済もサウジアラビアとの緊密な関係から恩恵を受けている。サウジアラビアはアラブ最大の経済大国であり、米国経済への重要な投資家である。また、サウジアラビアは海外資産への投資を通じて世界経済の安定化に貢献している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
