    locations_country_105.article =  importer.locate_object(Article, "id", Article, "id", 6421, {'id': 6421, 'excerpt': 'セントルシア', 'kicker': 'セントルシア', 'content': '<p>セントルシアは、カリブ海東部に位置する主権国家である。国土は1つの島からなり、北部の小さなスフリエール・ヒルズと南部の大きなグロス・イスレットに分かれる。セントルシアはトリニダード・トバゴの東、マルティニークの北に位置する。また、ウィンドワード諸島の最東端の島でもある。</p>\r\n\r\n<p>国名はもともとカリアクー・グレナディーン諸島のセントルシアだったが、2009年に政府が国名をセントルシアに改称した。</p>\r\n\r\n<p>この島国には最初、アラワク族とカリブ族が住んでいた。1493年にクリストファー・コロンブスの代理として航海したディエゴ・ガルシア・デ・パラシオがこの島を初めて訪れたヨーロッパ人である。</p>\r\n\r\n<p>1605年、フランスがこの島を植民地化し、フランスの植民地として設立した。1762年にイギリスが占領したが、1763年にフランスに返還された。1814年、イギリスがこの島を支配し、以来、イギリス領となっている。</p>\r\n\r\n<p>1979年2月22日、セントルシアはイギリスから独立した。</p>\r\n\r\n<p>セントルシアの政府は議会制民主主義である。国家元首はイギリスの女王で、島では総督が代表を務めています。政府首脳は首相である。</p>\r\n\r\n<p>セントルシアで話されている主な言語は英語とフランス語です。また、人口の約70％がクレオール語を話しています。</p>\r\n\r\n<p>経済は、観光、農業、漁業が中心です。</p>\r\n\r\n<p>セントルシアの通貨は東カリブ海ドルです。</p>\r\n\r\n<p>カリブ海共同体（CARICOM）、東カリブ海諸国機構（OECS）、国連（UN）に加盟している。</p>\r\n\r\n<p>セントルシアの人口はおよそ174,000人です。</p>\r\n\r\n<p>セントルシアの人口の大半はカトリック教徒です。</p>\r\n\r\n<p>セントルシアの主な観光地は、ビーチ、熱帯雨林、火山です。</p>\r\n\r\n<p>セントルシアで最も人気のある観光地は、Anse Chatte、Anse Cochon、Anse La Raye、ピジョン島国立公園、Soufrière Hillsなどがあります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
