    locations_country_111.article =  importer.locate_object(Article, "id", Article, "id", 6427, {'id': 6427, 'excerpt': 'サバ（オランダ）', 'kicker': 'サバ（オランダ）', 'content': '<p>サバはカリブ海に浮かぶ島で、オランダで最も小さな自治体（行政区画）です。サバ本島と沖合の無人島数個からなる。2013年1月現在、人口は1,991人、総面積は13.10 km2 (5.05 sq mi)である。</p>\r\n\r\n<p>サバ本島は、サンマルタン島の東約13km、セントクリストファー・ネイビス島の北東に位置しています。サバは約12万5千年前に形成された火山性およびエオリック性である。島は、最高地点であるシーナリー山の標高589mにそびえています。</p>\r\n\r\n<p>サバ島の最初の住民は、紀元8世紀に本土から移住してきたアラワカン語を話すタイノ人でした。1493年11月13日、クリストファー・コロンブスがこの島を発見したと言われている。コロンブスは1493年11月13日に島を発見したが、島の断崖絶壁に阻まれ、上陸はしなかった。1632年、イギリス人がサバ島に上陸し、タバコやトウモロコシ、野菜などを植え、農業を始めた。</p>\r\n\r\n<p>18世紀初頭、サバはオランダ人によって植民地化された。オランダの西インド会社は、極東への中継地としてこの島を開発しようとしたが、採算がとれず、1719年に放棄された。1718年には海賊が一時的に島を占拠した。</p>\r\n\r\n<p>1776年、サバはオランダ西インド会社に併合され、1796年にはオランダ王国の一部となった。1884年の地震で被害を受けた。</p>\r\n\r\n<p>第二次世界大戦中、オランダはナチス・ドイツに占領され、サバはオランダ亡命政府によって管理されていた。戦後、オランダは共和制に移行し、サバは再びオランダの統治下に置かれた。</p>\r\n\r\n<p>1956年、サバはオランダ領アンティル諸島の一部となった。1985年には自治権を獲得し、オランダ領アンティル諸島の議会にも議席を持つようになった。2010年にオランダ領アンティル諸島が解体された後、サバはオランダの一部となった。</p>\r\n\r\n<p>サバ本島は、長さ約13km、幅約5kmの島です。島で最も高いシーナリー山は標高589m。島には小さな珊瑚礁がいくつもあります。サバ島には大きな深海港や主要な居住地はありません。</p>\r\n\r\n<p>また、島の中心部の谷間にあるザ・ボトムという町が中心となっています。このほか、ヘルズ・ゲート、ウィンドワード・サイドなどの集落がある。</p>\r\n\r\n<p>サバの気候は熱帯性で、1月から7月までが乾季、8月から12月までが雨季となっています。平均気温は27℃で、常に風が吹いています。</p>\r\n\r\n<p>サバの経済は、観光、漁業、農業が中心となっている。主な農産物は、バナナ、トマト、キュウリ、花など。サバには小さな漁船団があり、主な輸出品は魚とロブスターである。</p>\r\n\r\n<p>サバの人口は1,991人で、そのうち916人がオランダ人である。人口の大半はプロテスタント（76％）である。公用語はオランダ語。</p>\r\n\r\n<p>サバは人気のある観光地で、多くの観光客がクルーズ船でやってきます。主な見どころは、島の火山風景、小さな珊瑚礁、山の風景です。また、スキューバダイビングの人気スポットでもある。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
