    locations_country_112.article =  importer.locate_object(Article, "id", Article, "id", 6428, {'id': 6428, 'excerpt': 'Saba (Netherlands)', 'kicker': 'Saba (Netherlands)', 'content': "<p>Saba is a Caribbean island and the smallest municipality (administrative division) of the Netherlands. It consists of the main island of Saba, plus a few uninhabited offshore cays. As of January 2013, the population was 1,991 inhabitants, with a total land area of 13.10 km2 (5.05 sq mi).</p>\r\n\r\n<p>The main island of Saba is located about 13 km (8 mi) east of Saint Martin and northeast of Saint Kitts and Nevis. Saba is volcanic and eolic in origin and formed about 125,000 years ago. The island rises to an elevation of 589 m (1,932 ft) at Mount Scenery, its highest point.</p>\r\n\r\n<p>The first inhabitants of Saba were Arawakan-speaking Taíno people, who migrated from the mainland in the 8th century AD. Christopher Columbus is said to have sighted the island on 13 November 1493. He did not land, being deterred by the island's perilous cliffs. In 1632, a group of Englishmen landed upon Saba and began farming, planting tobacco, corn, and vegetables.</p>\r\n\r\n<p>In the early 18th century, Saba was colonized by the Dutch. The Dutch West India Company intended to develop the island as a stopover on the way to the Far East, but the island proved unprofitable and was abandoned in 1719. Pirates briefly took over the island in 1718.</p>\r\n\r\n<p>In 1776, Saba was annexed by the Dutch West India Company and in 1796, became a part of the Dutch Kingdom. The island was damaged by an earthquake in 1884.</p>\r\n\r\n<p>During World War II, the Netherlands was occupied by Nazi Germany, and Saba was administered by the Dutch government-in-exile. After the war, the Netherlands became a republic, and Saba again came under Dutch administration.</p>\r\n\r\n<p>In 1956, Saba became a part of the Netherlands Antilles. The island achieved autonomy in 1985, and was eventually granted a seat in the Estates of the Netherlands Antilles. After the dissolution of the Netherlands Antilles in 2010, Saba became a part of the Netherlands proper.</p>\r\n\r\n<p>The main island of Saba is about 8 miles (13 km) long and 3 miles (5 km) wide. It rises to an elevation of 589 m (1,932 ft) at Mount Scenery, the highest point on the island. The island has a number of small coral reefs. There are no large, deep-water ports or major settlements on Saba.</p>\r\n\r\n<p>The main town, The Bottom, is located in a valley in the center of the island. Other settlements on the island include Hell's Gate and Windwardside.</p>\r\n\r\n<p>The climate of Saba is tropical, with a dry season from January to July and a wet season from August to December. The temperature averages 27 °C (80.6 °F) and there is a constant breeze.</p>\r\n\r\n<p>The economy of Saba is based on tourism, fishing, and agriculture. The main agricultural products are bananas, tomatoes, cucumbers, and flowers. Saba has a small fishing fleet, and the main exports are fish and lobster.</p>\r\n\r\n<p>The population of Saba is 1,991, of whom 916 are Dutch citizens. The majority of the population is Protestant (76%). The official language is Dutch.</p>\r\n\r\n<p>Saba is a popular tourist destination, with many tourists arriving by cruise ship. The main attractions are the island's volcanic scenery, its small coral reefs, and its mountain scenery. Saba is also a popular scuba diving destination.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
