    locations_country_113.article =  importer.locate_object(Article, "id", Article, "id", 6429, {'id': 6429, 'excerpt': 'ルワンダ', 'kicker': 'ルワンダ', 'content': '<p>ルワンダは、アフリカ中央部に位置する内陸の小国で、メリーランド州とほぼ同じ大きさである。北にウガンダ、東にタンザニア、南にブルンジ、西にコンゴ民主共和国と国境を接している。人口は約1,200万人で、ほとんどが農村地域である。</p>\r\n\r\n<p>ルワンダ大虐殺は、フツ族が多数を占める政府のメンバーによって行われたツチ族の大量虐殺である。わずか100日間で推定80万人が殺害された。ジェノサイドは1994年4月6日に始まり、1994年7月15日に終了しました。</p>\r\n\r\n<p>ルワンダには、さまざまな文化や言語があります。公用語はキニャルワンダ語ですが、フランス語も話されています。国民の大多数はカトリック教徒ですが、プロテスタント、イスラム教、アニミズムの少数派もいます。</p>\r\n\r\n<p>ルワンダは貧しい国であり、一人当たりのGDPはわずか1,500ドルです。海外からの援助に大きく依存しており、国民の大半が貧困にあえいでいます。しかし、近年は経済的にも改善がみられ、自給自足に向けた取り組みが行われています。</p>\r\n\r\n<p>ルワンダは人口の半数以上が18歳以下という若い国です。人口が急増する中、教育、医療、雇用の面で課題を抱えています。</p>\r\n\r\n<p>そのような中、ルワンダは前進しています。ルワンダは大量虐殺から立ち直り、より平和で豊かな未来の創造に取り組んでいます。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
