    locations_country_114.article =  importer.locate_object(Article, "id", Article, "id", 6430, {'id': 6430, 'excerpt': 'Rwanda', 'kicker': 'Rwanda', 'content': '<p>Rwanda is a small landlocked country in central Africa, about the size of Maryland. It is bordered by Uganda to the north, Tanzania to the east, Burundi to the south, and the Democratic Republic of the Congo to the west. The country is predominantly rural, with a population of about 12 million.</p>\r\n\r\n<p>The Rwandan genocide was a mass slaughter of the Tutsi people perpetrated by members of the Hutu majority government. An estimated 800,000 people were killed in just 100 days. The genocide began on April 6, 1994, and ended on July 15, 1994.</p>\r\n\r\n<p>Rwanda is home to a variety of different cultures and languages. The official language is Kinyarwanda, but French is also spoken. The majority of the population is Catholic, but there are also Protestant, Muslim, and animist minorities.</p>\r\n\r\n<p>Rwanda is a poor country, with a GDP per capita of just $1,500. The country is heavily dependent on foreign aid, and the majority of the population lives in poverty. However, there have been some improvements in the economy in recent years, and the country is working to become more self-sufficient.</p>\r\n\r\n<p>Rwanda is a young country, with over half of the population under the age of 18. The population is growing rapidly, and the country is facing challenges in terms of education, healthcare, and employment.</p>\r\n\r\n<p>Despite the challenges, Rwanda is making progress. The country is rebuilding from the genocide, and is working to create a more peaceful and prosperous future.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
