    locations_country_115.article =  importer.locate_object(Article, "id", Article, "id", 6431, {'id': 6431, 'excerpt': 'ロシア連邦', 'kicker': 'ロシア連邦', 'content': '<p>ロシア連邦</p>\r\n\r\n<p>ロシア連邦（ロシアれんぽう、ロシア語: Росси́йская Федера́ция, tr. Rossíyskaya Federátsiya）、通称ロシアは、ユーラシア大陸にある国家である。17,098,242平方キロメートル（6,592,800平方マイル）のロシアは、地球の有人陸地面積の8分の1以上を占める世界最大の国であり、人口も9番目に多く、2017年12月時点で1億4400万人超を擁しています。首都モスクワは世界有数の大都市であり、ヨーロッパで2番目に大きな都市です。</p>\r\n\r\n<p>ロシアは連邦準大統領制の共和国で、行政府と立法府の二本立てとなっています。大統領は国家元首であり、首相は政府の長である。大統領の任期は6年、国会（連邦議会）の任期は5年である。ロシア経済は、名目GDPで世界第6位、GDP（購買力平価）で世界第12位を誇っています。</p>\r\n\r\n<p>ロシアは、大規模な国家部門と急速に発展している民間部門との混合経済である。ロシアは世界貿易機関（WTO）、欧州評議会、G8、G20、アジア太平洋経済協力（APEC）、上海協力機構（SCO）、ユーラシア経済連合（EAEU）、独立国家共同体（CIS）のメンバーである。</p>\r\n\r\n<p>ロシア語はロシアの公用語です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.416544+00:00")} ) 
