    locations_country_149.article =  importer.locate_object(Article, "id", Article, "id", 6465, {'id': 6465, 'excerpt': 'オマーン', 'kicker': 'オマーン', 'content': '<p>オオマーン（Oman）、通称オマーンは、アラビア半島の南東部に位置する共和制国家。面積は212,460 km²（82,031平方マイル）、人口は420万人（2010年国勢調査）。首都はマスカットで、最大の都市です。ペルシャ湾とアラビア海を結ぶホルムズ海峡に面し、イランとの国境に位置する戦略的な国です。</p>\r\n\r\n<p>オマーンはペルシャ湾の入り口であるホルムズ海峡に面した戦略的立地にある穏健なアラブの国である。その穏健で親欧米的な外交政策は、その支配者が英国の軍事・経済支援に依存してきたことによって、長い間形成されてきた。1970年、カブース・ビン・サイード・アル・サイードは、無血のクーデターにより父であるセイフ・ビン・タリクを追い出した。現在のスルタンは、石油収入を開発・近代化の推進に充て、穏健な政策を続けている。</p>\r\n\r\n<p>オマーンは、人口400万人以上、面積212,460km²の立憲君主制国家です。1996年に公布された憲法では、世襲制のスルタンとして、二院制の議会、任命制の諮問委員会、独立した司法を定めています。立法権は二院制のオマーン評議会にあり、83名の議員が任命される上院と、選挙で選ばれる下院で構成されています。上院はスルタンが議員を任命し、下院は普通選挙で選ばれます。また、スルタンは首相を任命し、首相は閣僚会議（内閣）とオマーン評議会を主宰します。</p>\r\n\r\n<p>スルタンは国家元首であり、軍隊の最高司令官でもあります。首相は政府の長である。立法権は二院制のオマーン評議会にあります。上院はスルタンが任命し、下院は一般投票によって選出されます。司法は独立しており、行政権は閣僚会議（内閣）にあります。</p>\r\n\r\n<p>経済は石油とガスの生産が中心だが、製造業やその他のサービスの重要性も増している。石油・ガス資源は、政府歳入の60％以上、輸出収入の90％以上を占めています。2000年、政府は経済における役割を縮小するため、民営化・自由化プログラムを開始しました。</p>\r\n\r\n<p>アラブ連盟、湾岸協力会議、イスラム会議機構に加盟しています。米国や英国との関係も深い。米国や英国との関係も深く、1990〜91年には対イラク連合に参加するなど、米国の軍事作戦に協力的である。また、隣国イエメンの和平プロセスにも積極的に関与している。</p>\r\n\r\n<p>正式名称はオマーン国（Sultanate of Oman）。オマーンという名前は、アラビア語の「ʿumān」に由来し、"幸福、豊かさ "を意味します。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
