    locations_country_150.article =  importer.locate_object(Article, "id", Article, "id", 6466, {'id': 6466, 'excerpt': 'Oman', 'kicker': 'Oman', 'content': '<p>OOman, officially the Sultanate of Oman, is a country in southeastern Arabia, on the Arabian Peninsula. It has an area of 212,460 km² (82,031 sq mi) and a population of 4.2 million as of the 2010 census. The capital and largest city is Muscat. Oman is strategically located on the Strait of Hormuz, the narrow strait that connects the Persian Gulf to the Arabian Sea and separates Oman from Iran.</p>\r\n\r\n<p>Oman is a moderate Arab country with a strategic location on the Strait of Hormuz, the entrance to the Persian Gulf. Its moderate, pro-Western foreign policy has long been shaped by its ruler\'s reliance on the British military and economic support. In 1970, Qaboos bin Said al Said ousted his father, Seif bin Tariq, in a bloodless palace coup. The current sultan has continued the country\'s moderate policies, using oil revenues to promote development and modernization.</p>\r\n\r\n<p>Oman is a constitutional monarchy with a population of over 4 million and an area of 212,460 km². Its constitution, promulgated in 1996, provides for a hereditary sultanate with a bicameral legislature, an appointed advisory council, and an independent judiciary. Legislative authority is vested in the bicameral Council of Oman, which consists of an appointed 83-member upper chamber and an elected lower chamber. The sultan appoints the members of the upper chamber, and the lower chamber is elected by universal suffrage. The sultan also appoints the prime minister, who presides over the Council of Ministers (cabinet), and the Council of Oman.</p>\r\n\r\n<p>The sultan is the head of state and the commander-in-chief of the armed forces. The prime minister is the head of government. Legislative power is vested in the bicameral Council of Oman. The upper chamber is appointed by the sultan, and the lower chamber is elected by popular vote. There is an independent judiciary, and administrative authority is vested in the Council of Ministers (cabinet).</p>\r\n\r\n<p>The economy is dominated by oil and gas production, although manufacturing and other services are increasingly important. Petroleum and gas resources account for more than 60% of government revenues and more than 90% of export earnings. In 2000, the government began a program of privatization and liberalization to reduce its role in the economy.</p>\r\n\r\n<p>Oman is a member of the Arab League, the Gulf Cooperation Council, and the Organization of the Islamic Conference. It has close ties with the United States and United Kingdom. The country has been supportive of U.S. military operations in the region, and joined the coalition against Iraq in 1990–91. Oman also has been active in the peace process in neighboring Yemen.</p>\r\n\r\n<p>The official name of the country is Sultanate of Oman. The name Oman is derived from the Arabic ʿumān, meaning "felicity, abundance."</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
