    locations_country_151.article =  importer.locate_object(Article, "id", Article, "id", 6467, {'id': 6467, 'excerpt': 'ノルウェー', 'kicker': 'ノルウェー', 'content': '<p>ノルウェーは、スカンジナビア半島の西側、北大西洋からバレンツ海にかけて広がる北欧の主権国家、単一君主制国家である。東にスウェーデン、北東にフィンランド、北にロシアと国境を接している。バレンツ海におけるロシアとの海洋境界はサンクトペテルブルク条約（1918年）で定められており、ロシア連邦は北極海の大部分を占め続けています。また、ノルウェーは西側でイギリスと海洋境界線を共有しています。</p>\r\n\r\n<p>2019年1月1日のノルウェーの推定人口は5,322,860人です。人口の98％近くがスカンジナビア人で占められており、世界で最も均質な国の一つである。ノルウェー民族が人口の約85％を占め、北極圏の遊牧民であるサーミ人は約2％と国内最大の少数民族を構成しています。残りはほとんどがヨーロッパ系です。</p>\r\n\r\n<p>ノルウェーは立憲君主制をとっており、議会制をとっています。君主は国家元首ですが、行政権は首相を長とする閣僚会議に帰属します。立法権は閣僚会議と一院制のストーティング（国会）の双方にある。司法は行政府、立法府から独立しています。</p>\r\n\r\n<p>ノルウェーは先進国であり、教育、経済競争力、人間開発、生活の質、生活水準などの分野で、国際的な国家パフォーマンスの比較において上位にランクされています。一人当たりの所得は世界第4位、人間開発指数は世界第3位です。ノルウェーは市場経済を持ち、豊富な天然資源と高い教育を受けた国民を有しています。2018年版世界幸福度報告書では世界第1位となっています。</p>\r\n\r\n<p>ノルウェーは混合経済で、多くの民間企業がありますが、エネルギーやインフラなど主要な分野では国有が大きくなっています。政府は競争、民営化、規制緩和の推進に積極的に取り組んでいます。1994年に欧州経済領域（EEA）に加盟し、シェンゲン協定に加盟しています。</p>\r\n\r\n<p>ノルウェーは石油とガスの主要生産国であり、輸出国でもあります。水力発電は同国の主要なエネルギー源であり、ノルウェーは世界最大の水力発電の生産国です。製造業は、金属とエンジニアリング産業が中心です。水産業、農業、林業も重要な産業です。</p>\r\n\r\n<p>ノルウェーは、無料の教育や医療、包括的な社会保障制度など、社会福祉制度が充実しています。失業率は低く、貧困はほとんどありません。</p>\r\n\r\n<p>ノルウェーは、国連（UN）、北大西洋条約機構（NATO）、欧州評議会、欧州連合（EU）、北極評議会に加盟しています。</p>\r\n\r\n<p>ノルウェーは先進国で高所得の国であり、生活水準は非常に高いです。教育や医療の無料化、包括的な社会保障制度など、充実した社会福祉制度を備えています。ノルウェーは混合経済で、多くの民間企業がありますが、エネルギーやインフラなどの主要分野では国有化が進んでいます。政府は競争、民営化、規制緩和を積極的に推進しています。1994年に欧州経済領域（EEA）に加盟し、シェンゲン協定のメンバーでもあります。ノルウェーは石油とガスの主要生産国であり、輸出国でもあります。水力発電は同国の主要なエネルギー源であり、ノルウェーは世界最大の水力発電の生産国でもあります。製造業は、金属とエンジニアリング産業が中心です。水産業、農業、林業も重要な産業です。</p>\r\n\r\n<p>ノルウェーは、無料の教育や医療、包括的な社会保障制度など、社会福祉制度が充実しています。失業率は低く、貧困はほとんどありません。</p>\r\n\r\n<p>ノルウェーは、国連（UN）、北大西洋条約機構（NATO）、欧州評議会、欧州連合（EU）、北極評議会に加盟しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
