    locations_country_169.article =  importer.locate_object(Article, "id", Article, "id", 6485, {'id': 6485, 'excerpt': 'ナウル', 'kicker': 'ナウル', 'content': '<p>ナウル共和国（ナウルきょうわこく）、通称ナウルは、太平洋に浮かぶ島国で、マーシャル諸島の南、キリバス共和国の西に位置しています。面積はわずか21平方キロメートル（8.1平方マイル）で、世界で最も小さな共和国であり、面積ではバチカン市国に次いで2番目に小さい国である。ナウルの人口は2016年現在、9,378人です。</p>\r\n\r\n<p>ナウルはリン鉱石の島であり、主な輸出品はリン鉱石である。ナウルの政府は議会制共和制で、大統領が国家元首、首相が政府元首となっています。ナウルは世界で唯一、軍隊を持たない国である。</p>\r\n\r\n<p>2016年1月に新政権が選出された。大統領はバロン・ワカ、首相はシャルロット・サルワイである。</p>\r\n\r\n<p>国連、太平洋諸島フォーラム、英連邦に加盟している。</p>\r\n\r\n<p>ナウルには最初、ミクロネシアとポリネシアの人々が住んでいた。17世紀にはヨーロッパ人がこの島を探検するようになりました。1888年にドイツに併合され、1899年にイギリスの保護領となった。第二次世界大戦中は日本に占領され、1947年に国際連合信託統治領となり、オーストラリアの統治下に置かれた。</p>\r\n\r\n<p>1968年に独立。1970年代にリン鉱石の埋蔵量が枯渇し、財政難に陥った。1980年代、ナウルは英国主導のペルシャ湾多国籍軍に所属していた。イラクを支援した結果、ナウルは海外からの援助の多くを失い、2000年には国連から制裁を受けた。</p>\r\n\r\n<p>ナウルの政府は、大統領を国家元首、首相を政府首脳とする議会制共和国である。大統領は、一院制の国会である19名の下院議員によって選出される。首相は大統領によって任命されます。立法は、政府、下院、大統領のいずれかが主導して行うことができる。</p>\r\n\r\n<p>ナウルには軍隊がなく、警察も非常に小規模である。空港はなく、出入国は船のみである。</p>\r\n\r\n<p>国連、太平洋諸島フォーラム、英連邦に加盟している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
