    locations_country_170.article =  importer.locate_object(Article, "id", Article, "id", 6486, {'id': 6486, 'excerpt': 'Nauru', 'kicker': 'Nauru', 'content': "<p>Nauru, officially the Republic of Nauru and formerly known as Pleasant Island, is an island country in the Pacific Ocean, south of the Marshall Islands and west of Kiribati. With an area of just 21 square kilometres (8.1 sq mi), Nauru is the world's smallest republic and the second-smallest country by area after Vatican City. The population of Nauru was 9,378 as of 2016.</p>\r\n\r\n<p>Nauru is a phosphate rock island and its main export is phosphate. The government of Nauru is a parliamentary republic, with the president as head of state and the prime minister as head of government. Nauru is the only country in the world without an army.</p>\r\n\r\n<p>A new government was elected in January 2016. The president is Baron Waqa, and the prime minister is Charlot Salwai.</p>\r\n\r\n<p>The country is a member of the United Nations, the Pacific Islands Forum, and the Commonwealth of Nations.</p>\r\n\r\n<p>Nauru was first inhabited by Micronesian and Polynesian people. Europeans began to explore the island in the 17th century. The island was annexed by Germany in 1888 and became a protectorate of the United Kingdom in 1899. Nauru was occupied by Japan during World War II, and became a United Nations Trust Territory under Australian administration in 1947.</p>\r\n\r\n<p>Nauru gained its independence in 1968. The country has been in financial trouble since the 1970s, when the phosphate reserves were exhausted. In the 1980s, Nauru was a member of the British-led Multi-National Force in the Persian Gulf. As a result of its support for Iraq, Nauru lost much of its foreign aid and, in 2000, was sanctioned by the United Nations.</p>\r\n\r\n<p>The government of Nauru is a parliamentary republic, with the president as head of state and the prime minister as head of government. The president is elected by the members of the unicameral parliament, the 19-member House of Representatives. The prime minister is appointed by the president. Legislation may be initiated by the government, the House of Representatives, or the president.</p>\r\n\r\n<p>Nauru has no armed forces and the police force is very small. The country has no airports; the only way to get in or out is by boat.</p>\r\n\r\n<p>Nauru is a member of the United Nations, the Pacific Islands Forum, and the Commonwealth of Nations.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
