    locations_country_171.article =  importer.locate_object(Article, "id", Article, "id", 6487, {'id': 6487, 'excerpt': 'ナミビア', 'kicker': 'ナミビア', 'content': '<p>カントリープロファイルナミビア</p>\r\n\r\n<p>正式名称ナミビア</p>\r\n\r\n<p>首都ウィントフック</p>\r\n\r\n<p>公用語英語、ドイツ語</p>\r\n\r\n<p>人口：2,500,000人</p>\r\n\r\n<p>宗教キリスト教、土着宗教</p>\r\n\r\n<p>地理</p>\r\n\r\n<p>ナミビアは、アフリカ南部に位置する国である。北にアンゴラ、北東にザンビア、東にジンバブエ、南東にボツワナ、南と西に南アフリカと国境を接している。国土は825,615平方キロメートル（318,292平方マイル）で、西のナミブ砂漠から東のカラハリ砂漠まで多様な地形を持っている。中央高原には首都ウィントフックがあり、人口のほとんどが住んでいる。</p>\r\n\r\n<p>歴史</p>\r\n\r\n<p>現在ナミビアとして知られている地域は、2万年以上前にサンの狩猟採集民が住み始めたところである。ヨーロッパ人が初めてこの地域を探検したのは、16世紀のポルトガル人商人でした。1884年にドイツが領有権を主張し、1890年代にはドイツが植民地化を開始しました。第一次世界大戦後、ナミビアは南アフリカの統治下に置かれた。第一次世界大戦後、ナミビアは南アフリカの統治下におかれ、1990年に南アフリカのアパルトヘイト廃止に伴い、独立を果たした。</p>\r\n\r\n<p>政治</p>\r\n\r\n<p>ナミビアは多党制の民主主義国家である。国家元首である大統領は国民議会で選出され、任期は5年です。国民議会は88名の議員で構成され、国民投票により選出され、任期は5年です。内閣は大統領によって任命されます。</p>\r\n\r\n<p>経済</p>\r\n\r\n<p>経済：ナミビアの経済は、農業、鉱業、観光を基盤としている。主な農産物は、家畜、魚、トウモロコシ、ソルガム、キビなどの作物である。鉱物は、ダイヤモンド、ウラン、金、銅が主な輸出品目である。観光は、ナミビアの野生動物や自然景観を見るために訪れる観光客が多く、主な海外収入源となっています。</p>\r\n\r\n<p>文化</p>\r\n\r\n<p>ナミビアは、サン族やバンツー族を起源とし、ヨーロッパやアメリカの文化の影響を受けた、豊かで多様な文化を持っています。ナミビアの伝統音楽は、サン族のカチカチという音楽で、ドラム、マリンバ、リードパイプなど様々な楽器で演奏されます。ナミビアの伝統的な衣装は、ヘレロ族とヒンバ族のカラフルな織物である。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
