    locations_country_197.article =  importer.locate_object(Article, "id", Article, "id", 6513, {'id': 6513, 'excerpt': 'マーシャル諸島', 'kicker': 'マーシャル諸島', 'content': '<p>マーシャル諸島共和国（マーシャルしょとうきょうわこく）、通称マーシャルは、太平洋北部に位置する島国である。29の環礁と5つの島からなり、190万6541平方キロメートル（735,358平方マイル）の面積がある。マーシャル諸島は、ハワイとオーストラリアの中間に位置しています。2016年の人口は53,158人で、1,156の島と環礁にまたがっています。</p>\r\n\r\n<p>西はミクロネシア連邦、北はウェーク島、南東はキリバス、南はナウルと海洋上の境界線を共有しています。首都であり最大の都市であるマジュロには、約27,000人の島民が暮らしています。</p>\r\n\r\n<p>考古学的な証拠によると、2,000年前からこの島に住む人々はこの地域の他の人々と交易をしていたことが分かっています。1788年、イギリス東インド会社の探検家ジョン・マーシャルがこの島々を発見した。その後、1885年にドイツ帝国が領有権を主張し、ドイツ領ニューギニアの一部となった。</p>\r\n\r\n<p>第一次世界大戦では、日本が占領した。1920年、国際連盟は南太平洋委任統治領として日本に委任統治を行うことを決定。1947年、国際連合の信託統治領となる。</p>\r\n\r\n<p>1986年、マーシャル諸島は包括的核実験禁止条約を批准した最初の国になった。</p>\r\n\r\n<p>マーシャル諸島は、自給自足の農業と漁業を中心とした混合経済です。主な輸出品目はコプラとココナッツオイルです。国連、太平洋諸島フォーラム、英連邦、東南アジア諸国連合に加盟している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
