    locations_country_199.article =  importer.locate_object(Article, "id", Article, "id", 6515, {'id': 6515, 'excerpt': 'マルタ', 'kicker': 'マルタ', 'content': '<p>マルタは地中海に浮かぶ小さな島国で、シチリア島の南、チュニジアの東に位置しています。ゴゾ島、コミノ島、マルタ島の3つの大きな島と、いくつかの小さな島からなる群島で、人口は45万人あまりです。マルタの公用語はマルタ語で、アラビア語に近いセム語系の言語です。英語も公用語であり、マルタ人が最もよく使う言語です。</p>\r\n\r\n<p>マルタの気候は地中海性気候で、夏は暖かく乾燥し、冬は温暖で湿潤です。気温が氷点下になることはほとんどなく、最高気温は41℃を記録しています。地震が多く、1980年にはマルタのゴゾ島でマグニチュード6の地震が発生し、23人が死亡した。</p>\r\n\r\n<p>マルタは共和制をとっており、議会制をとっています。国家元首は大統領で、国会議員によって選出されます。政府首脳は大統領によって任命される首相です。マルタ議会は一院制で、比例代表制で選出された65名の議員で構成されています。</p>\r\n\r\n<p>マルタは欧州連合に加盟しており、2008年からはユーロ圏の一員となっています。また、国連、英連邦、欧州評議会のメンバーでもあります。</p>\r\n\r\n<p>マルタは観光地として人気があり、観光産業は国のGDPの約16％を占めています。マルタの魅力は、地中海性気候、古代の建築物や寺院、そしてビーチです。また、マルタはクルーズ船の寄港地としても人気があります。</p>\r\n\r\n<p>マルタの経済は、GDPの約73％を占めるサービス業と、約27％を占める工業が中心となっています。マルタの主な産業は、観光、製薬、造船、電子機器です。マルタの失業率は約5％で、インフレ率は1.5％です。</p>\r\n\r\n<p>マルタは銀行業が盛んで、銀行部門はGDPの約26%を占めています。マルタの主要銀行は、バレッタ銀行、HSBCバンク・マルタ、マルタ・ナショナル銀行です。</p>\r\n\r\n<p>マルタの通貨はユーロです。マルタの主な輸出品は、医薬品、食料品、電子機器です。マルタの主な輸入品は、機械、輸送機器、燃料です。</p>\r\n\r\n<p>マルタは欧州連合に加盟しており、2008年からはユーロ圏の一員となっています。マルタは国連、英連邦、欧州評議会のメンバーでもあります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
