    locations_country_201.article =  importer.locate_object(Article, "id", Article, "id", 6517, {'id': 6517, 'excerpt': 'マリ', 'kicker': 'マリ', 'content': '<p>マリは、アフリカ西部に位置する内陸の大国である。アフリカで8番目、世界では24番目の大きさである。人口は約1,650万人。マリの公用語はフランス語です。</p>\r\n\r\n<p>マリの最初の人類はドゴン族で、約4,000年前にこの地に到達しました。13世紀にはマリ帝国が成立し、イスラム文化・学問の一大中心地となりました。15世紀にマリ帝国は崩壊し、いくつかの小さな王国に分割されました。1800年代初頭、マリはフランスに征服されました。フランスの植民地となり、1960年に独立するまでフランスの植民地であった。</p>\r\n\r\n<p>独立後、マリは軍事政権と文民政権に支配されてきました。2012年、軍事クーデターにより政府が転覆し、軍事政権が国を掌握しました。2013年、文民政権が選出され、軍事政権は政権を引き継ぎました。</p>\r\n\r\n<p>マリは貧しい農業国である。マリの経済は、農業、漁業、鉱業に基づいています。主な作物はトウモロコシ、キビ、米、ソルガム、落花生です。家畜は牛、山羊、羊、豚が飼育されています。マリの主な鉱物資源は、金、銀、銅、リン酸塩です。</p>\r\n\r\n<p>マリの公式通貨はCFAフランです。主な輸出品目は、金、綿花、家畜、魚です。主な輸入品は、食料品、機械、燃料です。</p>\r\n\r\n<p>マリの政体は共和制です。大統領は国民から選ばれ、国家元首の役割を果たします。マリの首相は大統領によって任命され、政府のトップとして機能します。マリの議会は二院制で、国民議会と上院があります。国民議会は選挙で選ばれた議員で構成され、上院は任命された議員で構成されています。</p>\r\n\r\n<p>国連、アフリカ連合、西アフリカ諸国経済共同体、フランコフォニーに加盟しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
