    locations_country_202.article =  importer.locate_object(Article, "id", Article, "id", 6518, {'id': 6518, 'excerpt': 'Mali', 'kicker': 'Mali', 'content': '<p>Mali is a large, landlocked country in western Africa. It is the eighth-largest country in Africa, and the 24th-largest country in the world. The country has a population of about 16.5 million. The official language of Mali is French.</p>\r\n\r\n<p>The first human inhabitants of Mali were the Dogon people, who arrived in the area about 4,000 years ago. The Malian Empire was founded in the 13th century, and became a major center of Islamic culture and learning. The Mali Empire collapsed in the 15th century, and was divided into a series of smaller kingdoms. In the early 1800s, Mali was conquered by the French. The country became a French colony, and remained a French colony until 1960, when it became independent.</p>\r\n\r\n<p>Since becoming independent, Mali has been ruled by a series of military and civilian governments. In 2012, a military coup overthrew the government, and a military junta took control of the country. In 2013, a civilian government was elected, and the junta handed over control of the government.</p>\r\n\r\n<p>Mali is a poor, agricultural country. The economy of Mali is based on agriculture, fishing, and mining. The main crops grown in Mali are maize, millet, rice, sorghum, and peanuts. The main livestock raised in Mali are cattle, goats, sheep, and pigs. The main mineral resources mined in Mali are gold, silver, copper, and phosphates.</p>\r\n\r\n<p>The official currency of Mali is the CFA franc. The main exports of Mali are gold, cotton, livestock, and fish. The main imports of Mali are foodstuffs, machinery, and fuel.</p>\r\n\r\n<p>The government of Mali is a republic. The president of Mali is elected by the people and serves as the head of state. The prime minister of Mali is appointed by the president and serves as the head of government. Mali has a bicameral legislature, with a National Assembly and a Senate. The National Assembly is made up of elected members, and the Senate is made up of appointed members.</p>\r\n\r\n<p>Mali is a member of the United Nations, the African Union, the Economic Community of West African States, and the Francophonie.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
