    locations_country_203.article =  importer.locate_object(Article, "id", Article, "id", 6519, {'id': 6519, 'excerpt': 'モルディブ', 'kicker': 'モルディブ', 'content': '<p>モルディブ共和国（モルディブきょうわこく）、通称モルディブは、インド洋に浮かぶ島国である。インドとスリランカの南西に位置する。北はイハバンドヒポル環礁から南はアッドゥ市まで26の環礁が連なっている。面積は298平方キロメートル（115平方マイル）で、世界で最も小さく、最も人口密度の高い国の一つであり、人口は約396,000人である。</p>\r\n\r\n<p>モルディブは1965年にイスラム共和国になりましたが、12世紀以来スルタン国でした。12世紀半ばから1972年に共和制に移行するまで、モルディブのスルタンが支配していた。モルディブは南アジア地域協力連合（SAARC）のメンバーである。</p>\r\n\r\n<p>モルディブは紀元前4世紀以来、歴史的・文化的にインド亜大陸とつながっています。モルディブ諸島は9世紀にアラブ人（おそらくイエメン人）の船員によって発見されました。10世紀にはイスラム教徒の商人が到着し、イスラムの影響が拡大しました。</p>\r\n\r\n<p>モルディブはサイクロン、洪水、干ばつなどの自然災害の被害を受けてきた。</p>\r\n\r\n<p>古代、モルディブはいくつかの独立した島々で構成されていましたが、仏教という共通の宗教で結ばれていました。16世紀半ばから、モルディブはインド洋で最も強力なイスラム教の王国である一つのスルタンに支配されるようになりました。</p>\r\n\r\n<p>1887年、モルディブはイギリスの保護領となった。1965年にスルタンが廃止され、モルディブは共和制に移行しました。1968年に共和制を解消し、大統領制に移行した。</p>\r\n\r\n<p>1988年、モルディブはサイクロンに襲われ、島々に大きな被害を受けました。1998年、モルディブは大洪水に見舞われました。</p>\r\n\r\n<p>2004年、モルディブは津波に襲われ、大きな被害と人命が失われました。</p>\r\n\r\n<p>モルディブは低平な国であり、平均地上高は1.5メートル（4.9フィート）である。そのため、モルディブは特に海面上昇の影響を受けやすいのです。</p>\r\n\r\n<p>2009年、モルディブ政府はカーボンニュートラルの目標を設定する意向を表明しました。</p>\r\n\r\n<p>モルディブは共和制をとっており、大統領が国家元首です。大統領は直接投票で選出され、任期は5年です。</p>\r\n\r\n<p>モルディブには一院制の議会である人民マジェリスがあり、直接投票で選出され、任期は5年です。</p>\r\n\r\n<p>モルディブの経済は混合型で、観光業が主な産業となっています。</p>\r\n\r\n<p>モルディブはイスラム教の国であり、イスラム教が正式な宗教となっています。</p>\r\n\r\n<p>モルディブはインドとスリランカの南西に位置するインド洋に浮かぶ国です。モルディブは1965年にイスラム共和国になりました。南アジア地域協力連合（SAARC）のメンバーである。モルディブはサイクロン、洪水、干ばつなどの自然災害の被害を受けてきました。2009年、モルディブ政府はカーボンニュートラルの目標を設定する意向を表明しています。モルディブの経済は混合型で、観光が主な産業となっています。モルディブはイスラム教の国であり、イスラム教が正式な宗教となっています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
