    locations_country_204.article =  importer.locate_object(Article, "id", Article, "id", 6520, {'id': 6520, 'excerpt': 'Maldives', 'kicker': 'Maldives', 'content': "<p>The Maldives, officially the Republic of Maldives, is an island country in the Indian Ocean. It lies southwest of India and Sri Lanka. The chain of twenty-six atolls stretches from Ihavandhippolhu Atoll in the north to the Addu City in the south. Comprising a territory spanning roughly 298 square kilometres (115 sq mi), the Maldives is one of the world's smallest and most densely populated countries, with a population of approximately 396,000 inhabitants.</p>\r\n\r\n<p>The Maldives became an Islamic republic in 1965, although it has been a sultanate since the 12th century. The Maldivian sultans ruled from the mid-12th century until 1972, when the Maldives became a republic. The Maldives is a member of the South Asian Association for Regional Cooperation (SAARC).</p>\r\n\r\n<p>The Maldives has been historically and culturally linked to the Indian subcontinent since the fourth century BCE. The Maldivian archipelago was discovered by Arab sailors, possibly from Yemen, in the ninth century CE. Islamic influences in the area expanded with the arrival of Muslim traders in the 10th century.</p>\r\n\r\n<p>The Maldives has been the victim of natural disasters, including cyclones, floods, and droughts.</p>\r\n\r\n<p>In ancient times the Maldives comprised a number of autonomous island-groups, which were united by their shared religion of Buddhism. From the mid-16th century, the Maldives were ruled by a single sultanate, which was the most powerful Muslim kingdom in the Indian Ocean.</p>\r\n\r\n<p>The Maldives became a British protectorate in 1887. The sultanate was abolished in 1965, and the Maldives became a republic. The republic was dissolved in 1968, and the Maldives became a presidential republic.</p>\r\n\r\n<p>In 1988, the Maldives were hit by a cyclone, which caused extensive damage to the islands. In 1998, the Maldives were hit by a major flood.</p>\r\n\r\n<p>In 2004, the Maldives were hit by a tsunami, which caused extensive damage and loss of life.</p>\r\n\r\n<p>The Maldives is a low-lying country, with an average ground level of 1.5 metres (4.9 ft) above sea level. As a result, the Maldives are particularly vulnerable to sea level rise.</p>\r\n\r\n<p>In 2009, the government of the Maldives announced its intention to establish a carbon neutrality goal for the country.</p>\r\n\r\n<p>The Maldives is a republic, with a president as the head of state. The president is elected by direct vote for a five-year term.</p>\r\n\r\n<p>The Maldives has a unicameral legislature, the People's Majlis, which is elected by direct vote for a five-year term.</p>\r\n\r\n<p>The Maldives has a mixed economy, with tourism being the main industry.</p>\r\n\r\n<p>The Maldives is a Muslim country, and Islam is the official religion.</p>\r\n\r\n<p>The Maldives is a country in the Indian Ocean, southwest of India and Sri Lanka. The Maldives became an Islamic republic in 1965. The Maldives is a member of the South Asian Association for Regional Cooperation (SAARC). The Maldives has been the victim of natural disasters, including cyclones, floods, and droughts. In 2009, the government of the Maldives announced its intention to establish a carbon neutrality goal for the country. The Maldives has a mixed economy, with tourism being the main industry. The Maldives is a Muslim country, and Islam is the official religion.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
