    locations_country_205.article =  importer.locate_object(Article, "id", Article, "id", 6521, {'id': 6521, 'excerpt': 'マレーシア', 'kicker': 'マレーシア', 'content': '<p>マレーシアは、南シナ海とマラッカ海峡に面する戦略的な半島に位置する東南アジアの国である。東南アジアで唯一、南シナ海とマラッカ海峡の両方に面している国である。半島マレーシアとボルネオ島にある東マレーシアの2つの部分からなる。</p>\r\n\r\n<p>マレーシアの近代史は、紀元1世紀に中東やインドからやってきた商人たちによって始まった。ヨーロッパ人がこの地域に言及した最古の記録は、1511年のポルトガル人探検家、フェルディナンド・マゼランによるものである。彼はこの地域を香辛料諸島にちなんで「モルッカ」と呼んだ。17世紀には、オランダがこの地を支配するようになった。19世紀には、オランダとイギリスが覇権を争うようになった。</p>\r\n\r\n<p>1824年、イギリスは半島部マラヤを保護領と宣言した。東マレーシアを支配していたオランダは、オランダ領東インド（現インドネシア）の支配を英国が認めるのと引き換えに、領土を英国に割譲したのである。1826年、イギリスはこの地域の4つのイギリス領からなる海峡植民地（Straits Settlements）を形成した。ペナン、マラッカ、シンガポール、ラブアンの4カ国である。</p>\r\n\r\n<p>1841年、イギリス政府は海峡植民地を独立した王室植民地とすることを宣言した。ペナンとマラッカは1つの植民地に、シンガポールとラブアンは別の植民地に統合された。1867年、海峡植民地はマレー半島連邦の一部となった。</p>\r\n\r\n<p>1874年、イギリス政府は海峡植民地をマレー連邦から切り離し、独立した植民地とした。1896年、海峡植民地はイギリスの保護領に格上げされた。</p>\r\n\r\n<p>1948年、英国はマレー諸州から撤退し、1957年、マラヤ連邦に独立を認めた。マレー系9州がマラヤ連邦を形成し、英国の保護領であった北ボルネオとサラワクが合流してマレーシア連邦を形成した。1846年以来イギリスの保護領であったブルネイは、新しい連邦への加盟を辞退した。</p>\r\n\r\n<p>1963年、シンガポールが連邦を脱退し、独立共和国となったため、マレーシア連邦はマレーシアと改称された。</p>\r\n\r\n<p>独立以来、マレーシアは二院制の連邦議会によって統治されている。国家元首はYang di-Pertuan Agong（国王）であり、マレー系9州の世襲支配者の中から5年の任期で選出される。政府首脳はヤン・ディ・パートゥアン・アゴンによって任命される首相である。政府は議会制民主主義のウェストミンスター・モデルに基づいている。</p>\r\n\r\n<p>マレーシアの経済は、石油とガスの生産、パーム油、ゴム、木材の輸出、および製造業が中心となっている。東南アジア諸国連合（ASEAN）および世界貿易機関（WTO）に加盟している。</p>\r\n\r\n<p>マレーシアは、人口3,000万人以上の多文化国家です。国民の大半はイスラム教徒ですが、中国系やインド系の人口も多くいます。公用語はマレーシア語ですが、英語も公用語となっています。</p>\r\n\r\n<p>マレーシアは、豊かな文化遺産と多様で美しい景観を持つ魅力的な国です。訪れる価値は十分にあります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
