    locations_country_206.article =  importer.locate_object(Article, "id", Article, "id", 6522, {'id': 6522, 'excerpt': 'Malaysia', 'kicker': 'Malaysia', 'content': '<p>Malaysia is a Southeast Asian country located on a strategic peninsular bordering the South China Sea and the Strait of Malacca. It is the only country in Southeast Asia that has both a coastline on the South China Sea and the Strait of Malacca. The country is made up of two parts, Peninsular Malaysia and East Malaysia, which is on the island of Borneo.</p>\r\n\r\n<p>Malaysia\'s modern history began with the arrival of traders from the Middle East and India in the first century CE. The earliest recorded mention of the area by a European was in 1511 by the Portuguese explorer, Ferdinand Magellan. He called the area "Moluccas" after the Spice Islands. The Dutch followed and began to dominate the region in the 17th century. The British also became interested in the area and by the 19th century, the Dutch and British were vying for control.</p>\r\n\r\n<p>In 1824, the British declared Peninsular Malaya a protectorate. The Dutch, who had been in control of East Malaysia, ceded the territory to the British in exchange for British recognition of the Dutch control of the Dutch East Indies (now Indonesia). In 1826, the British formed the Straits Settlements, which consisted of the four British possessions in the area: Penang, Malacca, Singapore and Labuan.</p>\r\n\r\n<p>In 1841, the British Government declared that the Straits Settlements should be a separate Crown Colony. Penang and Malacca were combined into one colony, while Singapore and Labuan were combined into another. In 1867, the Straits Settlements became a part of the Federated Malay States.</p>\r\n\r\n<p>In 1874, the British Government separated the Straits Settlements from the Federated Malay States and made them a separate colony. In 1896, the Straits Settlements were elevated to the status of a British protectorate.</p>\r\n\r\n<p>In 1948, the British withdrew from the Malay States and in 1957, they granted independence to the Federation of Malaya. The nine Malay states formed the Federation of Malaya while the two British protectorates of North Borneo and Sarawak joined together to form the Federation of Malaysia. Brunei, which had been a British protectorate since 1846, declined to join the new federation.</p>\r\n\r\n<p>The Federation of Malaysia was renamed Malaysia in 1963 when Singapore left the federation to become an independent republic.</p>\r\n\r\n<p>Since achieving independence, Malaysia has been governed by a federal parliamentary system with a bicameral legislature. The head of state is the Yang di-Pertuan Agong (King) who is elected for a five-year term from among the hereditary rulers of the nine Malay states. The head of government is the Prime Minister who is appointed by the Yang di-Pertuan Agong. The government is based on the Westminster model of parliamentary democracy.</p>\r\n\r\n<p>The economy of Malaysia is based on oil and gas production, palm oil, rubber and timber exports, and manufacturing. The country is a member of the Association of Southeast Asian Nations (ASEAN) and the World Trade Organization (WTO).</p>\r\n\r\n<p>Malaysia is a multicultural country with a population of over 30 million people. The majority of the population is Muslim, but there is also a large Chinese and Indian population. The official language is Malaysian, but English is also an official language.</p>\r\n\r\n<p>Malaysia is a fascinating country with a rich cultural heritage and a diverse and beautiful landscape. It is well worth a visit.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
