    locations_country_207.article =  importer.locate_object(Article, "id", Article, "id", 6523, {'id': 6523, 'excerpt': 'マラウイ', 'kicker': 'マラウイ', 'content': '<p>マラウイは、アフリカ大陸南東部に位置する内陸国で、北西にザンビア、北東にタンザニア、南東にモザンビークと国境を接しています。面積は118,484平方キロメートル（45,747平方マイル）、人口は17,087,500人である。国土の大部分は高原で、一部に丘陵や山地があります。</p>\r\n\r\n<p>アフリカで3番目に大きなマラウイ湖は、国土の約3分の1を占めている。国土は熱帯地方に属している。ケッペンの気候区分では、マラウイは熱帯サバンナ気候に属しています。季節は6月から8月の乾季と9月から5月の雨季の2つに分かれます。</p>\r\n\r\n<p>マラウイは、世界で最も開発が遅れている国の一つです。経済は農業を基盤としており、人口のほとんどが農村部に住んでいます。マラウイ政府は、年間予算を海外からの援助に大きく依存しています。マラウイ経済は、労働力の大半を占める大規模なインフォーマル・セクターが特徴です。</p>\r\n\r\n<p>マラウイは人口密度が高く、若者の人口が多い国です。極度の貧困と飢餓の撲滅を含むミレニアム開発目標の達成に向け、奮闘している国です。出生時の平均寿命は54歳です。</p>\r\n\r\n<p>マラウイは世界で最も貧しい国の一つです。2014年、同国の一人当たりGDPは1,020米ドルと推定されています。マラウイの経済は農業を基盤としており、大部分が農村部の人口で構成されています。マラウイ政府は、年間予算を海外からの援助に大きく依存しています。</p>\r\n\r\n<p>天然資源が少なく、貧困を克服するための大きな課題に直面しています。国民の多くがHIVに感染しており、マラウイは世界でも最も子どもの死亡率が高い国の一つです。2014年、同国の平均寿命は54歳と推定されています。</p>\r\n\r\n<p>マラウイは人口密度が高く、若者の人口が多い国です。同国は、極度の貧困と飢餓の撲滅など、ミレニアム開発目標の達成に向けて大きな前進を遂げています。しかし、すべてのマラウイ人の生活の質を向上させるためには、まだ多くの課題が残されています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
