    locations_country_208.article =  importer.locate_object(Article, "id", Article, "id", 6524, {'id': 6524, 'excerpt': 'Malawi', 'kicker': 'Malawi', 'content': "<p>Malawi is a landlocked country in southeastern Africa, bordered by Zambia to the northwest, Tanzania to the northeast, and Mozambique to the southeast. It has an area of 118,484 square kilometers (45,747 sq mi) and a population of 17,087,500. Malawi is mostly plateau with some hills and mountains.</p>\r\n\r\n<p>Lake Malawi, the third largest lake in Africa, occupies about a third of the country's area. The country lies within the tropics. Under the Köppen climate classification, Malawi has a tropical savanna climate. There are two main seasons: a dry season from June to August and a wet season from September to May.</p>\r\n\r\n<p>Malawi is one of the world's least developed countries. The economy is based on agriculture, with a largely rural population. The Malawian government depends heavily on foreign aid to meet its annual budget. The economy of Malawi is marked by a large informal sector, which employs a majority of the workforce.</p>\r\n\r\n<p>Malawi is densely populated and has a large youth population. The country is struggling to achieve the Millennium Development Goals, including eradicating extreme poverty and hunger. Life expectancy at birth is 54 years.</p>\r\n\r\n<p>Malawi is one of the world's poorest countries. In 2014, the country's GDP per capita was estimated to be US$1,020. Malawi's economy is based on agriculture, with a largely rural population. The Malawian government depends heavily on foreign aid to meet its annual budget.</p>\r\n\r\n<p>The country has few natural resources and faces significant challenges in its efforts to overcome poverty. A large percentage of the population is HIV-positive, and Malawi has one of the world's highest rates of child mortality. In 2014, the country's life expectancy was estimated to be 54 years.</p>\r\n\r\n<p>Malawi is densely populated and has a large youth population. The country has made significant progress in achieving the Millennium Development Goals, including eradicating extreme poverty and hunger. Despite these efforts, much work remains to be done in order to improve the quality of life for all Malawians.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
