    locations_country_209.article =  importer.locate_object(Article, "id", Article, "id", 6525, {'id': 6525, 'excerpt': 'マダガスカル', 'kicker': 'マダガスカル', 'content': '<p>マダガスカルは、アフリカ大陸の東岸、インド洋に位置する大きな島国です。テキサス州とほぼ同じ大きさのこの島には、2,200万人以上の人々が住んでいます。人口の大部分（90％以上）はマダガスカル人で、アフリカ、アラブ、インド、ヨーロッパの影響が混在している。マダガスカルの公用語はマダガスカル語ですが、フランス語も話されています。</p>\r\n\r\n<p>マダガスカル島は、約8800万年前にアフリカ大陸の一部が分裂し、南下してできたと考えられています。この島は、他の地域から隔離されているため、豊かでユニークな生物多様性を持っています。この島には、キツネザル、アイアイ、フォッサなど、ユニークな動物が生息しています。</p>\r\n\r\n<p>マダガスカルの歴史は、多くの植民地時代の影響によって特徴づけられています。10世紀にアラブの商人が初めてこの島を訪れ、15世紀にはモザンビークのスルタンの支配下に置かれました。1506年、ポルトガルの探検家ディオゴ・ディアスがこの島に上陸し、ポルトガルの領有権を主張した。その後、オランダ、イギリス、フランスなど、さまざまな国の手に渡った。</p>\r\n\r\n<p>1811年、フランスはマダガスカルを正式に植民地として主張した。その後1世紀にわたり、フランス人総督が次々とこの島を統治した。フランス植民地時代には、1883年から1896年のマダガスカル戦争、1947年のメリナの反乱など、多くの反乱が発生しました。1960年、マダガスカルはフランスから独立した。</p>\r\n\r\n<p>独立後、マダガスカルは一連の民主主義政権に統治されてきました。2013年に行われた最新の大統領選挙では、ヘリー・ラジャオナリマンピアニナが勝利した。しかし、彼の政権は汚職の疑惑に悩まされてきた。2018年3月、不正疑惑に彩られた投票の結果、ラジャオナリマンピアニナは僅差で再選を果たした。</p>\r\n\r\n<p>マダガスカルの経済は、主に農業に基づいています。主な栽培作物は、米、コーヒー、バニラ、サトウキビ、トウモロコシなどです。また、石油、ニッケル、コバルトなど、多くの鉱物資源も有している。しかし、マダガスカルは経済が発展途上であり、人口の大半が貧困にあえいでいます。</p>\r\n\r\n<p>マダガスカル政府は現在、島の経済を改善するために取り組んでいます。主な優先事項の1つは、外国投資の誘致と観光の促進です。近年、マダガスカルへの訪問者数は増加しており、その大半はフランス、米国、中国からの訪問者です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
