    locations_country_210.article =  importer.locate_object(Article, "id", Article, "id", 6526, {'id': 6526, 'excerpt': 'Madagascar', 'kicker': 'Madagascar', 'content': '<p>Madagascar is a large island nation located off the eastern coast of Africa in the Indian Ocean. The island is about the size of Texas, and is home to a population of over 22 million people. The vast majority of the population (over 90%) is Malagasy, a mixture of African, Arab, Indian, and European influences. The official language of Madagascar is Malagasy, although French is also spoken.</p>\r\n\r\n<p>The island of Madagascar is believed to have been formed about 88 million years ago when a portion of the African continent broke away and drifted south. The island has a rich and unique biodiversity, due to its isolation from the rest of the world. The island is home to several unique animal species, including the lemur, the aye-aye, and the fossa.</p>\r\n\r\n<p>The history of Madagascar is marked by a number of colonial influences. The island was first visited by Arab traders in the 10th century, and by the 15th century, it was under the control of the Sultan of Mozambique. In 1506, the Portuguese explorer Diogo Dias landed on the island and claimed it for Portugal. The island then passed through a number of hands, including the Dutch, the British, and the French.</p>\r\n\r\n<p>In 1811, the French officially claimed Madagascar as a colony. For the next century, the island was ruled by a succession of French governors. The French colonial period was marked by a number of rebellions, including the Malagasy War of 1883-1896 and the Merina Rebellion of 1947. In 1960, Madagascar gained its independence from France.</p>\r\n\r\n<p>Since gaining independence, Madagascar has been ruled by a series of democratic governments. The most recent presidential election, held in 2013, was won by Hery Rajaonarimampianina. However, his government has been plagued by allegations of corruption. In March of 2018, Rajaonarimampianina was narrowly re-elected in a vote marred by allegations of fraud.</p>\r\n\r\n<p>The economy of Madagascar is based largely on agriculture. The main crops grown on the island include rice, coffee, vanilla, sugarcane, and maize. The island also has a number of mineral resources, including oil, nickel, and cobalt. However, the economy of Madagascar is largely underdeveloped, and the majority of the population lives in poverty.</p>\r\n\r\n<p>The government of Madagascar is currently working to improve the economy of the island. One of the main priorities is to attract foreign investment and promote tourism. In recent years, there has been a growth in the number of visitors to Madagascar, with the majority coming from France, the United States, and China.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
