    locations_country_211.article =  importer.locate_object(Article, "id", Article, "id", 6527, {'id': 6527, 'excerpt': 'マケドニア', 'kicker': 'マケドニア', 'content': '<p>マケドニアは、南東ヨーロッパのバルカン半島中部に位置する内陸国です。北はセルビアとコソボ、西はアルバニア、南はギリシャ、東はブルガリアと国境を接しています。人口は約205万人、面積は25,713平方キロメートルです。マケドニアは議会制の共和国で、議会は一院制です。大統領が国家元首で、首相が政府首脳です。</p>\r\n\r\n<p>マケドニアという国の成り立ちは謎に包まれている。マケドニア人について最初に言及したのはアテネの政治家デモステネスで、紀元前335年に「マケドニア人」はアテネ人の隣人であると演説している。しかし、デモステネスが特定の民族を指していたのではなく、ギリシャ人、イリュリア人、トラキア人が混在するマケドニア地方の住民を指していたことを示す証拠はない。</p>\r\n\r\n<p>最初のマケドニア人はスラブ人で、紀元7世紀にこの地域に移住し、地元のギリシャ人やイリリア人と同化した。11世紀、ビザンティンの歴史家アンナ・コムネがマケドニア地方に住む「マケドニア人」について言及したのが、マケドニア人に関する最初の文献の始まりである。</p>\r\n\r\n<p>12世紀後半、セルビアの支配者ステファン・ネマニャがマケドニア地方を征服し、この地方にセルビア正教会を設立した。セルビア正教会は、マケドニア人のナショナル・アイデンティティの形成に重要な役割を果たした。</p>\r\n\r\n<p>13世紀、ブルガリア帝国はマケドニア地方を征服した。しかし、14世紀にブルガリア帝国は衰退し、セルビア帝国がこの地域に進出してきた。1373年、セルビア王ステファン・ドゥサンは、マケドニア地方とコソボ地方を含む「マケドニア王国」を宣言した。</p>\r\n\r\n<p>1389年、セルビア王ステファン・ドゥサンはコソボの戦いで戦死し、セルビア帝国は衰退した。その後、オスマン帝国がマケドニア地方を征服した。オスマン帝国はその後500年にわたりマケドニア地方を支配した。</p>\r\n\r\n<p>オスマントルコ時代、マケドニア人はトルコの支配下に置かれ、独自の民族的アイデンティティを育むことは許されなかった。しかし、マケドニア人は独自の言語と文化を維持していました。</p>\r\n\r\n<p>19世紀後半になると、マケドニア人はオスマン帝国からの独立を求める運動を始める。1908年、オスマン帝国は崩壊し、マケドニアは新たに誕生したセルビア王国の一部となった。</p>\r\n\r\n<p>1912年、バルカン戦争が勃発し、マケドニアはセルビア、ブルガリア、ギリシャの3カ国に分割された。1916年、第一次世界大戦でブルガリアが敗れ、マケドニアの支配権を失う。1918年、マケドニアは新たに設立されたセルビア・クロアチア・スロベニア王国の一部となり、後にユーゴスラビアとなる。</p>\r\n\r\n<p>第二次世界大戦では、マケドニアはナチス・ドイツに占領された。1944年、ユーゴスラビアはナチスの占領から解放され、マケドニアはユーゴスラビアの一部となった。</p>\r\n\r\n<p>1991年、ユーゴスラビアは崩壊し、マケドニアは独立国となった。</p>\r\n\r\n<p>マケドニアは一院制の議会制共和国である。大統領が国家元首で、首相が政府首脳です。</p>\r\n\r\n<p>大統領は議会で選出され、任期は5年です。首相は大統領によって任命され、任期は4年です。</p>\r\n\r\n<p>立法府は国民によって選出され、120名の議員で構成され、任期は4年です。</p>\r\n\r\n<p>司法は行政府、立法府から独立しています。</p>\r\n\r\n<p>マケドニアは、民間企業と国有企業の混合経済を基盤としています。経済の主な部門は農業、工業、サービス業です。</p>\r\n\r\n<p>農業部門はGDPの13.5%を占め、労働力の14.9%を雇用しています。主な作物は小麦、トウモロコシ、大麦、タバコ、テンサイ、ヒマワリの種。主な家畜は牛、豚、鶏である。</p>\r\n\r\n<p>工業部門はGDPの24.4%を占め、労働力の27.3%を雇用している。主な産業は、食品加工、金属加工、繊維製造、木材加工である。</p>\r\n\r\n<p>サービス業はGDPの62.1%を占め、労働力の58.8%を雇用している。主なサービス業は、貿易、運輸、通信、金融サービス、不動産、行政などである。</p>\r\n\r\n<p>マケドニアの人口は約205万人で、面積は25,713平方キロメートルです。</p>\r\n\r\n<p>マケドニアの人口は、スラブ人、ギリシャ人、アルバニア人、トルコ人の混血です。人口の大半はマケドニア人です。最大の少数派はアルバニア人である。</p>\r\n\r\n<p>マケドニアの公用語はマケドニア語です。マケドニア語はスラブ系の言語で、セルビア語、クロアチア語、ブルガリア語に似ています。</p>\r\n\r\n<p>国民の大多数は正教徒である。最大の少数派はイスラム教徒である。</p>\r\n\r\n<p>国連、欧州評議会、南東ヨーロッパ協力プロセス、欧州安全保障協力機構、世界貿易機関に加盟している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
