    locations_country_212.article =  importer.locate_object(Article, "id", Article, "id", 6528, {'id': 6528, 'excerpt': 'Macedonia', 'kicker': 'Macedonia', 'content': '<p>Macedonia is a landlocked country located in the central Balkan peninsula in Southeast Europe. It is bordered by Serbia and Kosovo to the north, Albania to the west, Greece to the south, and Bulgaria to the east. The country has a population of approximately 2.05 million and an area of 25,713 square kilometers. Macedonia is a parliamentary republic with a unicameral legislature. The president is the head of state and the prime minister is the head of government.</p>\r\n\r\n<p>The origins of the Macedonian nation are shrouded in mystery. The first mention of the Macedonians is in the oration of the Athenian politician Demosthenes, who in 335 BC spoke of the “Macedonians” being neighbors of the Athenians. However, there is no evidence that Demosthenes was referring to a distinct people, but rather to the inhabitants of the region of Macedonia, who were a mix of Greeks, Illyrians, and Thracians.</p>\r\n\r\n<p>The first identifiable Macedonians were the Slavs, who in the 7th century AD migrated into the region and assimilated with the local Greeks and Illyrians. The first written reference to a distinct Macedonian people dates from the 11th century, when the Byzantine historian Anna Komnene referred to the “Macedonians” living in the region of Macedonia.</p>\r\n\r\n<p>In the late 12th century, the Serbian ruler Stefan Nemanja conquered the region of Macedonia and founded the Serb Orthodox Church in the region. The Serbian Orthodox Church played a significant role in the development of the Macedonian national identity.</p>\r\n\r\n<p>In the 13th century, the Bulgarian Empire conquered the region of Macedonia. However, the Bulgarian Empire declined in the 14th century, and the Serbian Empire expanded into the region. In 1373, the Serbian king Stefan Dusan proclaimed the Kingdom of Macedonia, which included the region of Macedonia and the region of Kosovo.</p>\r\n\r\n<p>In 1389, the Serbian king Stefan Dusan was killed in the Battle of Kosovo, and the Serbian Empire declined. The Ottoman Empire then conquered the region of Macedonia. The Ottoman Empire ruled Macedonia for the next 500 years.</p>\r\n\r\n<p>During the Ottoman period, the Macedonians were subjected to Turkish rule and were not allowed to develop a distinctive national identity. However, the Macedonians did maintain their own language and culture.</p>\r\n\r\n<p>In the late 19th century, the Macedonians began to campaign for independence from the Ottoman Empire. In 1908, the Ottoman Empire dissolved, and Macedonia became a part of the newly created Kingdom of Serbia.</p>\r\n\r\n<p>In 1912, the Balkan Wars broke out, and Macedonia was divided between Serbia, Bulgaria, and Greece. In 1916, Bulgaria was defeated in the First World War and lost control of Macedonia. In 1918, Macedonia became a part of the newly created Kingdom of the Serbs, Croats, and Slovenes, which later became Yugoslavia.</p>\r\n\r\n<p>During the Second World War, Macedonia was occupied by Nazi Germany. In 1944, Yugoslavia was liberated from Nazi occupation and Macedonia became a part of Yugoslavia.</p>\r\n\r\n<p>In 1991, Yugoslavia broke up and Macedonia became an independent country.</p>\r\n\r\n<p>Macedonia is a parliamentary republic with a unicameral legislature. The president is the head of state and the prime minister is the head of government.</p>\r\n\r\n<p>The president is elected by the legislature and serves a five-year term. The prime minister is appointed by the president and serves a four-year term.</p>\r\n\r\n<p>The legislature is elected by the people and consists of 120 members, who serve four-year terms.</p>\r\n\r\n<p>The judiciary is independent of the executive and the legislature.</p>\r\n\r\n<p>Macedonia has a mixed economy, which is based on a mix of private enterprise and state ownership. The main sectors of the economy are agriculture, industry, and services.</p>\r\n\r\n<p>The agriculture sector accounts for 13.5% of GDP and employs 14.9% of the workforce. The main crops are wheat, maize, barley, tobacco, sugar beets, and sunflower seeds. The main livestock are cattle, pigs, and chickens.</p>\r\n\r\n<p>The industry sector accounts for 24.4% of GDP and employs 27.3% of the workforce. The main industries are food processing, metal processing, textile manufacturing, and wood processing.</p>\r\n\r\n<p>The services sector accounts for 62.1% of GDP and employs 58.8% of the workforce. The main services sectors are trade, transportation, and communication, financial services, real estate, and public administration.</p>\r\n\r\n<p>Macedonia has a population of approximately 2.05 million and an area of 25,713 square kilometers.</p>\r\n\r\n<p>The population of Macedonia is a mix of Slavs, Greeks, Albanians, and Turks. The majority of the population is ethnic Macedonian. The largest minority is ethnic Albanian.</p>\r\n\r\n<p>The official language of Macedonia is Macedonian. Macedonian is a Slavic language, which is similar to Serbian, Croatian, and Bulgarian.</p>\r\n\r\n<p>The majority of the population is Orthodox Christian. The largest minority is Muslim.</p>\r\n\r\n<p>Macedonia is a member of the United Nations, the Council of Europe, the Southeast Europe Cooperation Process, the Organization for Security and Cooperation in Europe, and the World Trade Organization.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
