    locations_country_213.article =  importer.locate_object(Article, "id", Article, "id", 6529, {'id': 6529, 'excerpt': 'ルクセンブルク', 'kicker': 'ルクセンブルク', 'content': '<p>ルクセンブルクは、西ヨーロッパにある小さな内陸国で、ベルギー、フランス、ドイツに隣接しています。国土は、北部のオーズリングと南部のグートランドに分かれ ています。首都であり最大の都市はルクセンブルク・シティで、同国の政治と金融の中心地でもあります。</p>\r\n\r\n<p>ルクセンブルクは、民主的な議会制度を持つ立憲君主制国家です。ルクセンブルク大公が国家元首で、首相が政 府の長を務めています。公用語はルクセンブルク語ですが、フランス語とドイ ツ語も話されています。</p>\r\n\r\n<p>ルクセンブルクの経済は、銀行業、鉄鋼業、観光業に よって成り立っています。ルクセンブルクは米国に次ぐ世界第2位の投資国であり、資産運用の世界的な中心地でもあります。</p>\r\n\r\n<p>ルクセンブルクの歴史は、ローマ時代までさかのぼることができ ます。963年、ルクセンブルクは神聖ローマ帝国の一部と なりました。中世後期、ルクセンブルクはルクセンブルク伯爵家によっ て統治されていました。1354年、ルクセンブルクはブルゴーニュ家の支配下に入 りました。1477年、ブルゴーニュ領のオランダはオーストリアの ハプスブルク家に継承され、ルクセンブルクもオーストリア帝 国の一部となりました。</p>\r\n\r\n<p>1815年、ルクセンブルクはオランダ王国に併合され ました。1839年にルクセンブルクは独立を回復しましたが、1867年ま でオランダの一部でした。1867年、ルクセンブルクは大公国として独立しました。</p>\r\n\r\n<p>第二次世界大戦後、ルクセンブルクは国連、欧州連合、 NATOに加盟しています。また、シェンゲン協定の加盟国でもあります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
