    locations_country_217.article =  importer.locate_object(Article, "id", Article, "id", 6533, {'id': 6533, 'excerpt': 'リビア', 'kicker': 'リビア', 'content': '<p>北アフリカに位置するリビアは、人口650万人で、アラスカ州よりやや小さい国です。公用語はアラビア語ですが、多くのリビア人はイタリア語も話します。宗教はイスラム教（スンニ派）が主流です。</p>\r\n\r\n<p>1951年にイタリアから独立して以来、リビアは独裁的な政権に支配され続けてきた。1969年、ムアンマル・カダフィ大佐が軍事クーデターにより政権を奪取し、2011年に死去するまで独裁者として国を統治した。カダフィ大佐の統治下、リビアは世界から孤立し、経済的・社会的に大きな停滞を経験しました。</p>\r\n\r\n<p>2011年2月、カダフィ政権に対する民衆の蜂起が始まり、瞬く間に内戦へと発展しました。2011年10月、反政府勢力がリビアの首都トリポリを占領し、カダフィは殺害された。2012年8月、国家暫定評議会は国民会議（GNCC）に交代した。</p>\r\n\r\n<p>2014年6月、国民議会は、現在のリビアの統治機関である下院に交代した。下院は東部の都市トブルクを拠点としており、民兵の支援を受けるトリポリに拠点を置く対立政権はリビアの正統政府であると主張している。</p>\r\n\r\n<p>2014年以降、リビアは暴力と政情不安に悩まされている。国土は東西に分断され、それぞれを対立する派閥が支配しています。また、リビアには「イスラム国」（IS）が存在感を示し、テロ攻撃を行っている。</p>\r\n\r\n<p>2017年12月、国連（UN）は対立する派閥をまとめ、リビアの将来のロードマップに合意しようと、パリで会議を主催した。しかし、この会議は失敗に終わった。</p>\r\n\r\n<p>2019年1月、国連安全保障理事会は、リビアに安定をもたらす試みとして、国連ミッションの派遣を承認しました。UNSMILと呼ばれるこのミッションの任務は、リビア政府による政治的ロードマップの実施、国民和解の促進、民間人の保護を支援することである。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
