    locations_country_231.article =  importer.locate_object(Article, "id", Article, "id", 6547, {'id': 6547, 'excerpt': 'クウェート', 'kicker': 'クウェート', 'content': '<p>クウェートは、アラビア半島の北西に位置するアラブの主権国家首長国である。2016年1月現在、クウェートの人口は420万人と推定される。クウェートは立憲君主制で、議会制をとっています。高所得経済国であり、世界銀行では高所得経済国に分類されています。クウェートは中東・北アフリカ地域で最も自由な経済国であり、世界でも18番目に自由な経済国として位置づけられている。</p>\r\n\r\n<p>クウェートという名前は、アラビア語で "水の近くに建てられた要塞 "を意味する "クト "に由来しています。この名前は、中世の地理学者アル・イドリーシによって初めて使われた。1716年、シェイク・ムハンマド・アル＝サバによって近代国家が誕生した。1961年にイギリスから独立した。</p>\r\n\r\n<p>アラビア半島の北西に位置し、イラクとサウジアラビアに隣接している。総面積は17,818km2（6,880平方マイル）、人口は420万人（2016年1月）である。クウェートシティは首都であり、最大の都市です。その他の主要都市は、ジャーラ、ハワリ、ファルワニヤなど。</p>\r\n\r\n<p>クウェートは議会制をとっており、立憲君主制である。首長が国家元首で、首相が政府首脳である。一院制の国民議会には50名の議員がおり、4年の任期で選出される。</p>\r\n\r\n<p>クウェートは高所得国であり、世界銀行は高所得国として分類している。同国の主な輸出品目は石油・ガス、化学製品、石油化学製品などである。クウェートは世界第6位の石油生産国であり、石油輸出国機構（OPEC）では第2位の石油生産国である。同国の主な輸入品には、食料、自動車、機械などがある。</p>\r\n\r\n<p>クウェートは、アラブ連盟、湾岸協力会議、OPECのメンバーである。通貨はクウェート・ディナール。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
