    locations_country_235.article =  importer.locate_object(Article, "id", Article, "id", 6551, {'id': 6551, 'excerpt': 'ケニア', 'kicker': 'ケニア', 'content': '<p>ケケニアは、東アフリカに位置する国である。北にソマリア、西にエチオピア、北西に南スーダン、南にウガンダ、東にタンザニアと国境を接している。首都はナイロビで、最大の都市である。国名はケニア山にちなんでおり、ケニア最大の民族であるキクユ族にちなんで命名された。</p>\r\n\r\n<p>ケニアに最初に住んだ人類は、約200万年前にアフリカの角からこの地にやってきた狩猟採集民だったと考えられています。ケニアに最初に永住したのは、紀元1千年紀に到着し始めたバンツー系の人々でした。1888年にイギリス東アフリカ会社がケニアに到着し、1920年にイギリスの植民地となりました。</p>\r\n\r\n<p>1963年12月、ケニアはイギリスから独立しました。初代大統領はジョモ・ケニヤッタで、1964年から1978年まで同国を統治した。ダニエル・アラップ・モイがケニヤッタの後を継いで大統領に就任し、1978年から2002年まで統治した。2002年、モイの後を継いでムワイ・キバキが大統領に就任し、2013年まで統治した。ジョモ・ケニヤッタの息子であるウフル・ケニヤッタが現在のケニア大統領である。</p>\r\n\r\n<p>ケニアの経済は、主に農業、観光、サービス業に基づいています。主な輸出品は、コーヒー、紅茶、園芸品、石油製品、鉱物です。主な輸入品は、資本設備、工業原料、食料品、消費財です。</p>\r\n\r\n<p>ケニアで話されている主な言語はスワヒリ語ですが、英語も広く話されています。ケニアで信仰されている主な宗教は、キリスト教とイスラム教です。</p>\r\n\r\n<p>ケニアはアフリカ連合、東アフリカ共同体、英連邦、国連に加盟しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
