    locations_country_239.article =  importer.locate_object(Article, "id", Article, "id", 6555, {'id': 6555, 'excerpt': 'ヨルダン', 'kicker': 'ヨルダン', 'content': '<p>スピース</p>\r\n\r\n<p>ジョーダン・スピースは、世界で最も成功しているプロゴルファーの一人である。1993年7月27日、テキサス州ダラスで生まれた。わずか9歳でゴルフを始め、高校時代には全米トップクラスのジュニアゴルファーとなった。</p>\r\n\r\n<p>2011年、18歳のときに全米ジュニアアマチュア選手権を制覇。翌年、史上最年少でマスターズ・トーナメントに出場し、2位入賞を果たした。2015年、21歳のスピースは、史上2番目に若いゴルファーとしてマスターズ・トーナメントを制覇した。さらに同年末の全米オープンでも優勝し、マスターズと全米オープンを同じ年に制した史上2人目のゴルファーとなった。</p>\r\n\r\n<p>スピースはゴルフコースでの成功により、何百万ドルもの賞金を獲得しています。また、コカ・コーラ、アンダーアーマー、ロレックスなど、世界有数の大企業からスポンサーを獲得している。</p>\r\n\r\n<p>スピースは世界で最も人気のあるゴルファーの一人であり、彼のファンは自分たちを "スピースマニアックス "と呼んでいる。スピースは、そのアグレッシブなプレースタイルと、大事な場面でクラッチショットを決める能力で知られています。また、世界で最も慈善活動に熱心なアスリートの一人であり、いくつかの団体と提携して子供たちの支援活動も行っています。</p>\r\n\r\n<p>ジョーダン・スピースは、世界で最も成功したプロゴルファーの一人です。1993年7月27日、テキサス州ダラスで生まれました。わずか9歳でゴルフを始め、高校時代には全米トップクラスのジュニアゴルファーとなった。</p>\r\n\r\n<p>2011年、18歳のときに全米ジュニアアマチュア選手権を制覇。翌年、史上最年少でマスターズ・トーナメントに出場し、2位入賞を果たした。2015年、21歳のスピースは、史上2番目に若いゴルファーとしてマスターズ・トーナメントを制覇した。さらに同年末の全米オープンでも優勝し、マスターズと全米オープンを同じ年に制した史上2人目のゴルファーとなった。</p>\r\n\r\n<p>スピースはゴルフコースでの成功により、何百万ドルもの賞金を獲得しています。また、コカ・コーラ、アンダーアーマー、ロレックスなど、世界有数の大企業からスポンサーを獲得している。</p>\r\n\r\n<p>スピースは世界で最も人気のあるゴルファーの一人であり、彼のファンは自分たちを "スピースマニアックス "と呼んでいる。スピースは、そのアグレッシブなプレースタイルと、大事な場面でクラッチショットを決める能力で知られています。また、世界で最も慈善活動に熱心なアスリートの一人であり、いくつかの団体と提携して子供たちの支援活動も行っています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.421238+00:00")} ) 
