    locations_country_287.article =  importer.locate_object(Article, "id", Article, "id", 6603, {'id': 6603, 'excerpt': 'ガーナ', 'kicker': 'ガーナ', 'content': '<p>ガーナは、アフリカのギニア湾に面し、北にブルキナファソ、東にトーゴ、南にコートジボワール、西にギニア湾に囲まれた238,533平方キロメートルの国土を持つ国です。人口は約27,469,362人。</p>\r\n\r\n<p>ガーナの公用語は英語で、2010年の国勢調査によると、国民の71.2%が英語を第一言語としています。ガーナで最も多く話されているアフリカの言語はアカン語であり、次いでガ語、エウェ語の順となっています。ガーナは立憲民主主義国家で、大統領と議会があります。大統領は普通選挙で選ばれ、任期は4年です。大統領は国家元首であり、軍隊の最高司令官でもあります。議会は275名の一院制です。</p>\r\n\r\n<p>ガーナの経済はアフリカで最も多様性に富んでおり、サービス業、製造業、農業がそれぞれGDPの約60％、20％、20％を占めている。金、石油、カカオが主な輸出品目です。対外債務は推定425億ドル。主な産業は、食品加工、繊維、自動車、建設などです。</p>\r\n\r\n<p>植民地時代以前、ガーナには多くの民族が住んでいたが、その中でも最も重要な民族がアカン族であった。アカン族はクワ語の一種であるアカン語を話します。16世紀から18世紀にかけて、ガーナはアカン族の帝国の一部であり、アカン族はこの地域にいくつものアカン族国家を設立した。19世紀にイギリスがこの地域に入り、徐々にこれらの国を征服、併合していった。1957年、イギリスのゴールドコースト植民地は、ガーナとして独立した。</p>\r\n\r\n<p>1992年、ガーナは新憲法を採択し、複数政党制を導入した。1992年12月、新憲法下で初の大統領選挙と国会議員選挙が行われた。大統領には、国家元首で国民民主会議（NDC）党首のジェリー・ローリングスが選出された。NDCは議会で過半数の議席を獲得した。</p>\r\n\r\n<p>1996年と2000年に大統領に再選された。2001年12月、NDCが議席の過半数を獲得し、新愛国党のジョン・クフオルが大統領に選出された。2004年、クフオールは大統領に再選された。2008年12月、NDCが過半数議席を獲得し、ジョン・アタ・ミルズが大統領に選出された。</p>\r\n\r\n<p>ガーナは自然豊かな国である。東部には森林に覆われたアクワピム・トーゴ山脈が南北に走り、西部にはガーナ最大の川であるヴォルタ川が国境を形成している。気候は熱帯性で、高温多湿の雨季（4月〜10月）と涼しい乾季（11月〜3月）がある。</p>\r\n\r\n<p>ガーナの経済はアフリカで最も多様性に富んでおり、GDPに占めるサービス業の割合は約60％、製造業の割合は約20％、農業の割合は約20％である。金、石油、カカオが主な輸出品目です。対外債務は推定425億ドル。主な産業は、食品加工、繊維、自動車、建設などです。</p>\r\n\r\n<p>ガーナは近年、経済発展と貧困削減において大きな前進を遂げています。世界銀行によると、2000年には、ガーナの人口の36.8%が貧困状態にありました。世界銀行によると、2000年にはガーナの人口の36.8%が貧困状態にありましたが、2010年には24.1%まで減少しています。また、教育、保健、インフラの整備も進んでいます。2008年、ガーナはサハラ以南のアフリカで初めて、初等教育のミレニアム開発目標を達成しました。2010年には、世界で初めてHIV/AIDSの母子感染ゼロを達成したと発表しました。</p>\r\n\r\n<p>ガーナは、大統領と議会のある立憲民主主義国家です。大統領は普通選挙で選ばれ、任期は4年で、国家元首と軍の最高司令官を兼ねています。議会は275名の一院制です。司法は独立しています。</p>\r\n\r\n<p>ガーナの経済はアフリカで最も多様性に富んでおり、サービス業、製造業、農業がそれぞれGDPの約60％、20％、20％を占めている。金、石油、カカオが主な輸出品目です。対外債務は推定425億ドル。主な産業は、食品加工、繊維、自動車、建設などです。</p>\r\n\r\n<p>ガーナは自然が美しい国です。東部には森林に覆われたアクワピム・トーゴ山脈が南北に走り、西部にはガーナ最大の川であるボルタ川が国境を形成しています。気候は熱帯性で、高温多湿の雨季（4月〜10月）と涼しい乾季（11月〜3月）がある。</p>\r\n\r\n<p>ガーナは近年、経済発展と貧困削減の面で大きな成果を上げている。世界銀行によると、2000年にはガーナの人口の36.8％が貧困状態にあったとされています。世界銀行によると、2000年にはガーナの人口の36.8%が貧困状態にありましたが、2010年には24.1%まで減少しています。また、教育、保健、インフラの整備も進んでいます。2008年、ガーナはサハラ以南のアフリカで初めて、初等教育のミレニアム開発目標を達成しました。2010年には、世界で初めてHIV/AIDSの母子感染ゼロを達成したと発表しました。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
