    locations_country_288.article =  importer.locate_object(Article, "id", Article, "id", 6604, {'id': 6604, 'excerpt': 'Ghana', 'kicker': 'Ghana', 'content': "<p>Ghana, an African country located on the Gulf of Guinea and occupying the space of 238,533 square kilometers, is bordered to the north by Burkina Faso, to the east by Togo, to the south by the Ivory Coast and to the west by the Gulf of Guinea. It has a population of approximately 27,469,362 people.</p>\r\n\r\n<p>The official language of Ghana is English, with 71.2% of the population speaking it as a first language, according to the 2010 census. The Akan language is the most widely spoken African language in Ghana, followed by Ga and Ewe. Ghana is a constitutional democracy with a president and parliament. The president, elected by universal suffrage for a four-year term, is head of state and commander in chief of the armed forces. The parliament is a 275-member unicameral body.</p>\r\n\r\n<p>Ghana's economy is one of the most diversified in Africa, with services, manufacturing, and agriculture accounting for about 60%, 20%, and 20% of GDP, respectively. Gold, oil, and cocoa are the principal export commodities. The country has an estimated $42.5 billion in external debt. Major industries include food processing, textiles, automotive, and construction.</p>\r\n\r\n<p>Ghana was inhabited in pre-colonial times by a number of ethnic groups, the most important of which were the Akan. The Akan speak the Akan language, which is a member of the Kwa language family. From the 16th century to the 18th century, Ghana was part of the empire of the Akan people, who established a number of Akan states in the region. The British entered the region in the 19th century and gradually conquered and annexed these states. In 1957, the British Gold Coast colony became an independent state as Ghana.</p>\r\n\r\n<p>In 1992, Ghana adopted a new constitution that provided for a multiparty political system. The country held its first presidential and parliamentary elections under the new constitution in December 1992. Jerry Rawlings, the head of state and founder of the National Democratic Congress (NDC) party, was elected president. The NDC won a majority of seats in the parliament.</p>\r\n\r\n<p>Rawlings was reelected president in 1996 and 2000. In December 2001, the NDC won a majority of seats in the parliament, and John Kufuor of the New Patriotic Party (NPP) was elected president. Kufuor was reelected president in 2004. In December 2008, the NDC won a majority of seats in the parliament and John Atta Mills was elected president.</p>\r\n\r\n<p>Ghana is a country of great natural beauty. The forested Akwapim-Togo Ranges run north-south through the eastern part of the country, and the Volta River, Ghana's largest river, forms the country's western border. The climate is tropical, with a hot and humid rainy season (April-October) and a cooler dry season (November-March).</p>\r\n\r\n<p>Ghana's economy is one of the most diversified in Africa, with services, manufacturing, and agriculture accounting for about 60%, 20%, and 20% of GDP, respectively. Gold, oil, and cocoa are the principal export commodities. The country has an estimated $42.5 billion in external debt. Major industries include food processing, textiles, automotive, and construction.</p>\r\n\r\n<p>Ghana has made great strides in economic development and poverty reduction in recent years. In 2000, according to the World Bank, 36.8% of Ghana's population was living in poverty. By 2010, that number had been reduced to 24.1%. Ghana has also made progress in education, health, and infrastructure development. In 2008, Ghana became the first country in sub-Saharan Africa to achieve the Millennium Development Goals for primary education. In 2010, Ghana became the first country in the world to announce it had eliminated mother-to-child transmission of HIV and AIDS.</p>\r\n\r\n<p>Ghana is a constitutional democracy with a president and parliament. The president, elected by universal suffrage for a four-year term, is head of state and commander in chief of the armed forces. The parliament is a 275-member unicameral body. The judiciary is independent.</p>\r\n\r\n<p>Ghana's economy is one of the most diversified in Africa, with services, manufacturing, and agriculture accounting for about 60%, 20%, and 20% of GDP, respectively. Gold, oil, and cocoa are the principal export commodities. The country has an estimated $42.5 billion in external debt. Major industries include food processing, textiles, automotive, and construction.</p>\r\n\r\n<p>Ghana is a country of great natural beauty. The forested Akwapim-Togo Ranges run north-south through the eastern part of the country, and the Volta River, Ghana's largest river, forms the country's western border. The climate is tropical, with a hot and humid rainy season (April-October) and a cooler dry season (November-March).</p>\r\n\r\n<p>Ghana has made great strides in economic development and poverty reduction in recent years. In 2000, according to the World Bank, 36.8% of Ghana's population was living in poverty. By 2010, that number had been reduced to 24.1%. Ghana has also made progress in education, health, and infrastructure development. In 2008, Ghana became the first country in sub-Saharan Africa to achieve the Millennium Development Goals for primary education. In 2010, Ghana became the first country in the world to announce it had eliminated mother-to-child transmission of HIV and AIDS.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
