    locations_country_291.article =  importer.locate_object(Article, "id", Article, "id", 6607, {'id': 6607, 'excerpt': 'グルジア', 'kicker': 'グルジア', 'content': '<p>グルジアは、ユーラシア大陸のコーカサス地方に位置する国である。北と北東をロシア、南西をトルコ、南東をアルメニア、南をアゼルバイジャンに囲まれた国である。首都および最大都市はトビリシである。グルジアの領土は69,700平方キロメートル（26,911平方マイル）で、2016年の人口は約371万8,000人である。グルジアは単一国家、半大統領制の共和国で、政府は混合選挙制度により選出されます。</p>\r\n\r\n<p>中世グルジアの国家は、12世紀から13世紀初頭のダヴィッド4世とタマル王妃の治世に政治・経済力のピークに達した。その後、君主制は徐々に衰退し、最終的にはモンゴルの侵略の圧力の下で崩壊した。19世紀、グルジアはロシア帝国に吸収された。1991年のソビエト連邦崩壊後、ロシア政府はグルジアの独立を承認した。</p>\r\n\r\n<p>国連、欧州評議会、GUAM民主経済開発機構に加盟している。また、先進民主主義国8カ国の非公式フォーラムであるGroup of Eightのメンバーでもある。グルジアは2000年代初頭からNATOとEUへの加盟を目指している。</p>\r\n\r\n<p>グルジアは、古くからの文化と伝統の国である。グルジア人は、独自の言語、独自のアルファベット、独自の料理、 独自の音楽と踊りを持っています。グルジア人は、もてなし好きな人々であり、彼らの国は、もてなし好きな国です。グルジアは、対照的な国です。それは、古いものと新しいものの両方です。それは、ヨーロッパとアジアの両方です。キリスト教とイスラム教の両方である。グルジアは、移行期にある国です。伝統的な社会から近代的な社会へと移行しているのです。</p>\r\n\r\n<p>グルジアの経済は、農業、鉱業、観光業に基づいています。主な農産物は、ブドウ、柑橘類、茶、ヘーゼルナッツ、家畜である。主な鉱業生産物は、マンガン、銅、鉄鉱石である。主な観光地は、トビリシ、バトゥーミ、ムツヘタ、スヴァネティである。</p>\r\n\r\n<p>グルジア政府は、情報通信技術、観光、医薬品などの経済の非伝統的なセクターの開発を促進しようとしている。これらの部門に外国からの投資を誘致しようとしている。</p>\r\n\r\n<p>グルジアの経済成長率は年率約4％である。失業率は約12％。インフレ率は約3％。主な輸出相手国は、トルコ、ロシア、アゼルバイジャン。主な輸入相手国は、ロシア、トルコ、中国。</p>\r\n\r\n<p>グルジアは、古い文化と伝統の国である。グルジア人は、独自の言語、独自のアルファベット、独自の料理、独自の音楽と踊りを持っています。グルジア人は、もてなしの心を持った人々で、彼らの国は、もてな しの心を持った国である。グルジアは、対照的な国です。それは、古いものと新しいものの両方です。それは、ヨーロッパとアジアの両方です。キリスト教とイスラム教の両方である。グルジアは、移行期にある国です。伝統的な社会から近代的な社会へと移行しつつある。グルジアの経済は、農業、鉱業、および観光業に基づいています。主な農産物は、ブドウ、柑橘類、茶、ヘーゼルナッツ、家畜である。主な鉱業生産物は、マンガン、銅、鉄鉱石である。主な観光地は、トビリシ、バトゥミ、ムツヘタ、スヴァネティである。グルジア政府は、情報通信技術、観光、医薬品などの経済の非伝統的なセクターの開発を促進しようとしている。これらの部門に外国からの投資を呼び込もうとしている。グルジアの経済成長率は年率約4％である。失業率は約12％。インフレ率は約3％。主な輸出相手国は、トルコ、ロシア、アゼルバイジャン。主な輸入相手国は、ロシア、トルコ、中国である。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
