    locations_country_295.article =  importer.locate_object(Article, "id", Article, "id", 6611, {'id': 6611, 'excerpt': 'フランス領ポリネシア', 'kicker': 'フランス領ポリネシア', 'content': '<p>正式名称は「オセアニア・フランス共和国」。フランス領ポリネシアは太平洋の南部、南米とオーストラリアのほぼ中間に位置しています。フランス領ポリネシアは、200万km2（772,000平方マイル）以上の面積に散在する118の島と環礁から構成されています。首都はタヒチ島のパペーテ。</p>\r\n\r\n<p>1595年にスペインの探検家アルバロ・デ・メンダーニャ・デ・ネイラがヌクヒバ島に到着したのが最初とされている。1722年、オランダ人探検家ヤコブ・ロゲフェンが到着し、オランダの州総長にちなんで「スタテン・ラント」と名付けました。1767年、イギリスの探検家サミュエル・ウォリスが訪れ、島々を「キングジョージ諸島」と名付けました。</p>\r\n\r\n<p>1880年、フランスがこの島々を併合。島々はフランスの植民地であるニューカレドニアの管轄下に置かれました。1957年、この島々はフランスの海外領土となりました。</p>\r\n\r\n<p>首都はパペーテで、人口は約18万6千人（2006年推計）。フランス領ポリネシアで2番目に大きなコミューンは、タヒチ島にあるファアアです。人口は約33,000人。</p>\r\n\r\n<p>公用語はフランス語。タヒチ語を含むポリネシア語も話されている。</p>\r\n\r\n<p>フランス領ポリネシアの経済は、主に観光業に基づいており、高級な旅行に重点を置いています。</p>\r\n\r\n<p>熱帯性気候で、11月から4月までは高温多湿、5月から10月までは涼しい季節となります。</p>\r\n\r\n<p>フランス領ポリネシアは、5つの行政区に分かれています。タヒチ島、ボラボラ島、モーレア島、フアヒネ島を含むイル・デュ・ヴァン（風上側諸島）、マルケサス諸島、ソシエテ諸島、ツアモツ諸島を含むリーワード諸島、ガンビエ諸島、オーストラル諸島、パペーテのローマカトリック教区に分かれています。</p>\r\n\r\n<p>以下は、フランス領ポリネシアで最も人口が多く、経済的にも重要な島であるタヒチ本島についての詳細な説明である。</p>\r\n\r\n<p>タヒチ島は、フランス領ポリネシアで最も大きく、最も人口の多い島です。フランス領ポリネシアの5つの行政区分のうち、最も人口の多いソサエティ諸島に位置しています。</p>\r\n\r\n<p>タヒチはハワイから南へ約2,000km、チリから西へ約8,000kmの位置にあります。島の長さは約100km、幅は約40kmです。</p>\r\n\r\n<p>島は山がちで、狭い海岸線に平野が広がっています。島の最高峰は標高2,241mのオロヘナ山。</p>\r\n\r\n<p>熱帯性気候で、11月から4月までは高温多湿の季節、5月から10月までは涼しい季節となります。年間平均気温は26℃です。</p>\r\n\r\n<p>島には約17万8千人（2006年推計）が住んでいる。最大の都市であり、島の首都でもあるパペーテの人口は約18万6,000人です。</p>\r\n\r\n<p>タヒチ島の経済は、主に観光業に基づいています。島には、ビーチ、サンゴ礁、ポリネシア文化など、さまざまな観光名所があります。また、島には多くの高級リゾートがあります。</p>\r\n\r\n<p>ここでは、フランス領ポリネシアの代表的な観光地であるモーレア島について詳しくご紹介します。</p>\r\n\r\n<p>モーレア島はソサエティ諸島に属する島で、タヒチの北約10kmに位置しています。島の長さは約18km、幅は約11kmです。</p>\r\n\r\n<p>島は丘陵地帯で、標高1,000mを超える山がいくつもあります。島の最高峰は標高1,236 mのトヒア山です。</p>\r\n\r\n<p>島は熱帯性気候で、11月から4月までは高温多湿の季節、5月から10月までは涼しい季節となります。年間平均気温は26℃。</p>\r\n\r\n<p>島には約9,000人（2006年推計）が住んでいます。島最大の都市であり首都であるヴァアヌイ・ア・タヒチは、人口約5,000人である。</p>\r\n\r\n<p>モーレア島の経済は、主に観光業に基づいています。島には、ビーチ、サンゴ礁、ポリネシア文化など、さまざまな観光名所があります。また、島には多くの高級リゾートがあります。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
