    locations_country_296.article =  importer.locate_object(Article, "id", Article, "id", 6612, {'id': 6612, 'excerpt': 'French Polynesia', 'kicker': 'French Polynesia', 'content': '<p>The official name of the territory is the "French Republic in Oceania". French Polynesia is located in the southern Pacific Ocean, about midway between South America and Australia. French Polynesia consists of 118 islands and atolls scattered over an area of more than 2,000,000 km² (772,000 sq mi). The territory\'s capital is Papeete on the island of Tahiti.</p>\r\n\r\n<p>The first European known to have reached the islands was Spanish explorer Álvaro de Mendaña de Neira, who arrived on the island of Nuku Hiva in 1595. In 1722, Dutch explorer Jacob Roggeveen arrived and named the island group "Staten Landt", after the Dutch States General. British explorer Samuel Wallis visited in 1767 and named the island group "King George Islands".</p>\r\n\r\n<p>France annexed the islands in 1880. The islands were placed under the authority of the French colony of New Caledonia. In 1957, the islands became an overseas territory of France.</p>\r\n\r\n<p>The capital, Papeete, has a population of about 186,000 (2006 estimate). The second largest commune in French Polynesia is Fa\'a\'ā, on the island of Tahiti. It has a population of about 33,000.</p>\r\n\r\n<p>The official language is French. Polynesian languages, including Tahitian, are also spoken.</p>\r\n\r\n<p>The economy of French Polynesia is based largely on tourism, with a heavy emphasis on luxury travel.</p>\r\n\r\n<p>The islands feature a tropical climate, with a hot and humid season from November to April and a cooler season from May to October.</p>\r\n\r\n<p>French Polynesia is divided into 5 administrative subdivisions: Îles du Vent (Windward Islands), including the islands of Tahiti, Bora Bora, Moorea, and Huahine; Leeward Islands, including the Marquesas Islands, the Society Islands, and the Tuamotu Archipelago; the Gambier Islands; the Austral Islands; and the Roman Catholic Diocese of Papeete.</p>\r\n\r\n<p>The following is a detailed description of the main island of Tahiti, the most populous and economically important island in French Polynesia.</p>\r\n\r\n<p>Tahiti is the largest and most populous island in French Polynesia. It is located in the Society Islands, the most populous of the five administrative divisions of French Polynesia.</p>\r\n\r\n<p>Tahiti is located about 2,000 km (1,200 mi) south of Hawaii, and about 8,000 km (5,000 mi) west of Chile. The island is about 100 km (60 mi) long and 40 km (25 mi) wide.</p>\r\n\r\n<p>The island is mountainous and features a narrow coastal plain. The highest point on the island is the peak of Mount Orohena, which is 2,241 m (7,351 ft) high.</p>\r\n\r\n<p>The island has a tropical climate, with a hot and humid season from November to April, and a cooler season from May to October. The average annual temperature is 26 °C (79 °F).</p>\r\n\r\n<p>The island is home to about 178,000 people (2006 estimate). The largest city and capital of the island is Papeete, which has a population of about 186,000.</p>\r\n\r\n<p>The economy of Tahiti is based largely on tourism. The island features a wide range of tourist attractions, including beaches, coral reefs, and Polynesian culture. The island is also home to a number of luxury resorts.</p>\r\n\r\n<p>The following is a detailed description of the island of Moorea, one of the most popular tourist destinations in French Polynesia.</p>\r\n\r\n<p>Moorea is an island in the Society Islands, located about 10 km (6 mi) north of Tahiti. The island is about 18 km (11 mi) long and 11 km (7 mi) wide.</p>\r\n\r\n<p>The island is hilly, with a number of peaks over 1,000 m (3,281 ft) high. The highest point on the island is Mount Tohiea, which is 1,236 m (4,063 ft) high.</p>\r\n\r\n<p>The island has a tropical climate, with a hot and humid season from November to April, and a cooler season from May to October. The average annual temperature is 26 °C (79 °F).</p>\r\n\r\n<p>The island is home to about 9,000 people (2006 estimate). The largest city and capital of the island is Va\'a-nui-a-Tahiti, which has a population of about 5,000.</p>\r\n\r\n<p>The economy of Moorea is based largely on tourism. The island features a wide range of tourist attractions, including beaches, coral reefs, and Polynesian culture. The island is also home to a number of luxury resorts.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
