    locations_country_297.article =  importer.locate_object(Article, "id", Article, "id", 6613, {'id': 6613, 'excerpt': 'フランス領ギアナ', 'kicker': 'フランス領ギアナ', 'content': '<p>フランス領ギアナは、南アメリカ大陸のブラジルとスリナムの間に位置するフランスの海外県であり、地域である。北と東は大西洋に面し、南はカリブ海に面している。陸地面積は83,534km²（32,253平方マイル）、人口は256,595人（2018年1月）です。</p>\r\n\r\n<p>フランス領ギアナは、カイエンヌとサンローラン・デュ・マロニの2つの行政区と、18のコミューンに分かれています。首都はカイエンヌで、フランス領ギアナ全体の首都でもある。人口密度は1平方キロメートルあたり3人（8平方マイル）で、世界で最も人口の少ない地域の一つである。</p>\r\n\r\n<p>フランス領ギアナ県は、1947年3月4日にギアナ県から分離して誕生し、スリナムとなった。それ以前は、フランス植民地帝国の重要な一部であり、住民はフランス国民であった。アマゾン川の河口と、密林のオヤポック川によって、フランスの他の地域と隔てられている。</p>\r\n\r\n<p>フランス領ギアナの公用語はフランス語だが、アメリカインディアンの言語も数多く話されている。宗教はローマ・カトリックが主体です。経済は、鉱業、伐採、農業、漁業に大きく依存している。</p>\r\n\r\n<p>フランス領ギアナは南米諸国連合の一員である。</p>\r\n\r\n<p>フランス領ギアナの地理</p>\r\n\r\n<p>南アメリカ大陸の北東部、ブラジルとスリナムの間に位置するフランス領ギアナ。北と東は大西洋に面し、南はカリブ海に面している。総面積83,534km²（32,253平方マイル）、人口256,595人（2018年推計）の領土である。</p>\r\n\r\n<p>この地域は密林の熱帯雨林が多く、総面積の83％を占めています。沿岸部は森林が多いが、内陸部は大部分が開けたサバンナである。フランス領ギアナの最高峰は、国土の中央に位置するモン・ドール（標高1,850m、6,070フィート）である。</p>\r\n\r\n<p>フランス領ギアナの気候は熱帯性で、年間を通じて高温多湿の気候である。年間平均気温は26℃、年間平均降水量は2,500mmです。</p>\r\n\r\n<p>フランス領ギアナの経済</p>\r\n\r\n<p>フランス領ギアナの経済は、主に鉱業、伐採、農業、漁業で成り立っている。主な輸出品目は金、ボーキサイト、アルミナ、木材、エビ、バナナなどである。主な貿易相手国はフランス、アメリカ、オランダである。</p>\r\n\r\n<p>フランス領ギニア経済は、フランス政府からの補助金に大きく依存している。これらの補助金は、この地域のGDPの約30％を占めている。</p>\r\n\r\n<p>フランス領ギアナのインフラは比較的未発達で、高いレベルの貧困と失業に悩まされている。また、医療や教育の質もフランスの平均を下回っています。</p>\r\n\r\n<p>フランス領ギアナの人口</p>\r\n\r\n<p>フランス領ギアナの人口は256,595人（2018年推計値）です。フランス系が多数を占めますが、アメリンド人も多く、全人口の35％を占めています。その他の民族としては、オランダ人、ポルトガル人、中国人がいます。</p>\r\n\r\n<p>フランス領ギアナの公用語はフランス語ですが、アメリカインディアンの言語も数多く話されています。宗教はローマ・カトリックが主流です。</p>\r\n\r\n<p>フランス領ギアナの生活の質は、フランスの平均を下回っています。貧困と失業率が高く、インフラも比較的未整備です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
