    locations_country_298.article =  importer.locate_object(Article, "id", Article, "id", 6614, {'id': 6614, 'excerpt': 'French Guiana', 'kicker': 'French Guiana', 'content': "<p>French Guiana is an overseas department and region of France located in South America between Brazil and Suriname. It borders the Atlantic Ocean to the north and east, and the Caribbean Sea to the south. It has a land area of 83,534 km² (32,253 sq mi) and a population of 256,595 (January 2018).</p>\r\n\r\n<p>French Guiana is divided into two arrondissements, Cayenne and Saint-Laurent-du-Maroni, and 18 communes. Its capital is Cayenne, which is also the capital of French Guiana as a whole. It is one of the most sparsely populated regions of the world, with a population density of 3 inhabitants per square kilometre (8/sq mi).</p>\r\n\r\n<p>The department of French Guiana was created on March 4, 1947, when it was split off from the Guianas department, which became Suriname. Before that, it was an integral part of the French colonial empire, and its inhabitants were French citizens. The region is separated from the rest of France by the mouth of the Amazon River, and the densely forested Oyapock River.</p>\r\n\r\n<p>The official language of French Guiana is French, but a large number of Amerindian languages are also spoken. The predominant religion is Roman Catholicism. The economy is based largely on mining, logging, farming, and fishing.</p>\r\n\r\n<p>French Guiana is a member of the Union of South American Nations.</p>\r\n\r\n<p>The geography of French Guiana</p>\r\n\r\n<p>French Guiana is located on the northeast coast of South America, between Brazil and Suriname. It borders the Atlantic Ocean to the north and east, and the Caribbean Sea to the south. The territory has a total area of 83,534 km² (32,253 sq mi), and a population of 256,595 (2018 estimate).</p>\r\n\r\n<p>The region is dominated by dense rainforest, which covers 83% of the total land area. The coasts are heavily forested, but the interior is largely open savannah. The highest point in French Guiana is Mont d'Or (1,850 m or 6,070 ft), located in the centre of the country.</p>\r\n\r\n<p>The climate of French Guiana is tropical, with a hot and humid climate year-round. The average annual temperature is 26°C (79°F), and the average annual rainfall is 2,500 mm (98 in).</p>\r\n\r\n<p>The economy of French Guiana</p>\r\n\r\n<p>The economy of French Guiana is based largely on mining, logging, farming, and fishing. The main products exported are gold, bauxite, alumina, timber, shrimp, and bananas. The main trading partners are France, the United States, and the Netherlands.</p>\r\n\r\n<p>The French Guianan economy is heavily dependent on subsidies from the French government. These subsidies account for approximately 30% of the region's GDP.</p>\r\n\r\n<p>The infrastructure of French Guiana is relatively undeveloped, and the region suffers from high levels of poverty and unemployment. The quality of healthcare and education is below the French average.</p>\r\n\r\n<p>The population of French Guiana</p>\r\n\r\n<p>The population of French Guiana is 256,595 (2018 estimate). The majority of the population is of French descent, but there is also a significant population of Amerindians, who comprise 35% of the total population. Other ethnic groups include Dutch, Portuguese, and Chinese.</p>\r\n\r\n<p>The official language of French Guiana is French, but a large number of Amerindian languages are also spoken. The predominant religion is Roman Catholicism.</p>\r\n\r\n<p>The quality of life in French Guiana is below the French average. The region suffers from high levels of poverty and unemployment, and the infrastructure is relatively undeveloped.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
