    locations_country_299.article =  importer.locate_object(Article, "id", Article, "id", 6615, {'id': 6615, 'excerpt': 'フランス', 'kicker': 'フランス', 'content': '<p>フランスは、ヨーロッパ大陸の西部に位置する国である。人口は約6,600万人で、欧州連合（EU）の中で6番目に人口の多い国として位置づけられています。また、フランスは世界で最も人気のある観光地の一つであり、パリは地球上で最も訪問者数の多い都市である。フランス経済は世界第6位であり、世界で最も経済が発展している国のひとつとされています。</p>\r\n\r\n<p>フランス共和国は1958年に建国され、単一半大統領制の共和国である。フランスは大統領制をとっており、共和国大統領を国家元首、首相を政府首脳としています。フランス議会は二院制で、上院と国民議会で構成されている。</p>\r\n\r\n<p>フランス文化は、芸術、料理、ワイン、ファッション、建築で有名です。また、エッフェル塔、ルーブル美術館、ノートルダム大聖堂など、歴史的に有名な建造物が数多く存在する国でもあります。</p>\r\n\r\n<p>フランスの教育制度は世界で最も優れたもののひとつとされ、フランス語は世界で最も多く学ばれている言語のひとつでもあります。フランスは、国連、NATO、欧州連合、G7など、数多くの世界組織に加盟しています。</p>\r\n\r\n<p>フランス軍は世界で3番目に大きく、フランス陸軍、フランス海軍、フランス空軍で構成されています。フランス軍は世界の安全保障において重要な役割を担っており、アフリカ、中東、中央アジアなど、海外にも多数展開しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
