    locations_country_301.article =  importer.locate_object(Article, "id", Article, "id", 6617, {'id': 6617, 'excerpt': 'フィンランド', 'kicker': 'フィンランド', 'content': '<p>フィンランドは、スウェーデン、ノルウェーと国境を接する北欧の国です。国土は338,145平方キロメートル、人口は5,503,043人です。公用語はフィンランド語とスウェーデン語です。フィンランドは議会制の共和制国家です。首都であり、最大の都市はヘルシンキです。</p>\r\n\r\n<p>フィンランドは経済が発展し、生活水準が高い国です。主な輸出品目は林産物、金属製品、機械、電子機器です。欧州連合に加盟している。</p>\r\n\r\n<p>フィンランドは豊かな歴史と文化を持っています。8世紀から9世紀にかけて、遊牧民がこの国に定住しました。12世紀にはスウェーデン人がフィンランドを支配し、1809年にナポレオン戦争の一環としてロシアに割譲されるまで、スウェーデンの一部であった。1917年、フィンランドはロシアからの独立を宣言した。</p>\r\n\r\n<p>フィンランドはほぼ平坦な国土に、わずかに丘や山があるだけの国です。気候は温帯で、四季がはっきりしています。夏は暖かく、冬は寒く、雪がよく降ります。</p>\r\n\r\n<p>フィンランドは観光地として人気があり、特に夏場がおすすめです。歴史的、文化的な見どころの多いヘルシンキが最も人気のある観光地です。その他、フィンランド最北のラップランドや南部の湖水地方も人気の観光地です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
