    locations_country_303.article =  importer.locate_object(Article, "id", Article, "id", 6619, {'id': 6619, 'excerpt': 'フィジー', 'kicker': 'フィジー', 'content': '<p>フィジーは330以上の島々からなる群島で、その約3分の2が無人島である。太平洋の南西、ニュージーランドの北東に位置している。フィジーは1970年に英連邦内の共和国として独立した。</p>\r\n\r\n<p>フィジーの島々は火山性であり、いくつかの活火山がある。ビチレブ島とバヌアレブ島の2つの大きな島は、2つの別々の火山噴火によってできたものである。ビチレブ島のトマニビ山はフィジーで最も高い山で、標高は4,344フィート（1,324メートル）である。</p>\r\n\r\n<p>フィジーの気候は熱帯性で、気温は平均して華氏80度（約27度）以下です。雨季は11月から4月までです。</p>\r\n\r\n<p>フィジーの文化は、フィジー先住民、インド人、ヨーロッパ人の影響が混ざり合った豊かな文化を持っています。フィジーの先住民はメラネシア人であり、パプアニューギニアやソロモン諸島の人々と関係がある。インド人は1800年代初頭に年季奉公労働者としてフィジーに到着し始めた。現在、インド人社会はフィジーで最大の民族集団となっています。フィジーの公用語は英語ですが、フィジー語やヒンディー語も話されています。</p>\r\n\r\n<p>フィジーの経済は、観光、サトウキビ、漁業に基づいている。砂糖は主な輸出作物である。フィジーの経済発展は中程度であり、一人当たりのGDPは7,600ドルである。</p>\r\n\r\n<p>フィジーは議会制民主主義国家であり、大統領が国家元首である。首相は政府のトップである。一院制の国会には50人の議員がおり、任期は5年である。</p>\r\n\r\n<p>地理的には、フィジーは3つの主要な島嶼群に分かれている。北部のビチレブ島とバヌアレブ島、東部のラウ島、西部のヤサワ島である。各グループはそれぞれ独自の文化を持っています。</p>\r\n\r\n<p>フィジー最大の都市であり、首都はスバ。その他の主要都市はナンディとラウトカです。</p>\r\n\r\n<p>フィジーの人々は温かく親切で、島々は人気のある観光地となっています。多くのリゾートやホテルがあり、レストランやショップも充実しています。ビーチは美しく、ダイビングやシュノーケリングも楽しめます。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
