    locations_country_304.article =  importer.locate_object(Article, "id", Article, "id", 6620, {'id': 6620, 'excerpt': 'Fiji', 'kicker': 'Fiji', 'content': '<p>Fiji is an archipelago of more than 330 islands, about two-thirds of which are uninhabited. It is located in the southwestern Pacific Ocean, northeast of New Zealand. Fiji became an independent republic within the Commonwealth in 1970.</p>\r\n\r\n<p>The islands of Fiji are volcanic in origin, with some active volcanoes. The two largest islands, Viti Levu and Vanua Levu, are the result of two separate volcanic eruptions. Mount Tomanivi on Viti Levu is the highest point in Fiji at 4,344 feet (1,324 meters).</p>\r\n\r\n<p>The climate of Fiji is tropical, with temperatures averaging in the low 80s F (about 27 degrees C). The rainy season is from November to April.</p>\r\n\r\n<p>Fiji has a rich culture that is a blend of indigenous Fijian, Indian, and European influences. The indigenous people of Fiji are the Melanesians, who are related to the people of Papua New Guinea and the Solomon Islands. Indian people began arriving in Fiji in the early 1800s as indentured laborers. Today, the Indian community is the largest ethnic group in Fiji. The official language of Fiji is English, although Fijian and Hindi are also spoken.</p>\r\n\r\n<p>The economy of Fiji is based on tourism, sugarcane, and fishing. Sugar is the main export crop. Fiji has a moderate level of economic development, with a per capita GDP of $7,600.</p>\r\n\r\n<p>Fiji is a parliamentary democracy, with a president as the head of state. The prime minister is the head of government. The unicameral parliament has 50 members, who are elected for five-year terms.</p>\r\n\r\n<p>Geographically, Fiji is divided into three main island groups: Viti Levu and Vanua Levu in the north, the Lau Group in the east, and the Yasawa Group in the west. Each group has its own distinct culture.</p>\r\n\r\n<p>The largest city and the capital of Fiji is Suva. Other major cities include Nadi and Lautoka.</p>\r\n\r\n<p>The people of Fiji are warm and hospitable, and the islands are a popular tourist destination. There are many resorts and hotels, as well as a wide variety of restaurants and shops. The beaches are beautiful and the diving and snorkeling are excellent.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
