    locations_country_323.article =  importer.locate_object(Article, "id", Article, "id", 6639, {'id': 6639, 'excerpt': 'エクアドル', 'kicker': 'エクアドル', 'content': '<p>エクアドル共和国は、南アメリカ大陸の北西部に位置する国で、北はコロンビア、東と南はペルー、西は太平洋に面しています。大統領制をとる代表民主共和制国家である。首都はキト、最大の都市はグアヤキルである。</p>\r\n\r\n<p>エクアドルは、地球上で最も生物多様性に富んだ国のひとつです。16,000種以上の植物、1,500種の鳥類、オオアリクイ、ジャガー、アンデスコンドルなど500種の哺乳類が生息しています。ユネスコの世界遺産に登録されているガラパゴス諸島は、本土から西に約1,000kmの太平洋上に位置しています。体重300kgにもなる巨大なガラパゴスゾウガメをはじめ、ユニークな野生動物で知られています。</p>\r\n\r\n<p>エクアドルに初めて人が住み着いたのは、15世紀にやってきたインカ人でした。1532年、スペインの征服者フランシスコ・ピサロがエクアドルに侵攻し、インカの支配者アタフアルパを倒した。エクアドルはスペインの植民地となり、1822年に独立を宣言するまでスペインの支配下にあった。</p>\r\n\r\n<p>エクアドルの人口は1,650万人。国民の大多数（72％）はローマ・カトリック教徒で、18％はプロテスタント教徒である。公用語はスペイン語ですが、多くの先住民族の言語も話されています。</p>\r\n\r\n<p>エクアドルは発展途上国であり、南米で最も貧しい国の一つである。経済は農業、漁業、鉱業に大きく依存している。主な輸出品は、石油、バナナ、エビ、コーヒー、ココアなどである。</p>\r\n\r\n<p>エクアドルは国連（UN）、米州機構（OAS）、南米諸国連合（UNASUR）に加盟しています。</p>\r\n\r\n<p>エクアドルは、多様な風景と豊かな文化を持つ美しい国です。人々はフレンドリーで歓迎され、この国には世界で最も素晴らしい野生動物が生息しています。私はエクアドルへの訪問を強くお勧めします</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.429443+00:00")} ) 
