    locations_country_345.article =  importer.locate_object(Article, "id", Article, "id", 6661, {'id': 6661, 'excerpt': 'キューバ', 'kicker': 'キューバ', 'content': '<p>1959年、フィデル・カストロがキューバで共産主義革命を起こして以来、米国はこの島国と敵対関係を続けてきた。特に1961年のピッグス湾侵攻作戦は失敗し、米国は一貫してカストロ政権の転覆を図ってきた。1990年代初頭には、米国がキューバへの貿易禁止令を発動し、両国間の緊張はピークに達した。</p>\r\n\r\n<p>しかし、近年、キューバと米国の関係は雪解けし始めています。2014年、米国とキューバは大使館を再開するための交渉を開始し、2015年には両国は商業航空便を再開することで合意に達しました。</p>\r\n\r\n<p>2016年8月12日（金）、米国はキューバ・ハバナの大使館を再開しました。同大使館は、ピッグス湾侵攻作戦が行われた1961年以来、閉鎖されていた。</p>\r\n\r\n<p>ジョン・ケリー国務長官は再開式典のスピーチで、米国とキューバの間に進展があったことを賞賛しました。</p>\r\n\r\n<p>「私たちは隣人だ」とケリー氏。「友人であり、パートナーである。私たちはパートナーです。私たちは仲間です。そして、我々は共に前進することを決意している。"</p>\r\n\r\n<p>また、両国の関係を改善するために、まだやるべきことがあることを認めた。</p>\r\n\r\n<p>「キューバは正しい方向にいくつかの重要なステップを踏み出したが、まだやるべきことはある」とケリー氏は述べた。</p>\r\n\r\n<p>バラク・オバマ大統領も金曜日に発表した声明の中で、大使館の再開を賞賛している。</p>\r\n\r\n<p>「これは米国とキューバの関係正常化における重要な一歩だ」とオバマ大統領は述べた。</p>\r\n\r\n<p>また、両国の関係改善のために行われてきた作業を称賛し、議会に対して禁輸措置を解除するよう改めて呼びかけた。</p>\r\n\r\n<p>「私は、禁輸措置が最終的に解除されるよう、できる限りの努力をすることに変わりはない」とオバマ大統領は述べた。</p>\r\n\r\n<p>大使館が再開されて以来、アメリカ人観光客の間ではキューバへの関心が急上昇している。AP通信によると、キューバに旅行するアメリカ人の数は、2015年から74％増加した。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
