    locations_country_346.article =  importer.locate_object(Article, "id", Article, "id", 6662, {'id': 6662, 'excerpt': 'Cuba', 'kicker': 'Cuba', 'content': '<p>Since Fidel Castro led a communist revolution in Cuba in 1959, the United States has had an adversarial relationship with the island nation. The U.S. has consistently tried to overthrow the Castro regime, most notably through the failed Bay of Pigs Invasion in 1961. Tensions between the two countries reached a peak in the early 1990s, when the U.S. imposed a trade embargo on Cuba.</p>\r\n\r\n<p>However, in recent years, relations between Cuba and the U.S. have begun to thaw. In 2014, the U.S. and Cuba began to negotiate a deal to reopen their embassies, and in 2015, the two countries reached an agreement to reestablish commercial air travel.</p>\r\n\r\n<p>On Friday, August 12, 2016, the U.S. reopened its embassy in Havana, Cuba. The embassy had been closed since 1961, the year of the Bay of Pigs Invasion.</p>\r\n\r\n<p>In a speech at the reopening ceremony, Secretary of State John Kerry praised the progress that has been made between the U.S. and Cuba.</p>\r\n\r\n<p>“We are neighbors,” Kerry said. “We are friends. We are partners. We are colleagues. And we are determined to move forward together.”</p>\r\n\r\n<p>He also acknowledged the work that still needs to be done in order to improve relations between the two countries.</p>\r\n\r\n<p>“Cuba has made some significant steps in the right direction, but there is still more to be done,” Kerry said.</p>\r\n\r\n<p>President Barack Obama also praised the reopening of the embassy in a statement released on Friday.</p>\r\n\r\n<p>“This is an important step in the normalization of relations between the United States and Cuba,” Obama said.</p>\r\n\r\n<p>He also praised the work that has been done to improve relations between the two countries, and he reiterated his call for Congress to lift the embargo.</p>\r\n\r\n<p>“I remain committed to doing everything I can to see that the embargo is finally lifted,” Obama said.</p>\r\n\r\n<p>Since the reopening of the embassy, there has been a surge of interest in Cuba among American tourists. According to the Associated Press, the number of Americans traveling to Cuba has increased by 74 percent since 2015.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
