    locations_country_347.article =  importer.locate_object(Article, "id", Article, "id", 6663, {'id': 6663, 'excerpt': 'クロアチア', 'kicker': 'クロアチア', 'content': '<p>クロアチアは、ヨーロッパの中東部に位置し、アドリア海に面し、東にボスニア・ヘルツェゴビナ、北東にセルビア、北西にモンテネグロ、南西にスロベニアと国境を接しています。面積は56,594平方キロメートル（21,851平方マイル）、人口は429万人で、そのうち89.6％がクロアチア人である。首都であり最大の都市はザグレブで、人口は110万人です。</p>\r\n\r\n<p>クロアチアは、ユーゴスラビアの崩壊に伴い、1991年に独立した国家である。議会制の共和制国家で、経済はサービス業がGDPの78％を占めている。主な輸出品目は輸送機器、食品、飲料、タバコなどです。クロアチアは、2013年に加盟した欧州連合の一員です。</p>\r\n\r\n<p>クロアチアは、豊かな歴史と多様な文化を持つ魅力的な国です。素晴らしいビーチや透明な海、古代遺跡や美しい建築物など、さまざまな魅力を楽しむことができます。クロアチアには誰もが楽しめる何かがあり、訪れた人の心に残ることでしょう。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
