    locations_country_349.article =  importer.locate_object(Article, "id", Article, "id", 6665, {'id': 6665, 'excerpt': 'コスタリカ', 'kicker': 'コスタリカ', 'content': '<p>コスタリカは、中米の太平洋岸に位置し、北はニカラグア、南はパナマと国境を接する国です。豊かな熱帯雨林、多様な野生生物、エコツーリズムで知られています。コスタリカは発展途上国であり、国民の大半が貧困にあえいでいます。2011年の国連開発計画の報告書では、コスタリカは世界で最も幸福な国としてランク付けされています。</p>\r\n\r\n<p>コスタリカは立憲民主主義国家であり、大統領が国家元首であり、政府のトップである。大統領は4年の任期で選出され、最大2期まで務めることができます。立法権は一院制の立法議会にあり、任期3年の選挙で選ばれた57名の議員で構成されています。司法は行政府や立法府から独立しています。</p>\r\n\r\n<p>コスタリカの経済は、農業、観光業、サービス業を基盤としている。コーヒーとバナナが主な輸出品で、コスタリカは米国との間で自由貿易協定を結んでいます。観光業は経済の重要な部門であり、コスタリカは中米で最も人気のある観光地の一つです。生物多様性が豊かで、エコツーリズムが盛んなことも、観光客を惹きつけている。コスタリカのGDPの大半はサービス業が占めており、コスタリカ政府は同国を「環境に優しい」旅行先としてアピールするために多大な努力を払っています。</p>\r\n\r\n<p>コスタリカは世俗的な国であり、信教の自由は憲法に明記されています。宗教はカトリック教会が主流で、国民の70％以上がカトリック教徒です。しかし、少数派ながらプロテスタントも存在し、また、少数のユダヤ人もいます。</p>\r\n\r\n<p>コスタリカの教育制度は分権化されており、6歳から15歳までが義務教育となっています。教育制度は、初等教育、中等教育、高等教育の3段階に分かれています。コスタリカには、公立・私立を問わず、数多くの大学があります。</p>\r\n\r\n<p>また、コスタリカの医療制度は分権化されており、政府はすべての国民に無料で医療を提供しています。国内には公立・私立の病院が多数あり、医療の質は総じて高い。しかし、貧困層の多さ、犯罪率の高さ、農村部での医療アクセスの制限など、多くの課題を抱えています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
