    locations_country_353.article =  importer.locate_object(Article, "id", Article, "id", 6669, {'id': 6669, 'excerpt': 'コロンビア', 'kicker': 'コロンビア', 'content': '<p>コロンビアは、南アメリカ大陸の北西部に位置する国である。北西にパナマ、東にベネズエラとブラジル、南にエクアドルとペルー、北にカリブ海に面している。コロンビアの面積は1,141,748 km²で、南米で4番目に大きな国である。2015年のコロンビアの人口は46,815,836人と推定されています。</p>\r\n\r\n<p>現在のコロンビアの領土には、もともとムイスカ族、キンバヤ族、タイロナ族などの先住民族が住んでいた。1492年にクリストファー・コロンブスがこの地を探検し、スペイン王国の領有を主張した。16世紀にはスペインによる征服が始まり、19世紀半ばにはグランコロンビア連邦の一部となった。</p>\r\n\r\n<p>20世紀、コロンビアはさまざまな内戦、クーデター、独裁政権に耐えてきた。1886年に共和制に移行してからは、高い貧困率、所得格差、武力紛争など、さまざまな経済問題を経験した。しかし、コロンビアには豊かな文化や歴史があり、さまざまな動植物が生息しています。</p>\r\n\r\n<p>コロンビアの首都であり最大の都市はボゴタで、2015年の人口は739万2,958人です。第二の都市はメデジンで、2015年の人口は2,491,274人です。コロンビアの他の主要都市は、カリ、バランキヤ、カルタヘナ、ブカラマンガなどです。</p>\r\n\r\n<p>コロンビアは大統領制をとる立憲共和制国家である。大統領は国家と政府のトップであり、1期4年の任期で選出される。コロンビア議会は二院制で、100名の議員からなる下院と32名の議員からなる上院から構成されています。</p>\r\n\r\n<p>コロンビアで話されている主な言語はスペイン語で、その後に何百万人ものアメリカインディアン言語が話されています。宗教はキリスト教が主流で、人口の約90％がローマカトリック教徒です。</p>\r\n\r\n<p>コロンビアは、農業、鉱業、製造業、サービス業を基盤とした混合経済です。コロンビアは、コーヒー、バナナ、花の主要生産国です。コロンビアはまた、石炭、石油、金の重要な生産国でもあります。2015年のコロンビアのGDPは5748億ドルと推定されています。</p>\r\n\r\n<p>コロンビアの経済は近年大きく成長しており、2000年から2010年にかけてGDPは年平均4.6％増加している。しかし、依然として貧困率が高く、2010年には人口の約54%が貧困ライン以下で生活しています。また、所得格差も問題で、2010年には人口の10％の富裕層が10％の貧困層の31倍もの所得を得ています。</p>\r\n\r\n<p>コロンビアは暴力と紛争の長い歴史を持ち、1960年代にさかのぼる武力紛争が続いています。この紛争は、政府とFARCやELNなどのさまざまな反政府武装集団との間の闘争によって煽られてきました。この紛争で22万人以上が死亡し、数百万人が避難している。</p>\r\n\r\n<p>紛争は続いていますが、コロンビアには多くの観光地があります。首都ボゴタ、コーヒートライアングル地域、カリブ海沿岸のカルタヘナ市、アンデス山脈、アマゾンの熱帯雨林などがその例である。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
