    locations_country_354.article =  importer.locate_object(Article, "id", Article, "id", 6670, {'id': 6670, 'excerpt': 'Colombia', 'kicker': 'Colombia', 'content': '<p>Colombia is a country located in the northwestern part of South America. The country is bordered to the northwest by Panama; to the east by Venezuela and Brazil; to the south by Ecuador and Peru; and to the north by the Caribbean Sea. Colombia has an area of 1,141,748 km², making it the fourth largest country in South America. The population of Colombia was estimated to be 46,815,836 in 2015.</p>\r\n\r\n<p>The territory of what is now Colombia was originally inhabited by indigenous peoples including the Muisca, the Quimbaya, and the Tairona. Christopher Columbus explored the area in 1492, and claimed it for the Spanish Crown. In the 16th century, the Spanish began to conquer the region, and by the mid-19th century, Colombia was part of the Gran Colombia confederation.</p>\r\n\r\n<p>The 20th century saw Colombia endure various civil wars, coups and dictatorships. The country became a republic in 1886, and has since experienced a variety of economic problems, including a high rate of poverty, income inequality, and armed conflict. However, Colombia also has a rich culture and history, and is home to a variety of flora and fauna.</p>\r\n\r\n<p>The capital and largest city of Colombia is Bogotá, with a population of 7,392,958 in 2015. The second largest city is Medellín, with a population of 2,491,274 in 2015. Other major cities in Colombia include Cali, Barranquilla, Cartagena, and Bucaramanga.</p>\r\n\r\n<p>Colombia is a constitutional republic with a presidential system. The president is the head of state and government, and is elected for a single four-year term. The Congress of Colombia is a bicameral legislature, consisting of a 100-member Chamber of Representatives and a 32-member Senate.</p>\r\n\r\n<p>The primary language spoken in Colombia is Spanish, followed by millions of speakers of Amerindian languages. The predominant religion is Christianity, with around 90% of the population identifying as Roman Catholic.</p>\r\n\r\n<p>Colombia has a mixed economy, which is based on agriculture, mining, manufacturing, and services. The country is a leading producer of coffee, bananas, and flowers. Colombia is also a significant producer of coal, oil, and gold. The GDP of Colombia was estimated to be $574.8 billion in 2015.</p>\r\n\r\n<p>The economy of Colombia has seen significant growth in recent years, with the GDP increasing by an average of 4.6% per year from 2000 to 2010. However, the country still has a high rate of poverty, with around 54% of the population living below the poverty line in 2010. Income inequality is also a problem, with the wealthiest 10% of the population earning 31 times more than the poorest 10% in 2010.</p>\r\n\r\n<p>Colombia has a long history of violence and conflict, with an ongoing armed conflict dating back to the 1960s. The conflict has been fueled by the struggle between the government and various rebel groups, including the FARC and the ELN. More than 220,000 people have been killed in the conflict, and millions have been displaced.</p>\r\n\r\n<p>Despite the ongoing conflict, Colombia is home to a number of tourist destinations. These include the capital city of Bogotá, the Coffee Triangle region, the city of Cartagena on the Caribbean coast, the Andes Mountains, and the Amazon rainforest.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
