    locations_country_355.article =  importer.locate_object(Article, "id", Article, "id", 6671, {'id': 6671, 'excerpt': '中国', 'kicker': '中国', 'content': '<p>一人っ子政策</p>\r\n\r\n<p>1979年以来、中国は人口増加を抑制するために、都市部の夫婦の子供は1人、農村部の夫婦の子供は2人に制限する政策をとっている。一人っ子政策と呼ばれるこの政策は、中国内外で論争の的になっている。支持者は、この政策が4億人の出生を防ぎ、多くの人々を貧困から救うのに役立っていると主張する。一方、この政策が強制的な中絶や不妊手術を含む多くの人権侵害につながっているという批判もある。</p>\r\n\r\n<p>一人っ子政策は、中国の指導者である鄧小平が人口増加に対抗するために最初に提案したものです。当時、中国の人口は10億人を超えており、2000年には16億人に達すると推定されていた。この政策はすぐに実施され、現在に至っている。</p>\r\n\r\n<p>一人っ子政策は、農村部に住む夫婦を除く、中国のすべての夫婦に適用される。農村部では、最初の子どもが女性であれば、夫婦で2人の子どもを持つことができます。最初の子どもが男性の場合は、もう一人子どもを持つことができます。ただし、第一子に障害がある場合や、子供を持てない場合など、例外もある。</p>\r\n\r\n<p>一人っ子政策については、中国国内外から賛否両論が寄せられている。一人っ子政策の支持者は、この政策が中国の人口増加を抑制することに成功していると主張している。中国の人口は現在14億人と推定され、今後20年間で15億人のピークに達すると予測されている。一方、この政策への批判は、強制的な中絶や不妊手術など、数多くの人権侵害を引き起こしてきたと主張している。</p>\r\n\r\n<p>この政策が最初に制定されて以来、数多くの人権侵害が報告されている。その中には、妊娠後期に行われることが多い強制的な中絶も含まれています。また、中絶を拒否した女性には強制不妊手術が行われるケースもあります。また、親が子どもを捨てることを強要されたり、子どもが売られて養子に出されたりするケースも報告されています。</p>\r\n\r\n<p>このような問題はあるものの、一人っ子政策は中国の人口増加を抑制することに成功している。現在、中国の人口は14億人と推定され、今後20年で15億人のピークに達すると予測されている。また、この政策により、多くの中国人が貧困から脱することができました。近年、中国では貧困層が劇的に減少し、2億5千万人から3千万人へと減少した。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
