    locations_country_357.article =  importer.locate_object(Article, "id", Article, "id", 6673, {'id': 6673, 'excerpt': 'チリ', 'kicker': 'チリ', 'content': '<p>チリは、南アメリカ大陸の西海岸にある細長い国である。長さは約2,700マイル、幅は最も広いところで約175マイルである。北はペルー、東はボリビアとアルゼンチン、西と南は太平洋に囲まれている。</p>\r\n\r\n<p>チリは民主的な政府を持つ共和制国家である。国家元首である大統領は、国民によって選出されます。立法機関である議会も国民によって選出されます。司法は独立しています。</p>\r\n\r\n<p>チリの公用語はスペイン語です。</p>\r\n\r\n<p>チリの人口は約1,600万人です。さまざまな人種や宗教の人がいます。最も多いのは白人で、人口の約60パーセントを占めています。次に多いのはインディアンで、人口の約25％を占めています。最大の宗教はローマ・カトリックで、国民の約90％が信仰している。</p>\r\n\r\n<p>ほとんどの人が都市部に住んでいます。最大の都市はサンチアゴで、人口は約400万人です。</p>\r\n\r\n<p>チリの経済は、農業、鉱業、製造業を基盤としている。主な作物は小麦、大麦、ジャガイモ、リンゴ、ブドウ。主な鉱物は銅、鉄、硝酸塩、銀。主な製造品は繊維、衣料、食品、木材、金属製品などである。</p>\r\n\r\n<p>チリは交通網が発達している。道路は整備され、国土を縦断する鉄道もある。また、通信網も発達している。新聞や雑誌も多く、ラジオ局やテレビ局も充実している。</p>\r\n\r\n<p>チリは教育制度も充実しています。多くの学校や大学があり、高等教育制度も充実しています。</p>\r\n\r\n<p>チリは変化に富んだ景観を持つ美しい国です。北部は主に砂漠、中部は肥沃な渓谷、南部は山地です。また、湖や川、森も多い。</p>\r\n\r\n<p>チリは住むのに適した場所です。国民は友好的で、政府は民主的です。経済もよく、生活水準も高い。交通の便がよく、教育制度も整っている。景観も変化に富んでいて、美しい国です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
