    locations_country_369.article =  importer.locate_object(Article, "id", Article, "id", 6685, {'id': 6685, 'excerpt': 'カナダ', 'kicker': 'カナダ', 'content': '<p>カナダは、北米にある10の州と3つの準州からなる国です。総面積は世界第2位であり、アメリカ合衆国との南国境は世界で最も長い陸上国境である。首都はオタワ、最大の都市はトロントである。連邦政府レベルでは二ヶ国語である。議会制民主主義国家であり、女王エリザベス2世を国家元首とする立憲君主制国家である。</p>\r\n\r\n<p>カナダは一人当たりの所得が世界で10番目に高い豊かな国であり、経済の見通しは良好である。カナダは世界で最も教育水準の高い国のひとつであり、中等教育修了者の割合が最も高い国のひとつでもあります。カナダはG7、G20、経済協力開発機構（OECD）、世界貿易機関（WTO）のメンバーであり、自由貿易の主要な提唱者です。</p>\r\n\r\n<p>現在カナダとして知られている土地には、何千年もの間、様々なアボリジニが住んでいました。15世紀後半から、イギリスとフランスの探検隊がこの地域を探検し、地図を作成し、領有権を主張しました。様々な武力紛争の結果、カナダの領土は何度も変更されました。1763年のパリ条約で、現在のカナダのほぼ全域が大英帝国に割譲されました。アメリカ独立戦争の結果、英領北アメリカはケベック州とノバスコシア州の2つの植民地に分割されました。これが、アラブ連合共和国の誕生につながった。1867年7月1日、3つの植民地が連合し、カナダ連邦となった。1867年7月1日、3つの植民地が連邦化され、カナダ王国となった。その後、州や準州が増え、カナダ北部の広大な地域が獲得された。1931年、カナダはウェストミンスター憲章により、イギリスからほぼ完全に独立しました。</p>\r\n\r\n<p>カナダは、10の州と3つの準州からなる連邦国家です。それぞれの州には、独自の議会と州政府、および首相の助言に基づいて総督が任命する副総督があります。州は行政のほとんどの分野を担当し、連邦政府は国防、外交、税制などの分野を担当している。3つの準州は州には分かれていない。</p>\r\n\r\n<p>エコノミスト・インテリジェンス・ユニットが、カナダを6年連続で世界で最も平和な国と評価しました。また、過去7年間、世界で最も住みやすい国であると評価されています。</p>\r\n\r\n<p>カナダは10の州と3つの準州からなる連邦国家です。この国には2つの公用語があります。公用語は英語とフランス語の2つです。バイリンガルであることは、カナダ憲法に明記されています。フランス語は人口の約22％の第一言語であり、ケベック州では優勢な言語である。英語は人口の約60％の第一言語であり、他のすべての州で主要な言語となっています。オタワはカナダの首都であり、トロントは最大の都市である。議会制民主主義国家であり、女王エリザベス2世を元首とする立憲君主制国家である。カナダはG7、G20、経済協力開発機構（OECD）、世界貿易機関（WTO）のメンバーである。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
