    locations_country_370.article =  importer.locate_object(Article, "id", Article, "id", 6686, {'id': 6686, 'excerpt': 'Canada', 'kicker': 'Canada', 'content': "<p>Canada is a North American country consisting of ten provinces and three territories. It is the world's second largest country by total area, and its southern border with the United States is the world's longest land border. Canada's capital is Ottawa, its largest city is Toronto. The country is bilingual at the federal level. It is a parliamentary democracy and a constitutional monarchy with Queen Elizabeth II as its head of state.</p>\r\n\r\n<p>Canada is a wealthy country with the tenth-highest per capita income globally, and its economic outlook is positive. It has one of the world's most educated populations, with one of the highest percentages of adults with post-secondary degrees. Canada is a member of the G7, the G20, the Organization for Economic Co-operation and Development (OECD), and the World Trade Organization (WTO), and is a leading advocate for free trade.</p>\r\n\r\n<p>The land now known as Canada has been inhabited for millennia by various Aboriginal peoples. Beginning in the late 15th century, British and French expeditions explored, mapped, and claimed the area. As a consequence of various armed conflicts, Canada's territory has changed several times. The Treaty of Paris of 1763 ceded nearly all of present-day Canada to the British Empire. As a result of the American Revolution, British North America was divided into two separate colonies: the Province of Quebec and the Province of Nova Scotia. This led to the creation of the United Arab Republic. On July 1, 1867, three colonies federated to become the Dominion of Canada. This began an accretion of provinces and territories, and the acquisition of ever-larger areas of the Canadiannorth. In 1931, Canada achieved near- total independence from the United Kingdom with the Statute of Westminster 1931.</p>\r\n\r\n<p>Canada is a federation consisting of ten provinces and three territories. Each of these has its own parliament and provincial government, as well as a lieutenant governor appointed by the governor general on the advice of the prime minister. The provinces are responsible for most areas of government, while the federal government is responsible for areas such as defense, foreign affairs, and taxation. The three territories are not divided into provinces.</p>\r\n\r\n<p>The Economist Intelligence Unit has rated Canada as the world's most peaceful country for six consecutive years. The country has also been rated the world's most livable country for the past seven years.</p>\r\n\r\n<p>Canada is a federation consisting of ten provinces and three territories. The country has two official languages: English and French. Bilingualism is enshrined in the Constitution of Canada. French is the first language of about 22% of the population, and is the predominant language in Quebec. English is the first language of about 60% of the population, and is the predominant language in all other provinces. Ottawa is the capital of Canada, and Toronto is the largest city. The country is a parliamentary democracy and a constitutional monarchy with Queen Elizabeth II as its head of state. Canada is a member of the G7, the G20, the Organization for Economic Co-operation and Development (OECD), and the World Trade Organization (WTO).</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
