    locations_country_371.article =  importer.locate_object(Article, "id", Article, "id", 6687, {'id': 6687, 'excerpt': 'カメルーン', 'kicker': 'カメルーン', 'content': '<p>カメルーンは、中央アフリカに位置する国である。ナイジェリア、チャド、コンゴ共和国と国境を接している。250以上の異なる民族から構成され、フランス語と英語が公用語である。首都はヤウンデで、最大の都市はドゥアラである。カメルーンのGDPは275億ドルで、人口は2400万人と推定されている。</p>\r\n\r\n<p>カメルーン共和国は、1960年にフランスから独立した。カメルーンは大統領制をとっており、大統領は国民投票によって選出される。大統領の任期は7年で、再選挙が可能である。首相は大統領によって任命され、政府のトップとなる。一院制の国民議会には180名の議員がおり、国民投票により選出されます。司法は行政、立法府から独立しています。</p>\r\n\r\n<p>カメルーンは国連、アフリカ連合、フランコフォニーに加盟している。また、中央アフリカ経済共同体（ECCAS）、中央アフリカ関税経済連合（UDEAC）、東アフリカ共同体（EAC）のメンバーでもある。</p>\r\n\r\n<p>カメルーンは発展途上国であり、人間開発指数では188カ国中144位にランクされている。平均寿命が55歳と短く、乳幼児死亡率が高い（出生1,000人あたり115人死亡）。また、貧困率も高く、人口の60％以上が貧困ライン以下で生活しています。カメルーンの経済は主に農業に依存しており、コーヒーとココアが主な輸出品となっています。また、ウラン、金、石油などの鉱物資源も有している。</p>\r\n\r\n<p>カメルーンには豊かな文化遺産があり、様々な伝統舞踊、音楽、工芸品がある。また、ザンガ・サンガ特別保護区、ブンバベク国立公園、ザクーマ国立公園など、多くの国立公園を有している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.430442+00:00")} ) 
