    locations_country_403.article =  importer.locate_object(Article, "id", Article, "id", 6719, {'id': 6719, 'excerpt': 'ベラルーシ', 'kicker': 'ベラルーシ', 'content': '<p>ベラルーシ共和国、通称ベラルーシは、東ヨーロッパの内陸国で、東はロシア、南はウクライナ、西はポーランド、北はリトアニアとラトビアに隣接しています。人口は900万人以上、面積は207,600平方キロメートルです。首都であり、最大の都市はミンスクである。</p>\r\n\r\n<p>ベラルーシの歴史は9世紀までさかのぼります。この地域にはスラブ民族が住み始め、その後13世紀にモンゴル人に征服されました。1793年にロシア帝国の一部となり、1917年のロシア革命後もソビエト連邦の一部であった。ベラルーシは1991年にソビエト連邦からの独立を宣言し、以来、主権国家として歩んでいる。</p>\r\n\r\n<p>ベラルーシは大統領制の共和制国家で、混合経済である。政府は、行政、立法、司法の三権分立を保障する1994年憲法に基づいている。大統領は国家元首であり、国民によって選出され、任期は5年である。首相は政府の長であり、大統領によって任命される。立法府は一院制の国民議会で、110名の議員が5年の任期で選出されます。</p>\r\n\r\n<p>国連、欧州評議会、集団安全保障条約機構、ユーラシア経済連合に加盟している。ロシアと密接な関係にあり、さまざまな機関から人権侵害を指摘されている。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
