    locations_country_407.article =  importer.locate_object(Article, "id", Article, "id", 6723, {'id': 6723, 'excerpt': 'バングラデシュ', 'kicker': 'バングラデシュ', 'content': '<p>1971年、東パキスタンの人々はパキスタン政府に反抗して蜂起した。パキスタン軍は残忍な力で応戦し、数千人のベンガル人を殺害した。1971年12月、インド軍が反乱軍側に介入し、パキスタン軍は鎮圧された。東パキスタンは独立国バングラデシュとなった。</p>\r\n\r\n<p>バングラデシュは、国土のほとんどが海抜10メートル以下の低平地である。そのため、洪水に見舞われることが多く、壊滅的な被害を受けることがある。1988年の大洪水では、1,000人以上が死亡し、数百万人が避難した。</p>\r\n\r\n<p>また、バングラデシュは人口密度が非常に高い国でもある。1億6,000万人以上の人口を抱え、世界で8番目に人口の多い国です。このため、国民に十分な食料、住宅、その他の基本的ニーズを提供する上で、深刻な問題が生じています。</p>\r\n\r\n<p>しかし、近年、バングラデシュの経済発展は目覚しいものがあります。2008年以降、年平均6.3%のGDP成長率を記録し、貧困率は2002年の56%から2016年には31%まで低下しています。</p>\r\n\r\n<p>バングラデシュはイスラム教徒が多い国であり、イスラム教が正式な宗教となっています。しかし、同国には大規模なヒンズー教の少数派も存在する。バングラデシュでは、少数派のヒンドゥー教徒が大きな迫害を受けており、大規模なヒンドゥー教徒の虐殺が何度も起こっています。</p>\r\n\r\n<p>バングラデシュは議会制民主主義国家であり、大統領が国家元首である。首相は政府のトップである。現在の首相は2009年から就任しているシェイク・ハシナ。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
