    locations_country_409.article =  importer.locate_object(Article, "id", Article, "id", 6725, {'id': 6725, 'excerpt': 'バーレーン', 'kicker': 'バーレーン', 'content': '<p>バーレーンはペルシャ湾に浮かぶ群島で、イスラム教スンニ派のハリーファ家が率いる立憲君主制国家である。人口は140万人で、そのうち70％がイスラム教シーア派である。バーレーンは1783年以来、ハリーファ一族が統治している。アル・ハリーファ家はイスラム教のスンニ派に属している。バーレーンは何世紀にもわたって、この地域の貿易と商業の重要な中心地であった。バーレーンはアメリカ海軍の第五艦隊の本拠地である。</p>\r\n\r\n<p>国家元首であるハマド・ビン・イサ・アル・ハリーファ国王は、1961年から1999年までバーレーンを統治したイサ・ビン・サルマン・アル・ハリーファの息子である。国王は政府のトップである首相を任命する。首相は議会の下院である国民議会の多数党から指名される。国民議会は選挙で選ばれた40人の議員と任命された30人の議員で構成されている。バーレーンは混合経済で、人口は140万人。国内総生産は358億ドルである。バーレーンの主な輸出品は、原油と石油製品です。</p>\r\n\r\n<p>2011年2月、隣国のエジプトとチュニジアで民主化運動が勃発し、バーレーンは騒乱状態に陥った。バーレーン政府はこの抗議デモに対し、反対派指導者の逮捕やデモ参加者への武力行使などの弾圧を行いました。2011年11月、国王によって任命されたバーレーン独立調査委員会は、2011年2月と3月の出来事を調査し、その報告書を発表した。報告書では、政府が拘束者に対して過剰な力と拷問を行ったこと、警察が政府支持者による虐待からデモ参加者を保護しなかったことが明らかにされた。また、報告書は、すべての政治犯の釈放と国家安全保障局の解散を勧告した。バーレーン政府は報告書の所見と勧告を受諾した。</p>\r\n\r\n<p>2012年5月、国王は憲法改正の勅令を発布し、国会に大きな権限を与えた。この改正は、国会議長の選挙を国会議員によって行うこと、国会上院議員の3分の1を下院議員によって選出すること、下院の多数党によって首相を選出することを定めている。</p>\r\n\r\n<p>2012年10月、国会下院は軍事事件で民間人を裁く裁判所の設置法案を承認した。この法案は、軍が恣意的な手続きで民間人を裁くことを可能にし、公正な裁判を受ける権利を規定していないとして、人権団体から反対されていた。法案は2012年11月に国会上院で可決され、2012年12月に国王が署名して成立した。</p>\r\n\r\n<p>2013年1月、政府は政府および治安部隊による人権侵害の疑惑を調査する委員会の設置法案を承認した。委員会は国際的な専門家によって構成される予定である。</p>\r\n\r\n<p>2013年6月、国王は労働者が組合を結成できるよう労働法を改正する政令を発布した。同令は団体交渉権やストライキ権を規定。また、ストライキを組織したり参加したりしたことを理由に労働者を解雇することを禁止している。</p>\r\n\r\n<p>2013年11月、国会下院は、政府内の汚職疑惑を調査する委員会の設置法案を承認した。委員会は国際的な専門家で構成される予定である。</p>\r\n\r\n<p>アル・ハリファ家のメンバーは以下の通り。</p>\r\n\r\n<p>1.ハマド・ビン・イサ・アル・ハリファ（Hamad bin Isa Al Khalifa）-国王</p>\r\n\r\n<p>2.イサ・ビン・サルマン・アル・ハリーファ（Isa bin Salman Al Khalifa）-国王の父。</p>\r\n\r\n<p>3.ハリファ・ビン・サルマン・アル・ハリファ（国王の叔父、首相） 4．</p>\r\n\r\n<p>4.モハメド・ビン・サルマン・アル・ハリーファ（国王の従兄弟、国防相） 5.</p>\r\n\r\n<p>5.サルマン・ビン・ハマド・アル・ハリファ - 国王の息子、副皇太子</p>\r\n\r\n<p>6.ハリファ・ビン・ハマド・アル・ハリファ（Khalifa bin Hamad Al Khalifa） - 国王の弟</p>\r\n\r\n<p>7.ナセル・ビン・ハマド・アル・ハリファ（Nasser bin Hamad Al Khalifa） - 国王の息子</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
