    locations_country_413.article =  importer.locate_object(Article, "id", Article, "id", 6729, {'id': 6729, 'excerpt': 'アゼルバイジャン', 'kicker': 'アゼルバイジャン', 'content': '<p>アゼルバイジャンは、ユーラシア大陸のコーカサス地方に位置する内陸国である。北にロシア、南と東にイラン、西にアルメニア、北西にグルジアと国境を接している。ナフチバン島は北と東にアルメニア、南と西にイランと国境を接し、北西にトルコと国境を接している。</p>\r\n\r\n<p>アゼルバイジャンは、紀元前8世紀にさかのぼる豊かで古い文化を持っています。シルクロードの中心地であり、ロシア帝国、ソビエト連邦、アゼルバイジャン民主共和国など、歴史上さまざまな帝国に支配されてきた。</p>\r\n\r\n<p>1991年の独立以来、アゼルバイジャンは世俗的な民主主義国家として、国連に加盟している。石油と天然ガスの主要産地であり、その経済は石油産業が主体となっています。アゼルバイジャンは、欧州評議会とNATOの平和のためのパートナーシッププログラムにも加盟しています。</p>\r\n\r\n<p>アゼルバイジャンは大陸を横断する国であり、人口は約950万人です。人口の大半はアゼルバイジャン人で、ロシア人、アルメニア人、タリシュ人が少数民族として続いています。公用語はアゼルバイジャン語ですが、ロシア語も広く話されています。</p>\r\n\r\n<p>アゼルバイジャンは大統領制の共和制国家である。大統領は国家元首で、政府首脳は首相です。混合経済で、世界銀行は高所得国に分類しています。</p>\r\n\r\n<p>アゼルバイジャンは独立国家共同体、欧州安全保障協力機構、欧州大西洋パートナーシップ評議会、非同盟運動のメンバーである。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
