    locations_country_417.article =  importer.locate_object(Article, "id", Article, "id", 6733, {'id': 6733, 'excerpt': 'オーストラリア', 'kicker': 'オーストラリア', 'content': '<p>オーストラリアは、南半球に位置する国で、オーストラリア大陸の本土とタスマニア島、インド洋と太平洋に浮かぶ多数の小島から構成されています。総面積は世界で6番目に大きい国です。北にインドネシア、東ティモール、パプアニューギニア、東にソロモン諸島、バヌアツ、ニューカレドニア、南にニュージーランドが隣接している。</p>\r\n\r\n<p>オーストラリアは、連邦制の議会制立憲君主制国家であり、連邦の権限分担がなされている。オーストラリア連邦が正式な国名である。首都はキャンベラで、オーストラリア首都特別地域に位置しています。オーストラリアの人口は約2,300万人です。</p>\r\n\r\n<p>オーストラリアは先進国であり、世界で最も裕福な国のひとつで、世界第12位の経済規模を誇ります。人間開発の面でも、オーストラリアは出生時平均寿命が82歳と高く、生活水準も高い。国名の由来は、古くから南半球にある仮想の大陸の名前として使われていたラテン語のTerra Australis（テラ・アウストラリス）に由来している。</p>\r\n\r\n<p>オーストラリアは、砂漠、熱帯雨林、険しい山脈など、多様な地形が特徴です。海岸線は珊瑚礁に囲まれ、その長さは2万5千キロメートル以上にも及びます。オーストラリア本土は、太平洋とインド洋に浮かぶ島々に囲まれています。北東部には、世界最大のサンゴ礁であるグレート・バリア・リーフが広がっています。</p>\r\n\r\n<p>オーストラリアには、カンガルー、ワラビー、ウォンバット、ディンゴ、コアラなど、実に様々な動物が生息しています。鳥類も多様で、オウム、エミュー、カワセミなどが生息しています。植物相も多様で、熱帯雨林、温帯雨林、ユーカリ林、花を咲かせるヒースランドなどがあります。</p>\r\n\r\n<p>20世紀初頭から、オーストラリアはウラン、金、その他の鉱物の重要な産出地となっています。また、世界経済の主要なアクターとなり、大規模な製造業を築き上げてきました。オーストラリアの文化は、先住民の伝統文化や世界各国からの移民によって発展してきました。最も大きな影響を受けているのはイギリスとアイルランドで、次いで中国、ギリシャ、イタリアとなっています。</p>\r\n\r\n<p>オーストラリアは、国連、国際連合、アジア開発銀行、G20、経済協力開発機構に加盟しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
