    locations_country_421.article =  importer.locate_object(Article, "id", Article, "id", 6737, {'id': 6737, 'excerpt': 'アルメニア', 'kicker': 'アルメニア', 'content': '<p>アルメニア共和国は、西にトルコ、北にグルジア、東にイランとアゼルバイジャンに囲まれたトランスコーカサス地方の内陸国である。首都であり、最大の都市はエレバンである。アルメニアは、古くからの文化遺産を持つ、単一民族、複数政党、民主主義の国民国家である。</p>\r\n\r\n<p>アルメニアに最初に定住した人類は、紀元前3千年紀末に到着したヒュリア人である。紀元前9世紀に成立したウラルトゥ王国は、この地域で最も強力な国家となった。紀元前6世紀にペルシャのアケメネス朝がこの地域を征服し、以後、アルタクシア朝、パルティア帝国の一部となった。アルメニアのアルササイド朝は何世紀にもわたって国を支配し、その間にキリスト教を公式の宗教として採用した最初の国家となった。</p>\r\n\r\n<p>中世初期、アルメニアはセルジューク朝、モンゴル帝国、オスマントルコの侵攻を受けた。その後、ロシアの支配を経て、1918年にアルメニアは共和国として独立した。しかし、アルメニア第一共和国は短命に終わり、1920年にソビエト連邦に吸収された。1991年に独立したアルメニア共和国が再興された。</p>\r\n\r\n<p>1991年の独立以来、アルメニアは内政・外政の両面で困難に直面してきた。ソビエト連邦の経済的遺産、アゼルバイジャンとのナゴルノ・カラバフ戦争、世界金融危機の影響などに悩まされてきた。アルメニアはユーラシア経済連合と集団安全保障条約機構に加盟している。</p>\r\n\r\n<p>アルメニアは南コーカサスに位置する内陸国で、西はトルコ、北はグルジア、南はイラン、東はアゼルバイジャンと国境を接しています。面積は29,743平方キロメートル、人口は約300万人。首都であり最大の都市はエレバンで、人口は109万人。</p>\r\n\r\n<p>アルメニアに最初に定住した人類は、紀元前3千年紀後半に到着したヒュリア人であった。紀元前9世紀に成立したウラルトゥ王国は、この地方で最も強力な国家となった。紀元前6世紀にペルシャのアケメネス朝がこの地域を征服し、以後、アルタクシア朝、パルティア帝国の一部となった。アルメニアのアルササイド朝は何世紀にもわたってこの国を支配し、その間にキリスト教を公式の宗教として採用した最初の国家となった。</p>\r\n\r\n<p>中世初期、アルメニアはセルジューク朝、モンゴル帝国、オスマントルコの侵攻を受けた。その後、ロシアの支配を経て、1878年にロシア帝国内の自治共和国となった。しかし、アルメニア第一共和国は短命に終わり、1920年にソビエト連邦に吸収された。1991年9月21日、ソビエト連邦の崩壊に伴い、独立したアルメニア共和国が再確立された。</p>\r\n\r\n<p>1991年の独立以来、アルメニアは内政・外政の両面で困難に直面してきた。ソビエト連邦の経済的遺産、アゼルバイジャンとのナゴルノ・カラバフ戦争、世界金融危機の影響などに悩まされてきた。アルメニア政府がナゴルノ・カラバフ共和国を承認したことに対抗して、アゼルバイジャンとトルコが実施した封鎖により、経済はさらに影響を受けている。アルメニアはユーラシア経済連合と集団安全保障条約機構に加盟している。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
