    locations_country_432.article =  importer.locate_object(Article, "id", Article, "id", 6748, {'id': 6748, 'excerpt': 'American Samoa', 'kicker': 'American Samoa', 'content': '<p>American Samoa is an unincorporated territory of the United States located in the South Pacific Ocean, southeast of Samoa. It consists of five main islands and two coral atolls. The total land area is 76 square miles (197 square kilometers) and the population was estimated at 55,519 in 2016. The official language is English.</p>\r\n\r\n<p>The first Europeans to sight American Samoa were the Dutch navigators Willem Schouten and Jacob Le Maire during their famous voyage of 1616–17. Schouten and Le Maire charted the islands as "A Land Without Trees."</p>\r\n\r\n<p>In 1872, the islands were claimed by the United States, becoming part of the Territory of Samoa. American Samoa became an unincorporated territory of the United States in 1899.</p>\r\n\r\n<p>The archipelago is located 2,600 miles (4,184 kilometers) south of Hawaii and 1,500 miles (2,414 kilometers) north of New Zealand.</p>\r\n\r\n<p>The main islands are Ofu, Olosega, Ta\'u, Tutuila, and Aunu\'u.</p>\r\n\r\n<p>The two coral atolls are Swains Island (Olosega) and Rose Atoll (Ta\'u).</p>\r\n\r\n<p>The highest point is Mt. Alava (3,732 feet/1,138 meters).</p>\r\n\r\n<p>The climate is tropical marine.</p>\r\n\r\n<p>The currency is the United States dollar.</p>\r\n\r\n<p>The primary exports are canned tuna, coconut milk, copra, and handicrafts.</p>\r\n\r\n<p>The primary imports are food, fuel, and construction materials.</p>\r\n\r\n<p>The main transportation routes are by sea and air.</p>\r\n\r\n<p>The population of American Samoa is about 55,000, most of whom are Polynesian.</p>\r\n\r\n<p>The main religions are Christianity and Islam.</p>\r\n\r\n<p>The official language is English.</p>\r\n\r\n<p>The main industries are tuna canning, handicrafts, and tourism.</p>\r\n\r\n<p>American Samoa is a self-governing territory of the United States.</p>\r\n\r\n<p>The U.S. president appoints a governor who oversees the executive branch of the local government.</p>\r\n\r\n<p>The legislature is a bicameral body consisting of a House of Representatives and a Senate.</p>\r\n\r\n<p>The Samoan language is the primary language of American Samoa.</p>\r\n\r\n<p>English is the official language.</p>\r\n\r\n<p>The islands were first settled by Polynesians about 3,000 years ago.</p>\r\n\r\n<p>The first Europeans to sight American Samoa were the Dutch navigators Willem Schouten and Jacob Le Maire during their famous voyage of 1616-1617.</p>\r\n\r\n<p>The islands were claimed by the United States in 1872 and became part of the Territory of Samoa.</p>\r\n\r\n<p>In 1899, American Samoa became an unincorporated territory of the United States.</p>\r\n\r\n<p>In 1904, the islands were divided into two separate territories, the Territory of American Samoa and the Territory of Samoa.</p>\r\n\r\n<p>In 1929, the two territories were reunited as the Territory of Samoa.</p>\r\n\r\n<p>In 1962, the Territory of American Samoa was granted local self-government.</p>\r\n\r\n<p>In 1976, American Samoa adopted a constitution.</p>\r\n\r\n<p>In 1997, the people of American Samoa voted to become a self-governing territory of the United States.</p>\r\n\r\n<p>American Samoa is located in the South Pacific Ocean, southeast of Samoa.</p>\r\n\r\n<p>The total land area is 76 square miles (197 square kilometers).</p>\r\n\r\n<p>The population was estimated at 55,519 in 2016.</p>\r\n\r\n<p>The official language is English.</p>\r\n\r\n<p>The first Europeans to sight American Samoa were the Dutch navigators Willem Schouten and Jacob Le Maire during their famous voyage of 1616-1617.</p>\r\n\r\n<p>The islands were claimed by the United States in 1872 and became part of the Territory of Samoa.</p>\r\n\r\n<p>In 1899, American Samoa became an unincorporated territory of the United States.</p>\r\n\r\n<p>In 1904, the islands were divided into two separate territories, the Territory of American Samoa and the Territory of Samoa.</p>\r\n\r\n<p>In 1929, the two territories were reunited as the Territory of Samoa.</p>\r\n\r\n<p>In 1962, the Territory of American Samoa was granted local self-government.</p>\r\n\r\n<p>In 1976, American Samoa adopted a constitution.</p>\r\n\r\n<p>In 1997, the people of American Samoa voted to become a self-governing territory of the United States.</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
