    locations_country_433.article =  importer.locate_object(Article, "id", Article, "id", 6749, {'id': 6749, 'excerpt': 'アルジェリア', 'kicker': 'アルジェリア', 'content': '<p>アルジェリアは、北アフリカに位置する国です。人口は4,000万人以上で、アフリカ最大の国である。アルジェリアの公用語はアラビア語であるが、フランス語も広く使われている。アルジェリアの首都はアルジェです。</p>\r\n\r\n<p>アルジェリアはイスラム教徒が多い国で、人口の98％以上がイスラム教徒であるとされています。残りの2％はキリスト教徒またはユダヤ教徒です。アルジェリアのイスラム教はスンニ派が主流です。</p>\r\n\r\n<p>アルジェリアの歴史は長く、複雑です。オスマン帝国、フランス帝国、スペイン帝国など、さまざまな帝国に支配された。1962年、アルジェリアはフランスから独立した。</p>\r\n\r\n<p>独立後、アルジェリアは何人もの独裁者によって統治されてきた。1999年からはアブデラジズ・ブーテフリカが政権を握っている。ブテフリカは重病を患い、公の場にほとんど姿を現さないが、現在4期目の大統領に就任している。</p>\r\n\r\n<p>アルジェリアは貧しい国であり、一人当たりのGDPは10,600ドルである。経済は石油とガスの輸出に大きく依存しており、政府収入の60%以上を占めている。しかし、近年は原油価格の下落により苦境に立たされている。</p>\r\n\r\n<p>経済的な問題はあるものの、アルジェリアは依然として人気の高い観光地である。多様な風景、豊かな文化、歴史が、この国を魅力的な場所にしているのです。特にアルジェは、豊かな歴史を持つ美しい都市です。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
