    locations_country_434.article =  importer.locate_object(Article, "id", Article, "id", 6750, {'id': 6750, 'excerpt': 'Algeria', 'kicker': 'Algeria', 'content': "<p>Algeria is a country located in North Africa. It has a population of over 40 million people and is the largest country in Africa. The official language of Algeria is Arabic, although French is also widely spoken. The capital of Algeria is Algiers.</p>\r\n\r\n<p>Algeria is a Muslim-majority country, with over 98% of the population identifying as Muslim. The remaining 2% identify as Christian or Jewish. Sunni Islam is the predominant branch of Islam in Algeria.</p>\r\n\r\n<p>The history of Algeria is long and complicated. For centuries, it was controlled by various empires, including the Ottoman Empire, the French Empire, and the Spanish Empire. In 1962, Algeria gained its independence from France.</p>\r\n\r\n<p>Since gaining independence, Algeria has been ruled by a series of dictators. The most recent, Abdelaziz Bouteflika, has been in power since 1999. Bouteflika is currently in his fourth term as president, despite being seriously ill and rarely seen in public.</p>\r\n\r\n<p>Algeria is a poor country, with a GDP per capita of $10,600. The economy is based largely on oil and gas exports, which account for over 60% of the government's revenue. However, the country has been struggling in recent years due to the falling price of oil.</p>\r\n\r\n<p>Despite its economic problems, Algeria remains a popular tourist destination. The country's diverse landscape, rich culture, and history make it a fascinating place to visit. Algiers, in particular, is a beautiful city with a rich history.</p>", 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
