    locations_country_435.article =  importer.locate_object(Article, "id", Article, "id", 6751, {'id': 6751, 'excerpt': 'アルバニア', 'kicker': 'アルバニア', 'content': '<p>アルバニアは、ヨーロッパ南東部、バルカン半島に位置する小国です。北西にモンテネグロ、北東にコソボ、東にマケドニア、南と南東にギリシャと国境を接している。国土の大部分は山岳地帯である。アドリア海に面するアルバニアの海岸線は約200キロメートル。人口は約320万人です。アルバニアの公用語はアルバニア語です。アルバニアの主な宗教はイスラム教です。</p>\r\n\r\n<p>アルバニアは1912年の第一次バルカン戦争の後、独立国として誕生しました。第二次世界大戦中はイタリアに占領され、戦後はソビエト連邦に占領された。1944年、アルバニアは共産主義国家となり、ソ連支配の東欧圏の一部となった。1991年、ソビエト連邦の崩壊に伴い、アルバニアは共産主義を放棄し、複数政党による民主主義を確立した。</p>\r\n\r\n<p>アルバニアは議会制民主主義国家であり、大統領が国家元首、首相が政府元首である。大統領は国民によって選出され、任期は5年です。首相は大統領が指名し、国会で承認されます。アルバニア共和国議会は一院制で、140名の議員を有し、任期は4年です。アルバニアの主要政党は、社会党、民主党、アルバニアの未来のための同盟、正義・平等・統合のための党です。</p>\r\n\r\n<p>アルバニアの経済は、農業、鉱業、水力発電、観光を基盤としています。農業はGDPの約5分の1を占め、労働力の約3分の1を雇用しています。主な作物はタバコ、トウモロコシ、小麦、ジャガイモ、果物です。家畜は羊、ヤギ、牛、鶏が主体です。クロム、銅、鉄、亜鉛の埋蔵量も豊富である。水力発電は、同国の電力生産の約半分を占めている。主な観光地は、アルバニア・リビエラ、古都ジロカステール、ブトリント遺跡などである。</p>\r\n\r\n<p>アルバニアの気候は温帯大陸性気候で、冬は寒く雪が多く、夏は暖かく乾燥した気候です。年間平均降水量は約800ミリメートルです。主な観光シーズンは5月から9月です。</p>\r\n\r\n<p>アルバニアは、国連、欧州評議会、欧州安全保障協力機構、世界貿易機関、中央ヨーロッパ自由貿易協定に加盟しています。</p>', 'references': '', 'rating': 0.0, 'rating_count': None, 'published_date': dateutil.parser.parse("2023-07-03T02:53:18.372662+00:00"), 'updated_date': dateutil.parser.parse("2023-07-03T02:53:18.434442+00:00")} ) 
